INSERT INTO `com_competencias` (`com_id`, `com_nombre`, `com_descripcion`) VALUES
(1, 'FLEXIBILIDAD y GESTIÓN DEL CAMBIO', 'Capacidad para adaptarse a nuevas situaciones e impulsar cambios dentro de la Compañía. Incluye flexibilidad tanto cognitiva (apertura a puntos de vista distintos del suyo) como social y de entorno (capacidad para adaptarse a diferentes tipos de equipos e interlocutores).'),
(2, 'Autoaprendizaje', 'Habilidad para buscar y compartir información útil para la resolución de situaciones o adquirir mayores y mejores conocimientos para el propio desarrollo profesional y de la Empresa. Incluye la capacidad de capitalizar la experiencia de otros y la propia, propagando el know how adquirido.'),
(3, 'COMUNICACIÓN', 'Es la capacidad de escuchar y hacer preguntas, expresar conceptos e ideas de forma efectiva. La habilidad de saber cuándo y a quién dirigirse para llevar adelante un propósito. Comprender la dinámica de los grupos y el diseño efectivo de reuniones. Incluye la capacidad de comunicar por escrito de forma concisa y clara.'),
(4, 'Autonomía y toma de decisiones', 'Capacidad para identificar la causa de un problema y encontrar soluciones teniendo en cuenta los objetivos, prioridades, riesgos y el factor tiempo. Efectiva resolución ante problemas o dificultades. Capacidad para decidir, estar orientado a la acción y utilizar la iniciativa y la rapidez como ventaja competitiva.'),
(5, 'Delegación', 'Capacidad para asignar autoridad a una persona para llevar a cabo tareas específicas. La decisión del Directivo/Responsable de entregar la realización de ciertas actividades a un subordinado, con la finalidad de tener más tiempo para enfocarse en otras que sean más importantes y trascendentes para la gestión de la empresa y con esto mejorar la eficiencia del trabajo de la Organización. '),
(6, 'Dirección y desarrollo de personas', 'Habilidad de detectar necesidades de desarrollo, tanto de uno mismo como las de su equipo y proporcionar las herramientas adecuadas para el crecimiento profesional de las personas y de la misma Organización.'),
(7, 'COMPROMISO y DEDICACION A LA COMPAÑÍA', 'Sentir como propios los objetivos de la Organización. Apoyar e instrumentar decisiones, estando comprometido por completo, con el logro de objetivos comunes. Prevenir y superar obstáculos que interfieren con el logro de objetivos del negocio. Controlar la puesta en marcha de las acciones acordadas. Cumplir con los compromisos tanto  en forma como en plazo, proyectando una buena imagen de la Compañía.'),
(8, 'Dominio de uno mismo. Autoafirmación', 'Es el convencimiento de que uno es capaz de realizar con éxito una tarea o elegir el enfoque adecuado para resolver un problema. Esto incluye, abordar nuevos y crecientes retos con una actitud de confianza en las propias posibilidades, decisiones o puntos de vista. '),
(9, 'Pensamiento analítico y atención al detalle', 'Capacidad de entender una situación, dividiéndola en pequeñas partes o identificando paso a paso sus implicaciones. Incluye la organización sistemática de las partes de un problema o situación, la comparación entre diferentes elementos o aspectos y el establecimiento racional de prioridades. También incluye entender la sucesión de hechos en una secuencia y las relaciones causa-efecto de las cosas.'),
(10, 'Sensibilidad interpersonal', 'Capacidad para escuchar adecuadamente, para comprender y responder a pensamientos, sentimientos o intereses de los demás, sin que éstos los hayan expresado o los expresen sólo parcialmente.'),
(11, 'INICIATIVA e INNOVACIÓN', 'Predisposición a actuar de forma proactiva adelantándose a los acontecimientos y asumiendo riesgos.  Capacidad para aportar introducir e implementar ideas, procedimientos y estrategias de negocio con el fin de mejorar favoreciendo la eficiencia de la Organización.'),
(12, 'Liderazgo', 'Habilidad necesaria para orientar la acción de los equipos humanos en una dirección determinada, inspirando a la proactividad y anticipando escenarios. Es la capacidad de fijar objetivos y realizar su seguimiento y feedback, integrando opiniones de otros. Motivar e inspirar confianza así como asumir riesgos. Gestionar el cambio para asegurar la competitividad y efectividad a largo plazo. Plantear abiertamente los conflictos para optimizar la claridad de las decisiones y la eficiencia de la Organización. '),
(13, 'ORIENTACIÓN AL CLIENTE', 'Comportamiento de ayuda y compromiso a/con otros miembros de la Empresa o agentes externos vinculados comercialmente con la Organización. Radica en el deseo de ayudar o servir a los clientes, de comprender y satisfacer sus necesidades; esforzándose por conocer y resolver sus problemáticas. Incluye también a todos aquellos implicados que cooperen en la relación cliente - empresa.'),
(14, 'Persuasión, influencia y negociación', 'Capacidad para persuadir a otras personas, utilizar argumentos sólidos y honestos, y acercar posiciones mediante el ejercicio del razonamiento de conjunto que contemple los intereses de todas las partes intervinientes y los objetivos organizacionales. Habilidad de negociación y establecimiento de acuerdos satisfactorios.'),
(15, 'Resistencia a la presión', 'Capacidad para seguir actuando con eficacia en situaciones de presión, de tiempo, desacuerdo y adversidad. Es la capacidad para responder y trabajar con alto desempeño en situaciones de mucha exigencia.'),
(16, 'Planificación y organización. Establecimiento de prioridades', 'Capacidad para ordenar tareas conforme una secuencia lógica, asignando prioridades de forma sistemática y preparando las estructuras y elementos necesarios para que el servicio salga adelante. Incluye también la capacidad de organizar el trabajo de otros.'),
(17, 'TRABAJO EN EQUIPO', 'Implica la capacidad de colaborar y cooperar con los demás, de formar parte de un grupo y de trabajar conjuntamente para alcanzar una meta común, incluso, cuando la colaboración conduce a un objetivo que no está directamente relacionado con el interés personal. '),
(18, 'Visión de negocio', 'Capacidad para comprender y reaccionar ante las tendencias cambiantes del entorno, detectando las fluctuaciones del mercado de forma que se pueda actuar para asegurar la continuidad y progreso de la Organización.'),
(19, 'ORIENTACIÓN A RESULTADOS', 'Motivación para conseguir un objetivo planteado y realizar bien un trabajo. Es la tendencia al logro de las metas, fijando objetivos desafiantes por encima de los estándares, mejorando y manteniendo altos niveles de rendimiento en el marco de las estrategias de la Organización. ');
