(528, 'En las reuniones de tu área, ¿acostumbras a mantenerte en silencio pues consideras que tu opinión no es necesaria?', 144, 17),
(529, '¿Cumples con la parte de tu trabajo, demostrando un justo interés por el trabajo de los demás?', 144, 17),
(530, '¿Comparas que tu trabajo esté en relación al del resto del equipo?', 121, 17),
(531, 'Cuando asistes a reuniones, ¿te gusta intervenir en ellas tomando la palabra?', 121, 17),
(532, '¿Escucha las aportaciones de los miembros de tu equipo y apoyas las mejores para éste?', 121, 17),
(533, '¿Acostumbras a estar disponible para tus compañeros?', 121, 17),
(534, '¿Colaboras con los demás sin que se te pida expresamente?', 120, 17),
(535, '¿Demuestras tu confianza compartiendo información que va más allá de la estrictamente necesaria?', 120, 17),
(536, '¿Asumes el protagonismo sólo cuando crees que es necesario?', 120, 17),
(537, '¿Intercambias ideas con el resto del equipo para alcanzar mejoras y que éste sea más eficiente en el trabajo?', 120, 17),
(538, ' Marca líneas de actuación empresarial que le permitan a la Compañía competir en el mercado con estándares de excelencia.', 122, 18),
(539, ' Reacciona con rapidez ante los cambios del mercado, marcando vías de actuación que facilitan a la Compañía no perder el control de la situación.', 122, 18),
(540, ' Mantiene una actividad y un comportamiento encaminados a involucrar al equipo e inculcarles una orientación, clara y definida, de competitividad y oportunidad de mercado.', 122, 18),
(541, ' Puede emitir opiniones sobre los posibles cambios más inmediatos que se producirán en el entorno externo, y el impacto de los mismos, previendo acciones a tomar por/para la Compañía.', 122, 18),
(542, ' Analiza procedimientos o formas de operar de la Empresa, aportando ideas y emprendiendo acciones para hacer frente a la competencia.', 123, 18),
(543, ' Se mantiene al día respecto a “\"cómo se mueve el mercado\"” (tendencias actuales del mercado, cambios económicos, sociales, legislativos, variaciones del crecimiento del mismo, cuotas de competidores...) y lo tiene en cuenta.', 123, 18),
(544, ' Propone o emprende, en su caso, acciones que contribuyen a alcanzar los objetivos estratégicos y permitan así mantener y/o mejorar la posición de la Compañía en el mercado.', 123, 18),
(545, ' Se compromete frente al mercado (asume responsabilidades de actuaciones empresariales, participa en foros de decisión, etc.) con los principios de calidad y servicio propios de la Compañía.', 123, 18),
(546, ' Muestra interés por conocer las características (aún cuando no sea específico de su puesto de trabajo) para estar al día en la evolución del mercado en el que compite la Compañía.', 124, 18),
(547, ' Es capaz de percibir y analizar los cambios del entorno externo y la posible repercusión que para su Área/Departamento pueda tener.', 124, 18),
(548, ' Se mantiene informado respecto al desarrollo de nuevos productos y servicios de los competidores y es capaz de interpretar las posibles “\"amenazas”\" que ello pudiera suponer para la Compañía.', 124, 18),
(549, ' Puede ofrecer una explicación del posicionamiento de la Compañía respecto a las empresas de la competencia.', 124, 18),
(550, ' Es capaz de citar los principales competidores que la empresa tiene en el mercado y sus características básicas.', 125, 18),
(551, ' Conoce el sector externo y sus principales peculiaridades, del área de negocio de la Compañía, propia de su puesto de trabajo.', 125, 18),
(552, ' Puede nombrar las características básicas de diferenciación de la Compañía frente al mercado.', 125, 18),
(553, ' Puede hacer una ligera referencia a los cambios más relevantes que se produzcan en el mercado.', 125, 18),
(554, '¿Tienes interés por los cambios que se producen en el sector al que pertenece la Compañía?', 145, 18),
(555, '¿Conoces en profundidad todos los productos y/o servicios que comercializa la Empresa?', 145, 18),
(556, 'El mercado y sector al que pertenece la Organización, ¿los conoces en profundidad?', 145, 18),
(557, '¿Definirías como básicos tus niveles de conocimientos sobre la actividad de otros Departamentos que contribuyen en el negocio de la Compañía?', 145, 18),
(558, '¿Puedes citar los cambios más importantes que se producen en el sector al que pertenece la Empresa?', 125, 18),
(559, '   ¿Puedes citar las características básicas que diferencian a la Compañía frente a sus competidores?', 125, 18),
(560, '¿Conoces el sector externo y sus principales peculiaridades, del área de negocio de la Empresa, propia de tu puesto de trabajo?', 125, 18),
(561, '¿Serías capaz de citar a los principales competidores que tiene la Organización y sus características básicas?', 125, 18),
(562, '¿Serías capaz de explicar el posicionamiento de la Compañía respecto a las empresas de la competencia?', 124, 18),
(563, '¿Te mantienes informado sobre el desarrollo de nuevos productos o servicios de los competidores y, por lo tanto, eres capaz de interpretar las posibles “amenazas” que ello pudiera suponer para la Empresa?', 124, 18),
(564, '¿Eres capaz de percibir y analizar los cambios del entorno externo y la posible repercusión que para tu Área/Departamento puedan ocasionar?', 124, 18),
(565, '¿Tienes interés por conocer las características (aún cuando no sea requerido por tu puesto de trabajo) para estar al día en la evolución del mercado en el que compite la Compañía?', 124, 18),
(566, ' Analiza, presupuesta y evalúa el impacto de decisiones globales, tanto operativas como estratégicas.', 126, 19),
(567, ' Sus herramientas y métodos cuantitativos de gestión de resultados son utilizados por otras áreas de negocio.', 126, 19),
(568, ' Promueve y establece la fijación de nuevos objetivos estratégicos teniendo presente los recursos existentes.', 126, 19),
(569, ' Su afán de logro genera sinergias que optimizan y mejoran tanto resultados como procesos de la Organización.', 126, 19),
(570, ' Establece para su equipo objetivos específicos, medibles, alcanzables, retadores y acotados en el tiempo.', 127, 19),
(571, ' Diseña y elabora presupuestos con mínimas desviaciones en tiempo y costes favorables para el conjunto de la Organización.', 127, 19),
(572, ' Valora los costes de los proyectos que gestiona y los planifica eficientemente, desarrollando escenarios económicos.', 127, 19),
(573, ' Se le tiene en cuenta para la descripción de nuevos escenarios de actuación que pueden determinar la fijación de nuevos objetivos estratégicos.', 127, 19),
(574, ' Se fija objetivos retadores, ve los obstáculos como oportunidades, no acomodándose solamente en aquello que se le demanda.', 128, 19),
(575, ' Se preocupa por medir la eficacia en los proyectos que emprende, utilizando herramientas de gestión de proyectos.', 128, 19),
(576, ' Compara sus resultados con otros de otros años, Departamentos y extrae sus conclusiones para corregir si es debido.', 128, 19),
(577, ' Utiliza adecuadamente los recursos disponibles y se preocupa del valor de su actividad para la empresa.', 128, 19),
(578, ' Conoce los objetivos que le han marcado y establece prioridades para conseguirlos apoyándose en los recursos de la Organización.', 129, 19),
(579, ' Revisa regularmente el progreso de sus objetivos procurando no desviarse de las metas que se le han asignado.', 129, 19),
(580, ' No escatima esfuerzos a fin de terminar un trabajo o conseguir los resultados.', 129, 19),
(581, ' Se muestra autocrítico con su propio trabajo y busca las mejores formas para llevar con éxito su desempeño.', 129, 19),
(582, 'En el caso de no alcanzar los resultados demandados, ¿te justificas con argumentos que te exculpen?', 146, 19),
(583, 'Cumples con los objetivos que se esperan de ti, ¿aunque esperas al último momento, realizando un esfuerzo?', 146, 19),
(584, '¿Actúas basándote en normas/procedimientos estandarizados, sin embargo, consideras que estás poco atento a sí, con ellos, se consiguen los resultados que se te demandan?', 146, 19),
(585, 'Cumples con los objetivos que se te establecen, pero también ¿cuestionas o expresas tu queja cuando lo estimas oportuno?', 146, 19),
(586, '¿Eres autocrítico con tu propio trabajo y, por ello, buscas la mejor forma para llevarlo a cabo con éxito?', 129, 19),
(587, '¿Das el máximo, no escatimando esfuerzos para terminar un trabajo o bien por conseguir los resultados solicitados?', 129, 19),
(588, '¿Acostumbras a revisar con regularidad el progreso de tus objetivos, procurando no desviarte de las metas que te han asignado?', 129, 19),
(589, '¿Conoces tus objetivos y estableces prioridades para lograrlos apoyándote en los recursos que te brinda la Compañía?', 129, 19),
(590, '¿Empleas adecuadamente las herramientas disponibles en la Organización, preocupándote por el valor de tu actividad para la Empresa?', 128, 19),
(591, '¿Comparas tus resultados con los alcanzados en el pasado, sacando tus propias conclusiones para corregir si es necesario?', 128, 19),
(592, '¿Te preocupas por medir la eficacia de los proyectos en los que participas, utilizando herramientas de gestión de proyectos?', 128, 19),
(593, ' ¿Te marcas objetivos retadores, viendo los obstáculos como oportunidades, no acomodándote solamente en aquello que se te demanda?', 128, 19);
