(297, 45, 7, 'A', 'De mutuo acuerdo consideramos la pregunta 9 exagerada\r\n'),
(298, 45, 4, 'B', 'Debido a una dependencia de otro componente del equipo, la autonomía en muchos casos es parcial o condicionada, esto a su vez afecta a la competencia Flexibilidad. Gestión del cambio.\r\n'),
(299, 45, 3, 'A', 'Por las características del puesto es un competencia básica y obligada en el dia a dia\r\n'),
