(301, 45, 1, 'B', 'Discrepancia punto 7. Asumir y tomar nuevas responsabilidades.'),
(302, 45, 9, 'A', 'Discrepancia punto 12. Considero que en ciertas circustancias  se circunscribe a la zona conocida. Muy relacionado con Flexibilidad y autonomia\r\n'),
(303, 45, 10, 'A', ''),
(304, 45, 11, 'A', 'Discrepancia punto 12, en su ambito ok\r\n'),
(305, 45, 13, 'A', 'Interpretación errónea en que tipo de cliente. En su caso aplica el interno.'),
(306, 45, 14, 'A', ''),
(307, 45, 15, 'A', 'En caso de mucha presión, múltiples incidencias, se aprecia más estrés'),
(308, 45, 16, 'A', ''),
