(497, 57, 8, 'B', 'Tiene mucha confianza en sí misma. Su trato con los demás es cordial. En ocasiones actúa con demasiada firmeza. Antes nuevas tareas se basa en sus recursos o sabe buscarlos.'),
(498, 57, 7, 'C', 'Suele cumplir con su horario. Cumple las normativas internas aunque no siempre esté de acuerdo. En ocasiones se deja llevar y se siente desmotivada'),
(499, 57, 4, 'B', 'En ocasiones creo que toma alguna decisión más de lo que le corresponde aunque en general no precisa de supervisión directa. '),
(500, 57, 3, 'B', 'Su comunicación es ordenada. Reporta y me informa de las incidencias y sobre todo cuando piensa que la resolución es mi responsabilidad y no la suya.'),
(501, 57, 2, 'B', 'Le interesa mejorar por lo que tiene la necesidad de aprender. Muy abierta a las formaciones de la empresa'),
(502, 57, 1, 'B', 'Se adapta bien a los cambios aunque en un principio los cuestiona para finalmente adaptarse al cambio. Es una person flexible.'),
(503, 57, 9, 'B', 'Es una persona analítica aunque a veces tengo la sensación de que necesita encontrar ¨gazapos¨para quedar bien, porque hay otros detalles obvios que los pasa por alto.'),
(504, 57, 10, 'B', 'Tiene mucha capacidad para relacionarse con personas distintas a ella. No siempre vela por el buen clima del equipo. '),
(505, 57, 11, 'C', 'Tiene capacidad de iniciativa y decisión aunque creo que a veces se extralimita. Siente la necesidad de ser reconocida por clientes internos y externos. '),
(506, 57, 13, 'B', 'Siempre preocupada por satisfacer los requerimientos de los clientes y dispuesta a dar soluciones'),
