(691, 68, 1, 'A', 'Falta más comunicación/divulgación y convencimiento. Mas rollo predicador.\r\n'),
(692, 68, 2, 'A', 'Por la naturaleza dinámica del puesto, creo que conseguimos estar al dia.'),
(693, 68, 3, 'B', 'En los últimos ejercicios, el nivel de reporte a DG se ha reducido'),
(694, 68, 4, 'A', 'El equilibrio entre autonomía e ir por libre siempre es peligrosa. Considero que reporto lo \"grave\" / \"caro\" a Dirección cuando procede, y si no tiro palante.\r\n\r\n'),
(695, 68, 5, 'A', 'Lo que valoro más de mi equipo es que cada uno en su perfil tiene un conocimiento que yo no puedo abarcar, e intento aprovecharlo . También promuevo que participen en otras facetas de la compañía ajeno al dia dia.\r\n\r\n\r\n'),
(696, 68, 6, 'B', 'La rotación se intenta o más bien se busca backup\'s para periodos determinados\r\n\r\n\r\n'),
(697, 68, 7, 'A', 'Lo he revisado a posterior, y quizás es un poco exagerado todo con x. Pero creo sinceramente que el departamento y yo mismo cuando vemos que la \"compañía\" precisa de nuestro esfuerzo, lo realizamos.\r\n\r\n\r\n'),
(698, 68, 8, 'B', 'A veces falta una toma de decisión más energica. Me acomodo.\r\n\r\n\r\n'),
(699, 68, 9, 'A', 'Creo que una de las bases de Sistemas. Por tanto jugamos en ventaja en este aspecto.\r\n\r\n\r\n'),
(700, 68, 10, 'A', 'bufff dificil evaluarse\r\n\r\n\r\n'),
(701, 68, 11, 'A', 'Es obligación de IT promover la innovación. Quizás nos falta una mayor divulgación y mejor comunicación.\r\n\r\n\r\n'),
(702, 68, 12, 'A', 'Alguna pregunta creo que es complicado de responder\r\n\r\n\r\n'),
(703, 68, 13, 'A', 'Algunos puntos los referencio a cliente interno\r\n\r\n\r\n'),
(704, 68, 14, 'B', 'Persuasión e influencia, tiene relación con el tema comunicación. \r\n\r\n\r\n'),
(705, 68, 15, 'A', 'El último punto, no se si se debe valorar positivo o negativo. Lo cierto es que delante decisiones complejas requiero del consenso de DG'),
(706, 68, 16, 'A', 'Se realiza plenamente, el gran problema es que IT está en medio de muchos proyectos, y muchas veces la percepción es que se descuidan a unos y se favorecen a otros. Una vez más creo que la comunicación favorece.\r\n\r\n'),
(707, 68, 17, 'A', 'Me gusta el equipo de IT actual, es dificil de manejar sinceramente, y quizás es el punto más crítico del departamento.'),
(708, 68, 18, 'C', 'Relativo a IT, nos falta un mayor conocimiento de mercado y de la competencia.'),
(709, 68, 19, 'A', 'Me preocupa la sensación que a veces podemos dar de \"lentos\" cuando en muchas ocasiones sabemos que se nos solicitan soluciones \"caras\" no suficientemente analizadas y esperamos a su \"maduración\"\r\n\r\n'),
(710, 69, 8, 'C', 'Falta de seguridad,quiza por el poco tiempo que lleva.'),
(711, 69, 7, 'B', 'Falta de motivación ocasional. Buscar fórmulas de motivación. Consultar con RRHH.'),
