(859, 77, 19, 'A', 'Objetivo del día a día: acabar el día habiendo atendido a todos los envíos, contestando a todos los mails. \"Cuanta más experiencia, el objetivo se amplía a medida que adquieres más experiencia, más capacidad de absorber nuevos retos. Los objetivos son diarios\"\r\n\r\nCOMENTARIO GENERAL A LA EVALUACIÓN:\r\nLa autoevalución es muy favorable. Muestra una actitud muy positiva y segura ante todas las competencias. Se propone pueda expresar si considera precisar algún punto de apoyo.\r\n'),
