(892, 80, 8, 'B', 'No se siente incómodo ante nuevas mejoras y retos aunque reconoce que alguno le puede crear dificultades. Nos comprometemos a hablarlo para buscar soluciones'),
(893, 80, 7, 'B', 'Se siente comprometido con la empresa aunque creo que puede mejorar. La mejora que me pide es buscar soluciones para que no sea backup de tres personas. Me comprometo a estudiarlo.\r\n'),
(894, 80, 4, 'C', 'Toma decisiones aunque no estoy del todo convencida que sean las correctas, porque no profundiza demasiado. A partir de ahora me reportará para que entre los dos encontremos soluciones. Identifica problemas dentro de su conocimiento.'),
(895, 80, 3, 'C', 'Persona muy educada. Practica la escucha activa. Entiende que no me reporta demasiadas cosas, por lo que se compromete a hacerlo. En su comunicación, las ideas no siempre están bien ordenadas. Compromiso de uilizar y aportar conocimiento a la pagina del e'),
(896, 80, 2, 'C', 'En el ejemplo dado entiende que no va más allá por lo que se compromete a seguir ¨investigando¨. Por mi parte me comprometo en ayudarle en todo lo que esté de mi mano\r\nEJEMPLO:\r\nTe muestran un estudio en una hoja excel que te parece interesante. Crees rec'),
(897, 80, 1, 'B', 'En alguna ocasión los cuestiona los cambios para acabar asumiéndolos porque entiende que a veces es una mejora en pro de la empresa en general. Se compromete a consultarme la razón del cambio si no lo entiende	\r\n\r\nEJEMPLOS:\r\nPara el buen funcionamiento de'),
(898, 80, 9, 'B', 'Dependiendo del ejemplo dado reconoce que no es demasiado analítico. Se compromete a buscar mejores soluciones	\r\n\r\nEJEMPLOS:\r\nLos pedidos nunca se graban bien. El sistema no acepta los decimales si le pones un punto en lugar de una coma\r\n'),
(899, 80, 10, 'C', 'Ante el ejemplo reconoce que prejuzga sin analizar la situación. Se compromete a preguntar. Reconoce que se relaciona con personas afines a él pero que no tiene problema en hablar con otras personas en el ámbito laboral.	\r\n\r\nEJEMPLOS:\r\nEl día anterior vis'),
(900, 80, 11, 'B', 'Piensa que por su puesto de trabajo no puede tener demasidada iniciativa. Ante el ejemplo dado reconoce que no tiene demasiada. Se compromete a hablarlo conmigo y entre los dos ver la mejor solución. 	\r\n\r\nEJEMPLOS:\r\nTenemos orden por parte del cliente de '),
(901, 80, 13, 'B', 'Intenta ayudar al cliente en todo lo que puede. Siente que la empresa no cuenta con él para nuevas cuentas. Le explico el ejemplo y reconoce que no va más allá ya que espera que le dé más información.	\r\n\r\nEJEMPLOS:\r\nTe comento que tenemos un nuevo cliente'),
(902, 80, 14, 'C', 'Reconoce que le cuesta cerrar acuerdos y que cede bastante. La argumentación no es su ¨fuerte¨.	\r\n\r\nEJEMPLOS:\r\nUn companero de otro dpto. te pide que le hagas un favor y que realices una tarea de forma continuada, que consideras que no es tuya. \r\n'),
