INSERT INTO `com_dic_usr_com` (`duc_id`, `duc_du_id`, `duc_com_id`, `duc_grado`, `duc_observaciones`) VALUES
(1427, 111, 8, 'C', 'Persona bastante insegura, tiene la necesidad de que estemos ¨arropándola¨constantemente. Ante nuevas tareas, los demás debemos hacer el  desarrollo y enseñarle el procedimiento. Ella luego lo seguirá. En su trato con las personas internas/externas intent'),
(1428, 111, 7, 'C', 'Cumple con su horario establecido sin más. Si tiene que dejar el trabajo para los demás, lo hace y se marcha. Trabaja de manera totalmente independiente. Trabaja para cumplir con su obligacion y hace lo que se le pide, sin más motivación. Se queja de que '),
(1429, 111, 4, 'B', 'Toma decisiones de manera unilateral sin reportar y sin pensar en posibles consecuencias'),
(1430, 111, 3, 'C', 'Nunca reporta incidencias o posibles mejoras alegando que ya no se piden.  En su comunicación, tanto verbal como escrita, los datos no siempre están bien ordenados y es muy escueta. Por otra parte echa de menos las reuniones mensuales del Dpto. le explico'),
(1431, 111, 2, 'B', 'Aunque comenta que le gusta aprender y mejorar no siempre se siente interesada por las formaciones de empresa. Le cuesta aprender conocimientos por ella misma. Se compromete a actualizar los manuales colgados en red. Le gustaría hacer la formación DGR que'),
(1432, 111, 1, 'C', 'Puesto que no le gusta eneñar, ante nuevos compañeros se muestra impaciente y agresiva.  Asume bien nuevas funciones siempre y cuando ella piense que no es un retroceso  '),
(1433, 111, 9, 'B', 'Su trabajo consiste en utilizar su memoria, que es mucha, y poner en práctica los conocimientos adquiridos. La atención al detalle en este caso es buena. Pero no va mas allá\r\n'),
(1434, 111, 10, 'C', 'Prejuzga ´´porque todo el mundo lo hace´´. No es una persona empática. Tiene la necesidad de que la escuchen, más que escuchar. No es una persona conciliadora. En ocasiones genera conflictos. No interpreta correctamemte las palabras de otros. Siente la ne'),
(1435, 111, 11, 'C', 'En ocasiones tiene más iniciativa de la necesaria. Comenta que le gusta aportar ideas pero no lo hace a no ser que le preguntes constantemente. Es una persona que siente curiosidad por las cosas. Ante nuevos trabajos necesita que hagan otros el desarrollo'),
(1436, 111, 13, 'B', 'Tiene una buena predisposición ante el cliente interno/externo. Con el interno y dependiendo de su relación personal, mejor. Con el externo se muestra directa, escueta y algo seca.'),
(1437, 111, 14, 'C', 'Absoluta falta de persuasión. Incapaz de decir ¨no con argumentos¨, mucho menos si tiene una buena relación con el interlocutor, al final acaba haciendo la tarea aunque tenga insrucciones precisas de lo contrario. Ante la carencia de argumentación, lo sig'),
(1438, 111, 15, 'B', 'Trabaja bien con presión, es una persona muy ágil de mente. Su calidad mengua pero no excesivamente.'),
(1439, 111, 16, 'B', 'Se organiza y planifica bien, aunque no siempre organiza bien su tiempo'),
(1440, 111, 17, 'C', 'Aunque ella crea que sí, en mi opinión no trabaja bien en equipo. Todo depende del grado de confianza que tenga con los demás. Si tiene alguna rencilla con alguna persona, en  lugar de intenar resolverlo me traspasa a mi la responsabilidad. Para ella prev'),
(1441, 111, 18, 'C', 'Como el resto del equipo, no tiene una visión clara de negocio'),
(1442, 111, 19, 'C', '¨En el dia a dia se van cumpliendo los resultados¨\r\n\r\nCOMENTARIOS GENERALES:\r\nEn esta reunion también me ayudó Anna y debido a las circunstancias se intentó que fuera muy tranquila para que no se sintiera mal.\r\nLa valoración la baso en opiniones personale'),
