(1545, 118, 8, 'B', 'Se aprecian respuestas dudas en cuanto a su trabajo con seguridad/ respaldada por la organización!\r\n\r\n \"con el tiempo se adquieren conocimientos y experiencia. Se aprende cada día y esto se ha de ir trabajando. Es la maduración\"\r\n\r\n\r\n\r\n'),
(1546, 118, 7, 'A', 'Valoro como un 10'),
(1547, 118, 4, 'B', 'Seguiremos mejorando. Palabras textuales \" cuánta más maduración, más capacidad de toma de decisiones\"'),
