(2763, 242, 15, 'B', 'B-5: Aquí aunque pusimos \"no\" había mejora pues a mayor estrés nos comento que podía ocasionar mas fallos (también ha mejorado al llevar mas tiempo en la compañía ).\r\nA-9: Hemos puesto \"si\" pero hay que puntualizar que concretamente en su trabajo diario decide por si sola ante decisiones complejas.\r\nPunto a mejorar que pusimos fue el cambio de actitud ante una excesiva presión y tengo que decir que también ha mejorado bastante concretamente en su trabajo.\r\nCompromiso: controlar la actitud, y  la presión ante nuevas tareas.'),
