(1733, 129, 8, 'C', 'Es algo prematuro todavía. En este momento depende un poco del resto del quipo'),
(1734, 129, 7, 'B', 'Pone mucho interés por enterder las cosas y está muy comprometido '),
(1735, 129, 4, 'C', 'En prematuro valorar todavía'),
(1736, 129, 3, 'C', 'Esta es una de las principales mejoras que he detectado. Es una persona introvertida y tímida y esto interfiere en su relación con los demás y en la comunicación interdepartamental. En la verbal sus datos son algo desordenados. Como plan de mejora vamos a'),
(1737, 129, 2, 'C', 'De momento es él es que necesita de conocimiento. De todos modos muestra mucho interés en entender los conceptos'),
(1738, 129, 1, 'C', 'Aunque prematuro creo que es una persona abierta a cambios'),
(1739, 129, 9, 'C', 'Por lo que observo, es una persona analítica aunque faltará ver el grado'),
(1740, 129, 10, 'C', 'Es un persona basante introvertida y esto hace que no se comunique demasiado. En situación de conflicto se mantiene al margen'),
(1741, 129, 11, 'C', 'Es algo pronto todavia'),
(1742, 129, 13, 'C', 'Anotación SOCO:\r\nEsta competencia no quedo evaluada, he entrado un valor teórico para poder cerrar evaluación 2016\r\n'),
(1743, 129, 14, 'C', 'En este sentido necesitaría algo de formación como el resto del equipo'),
(1744, 129, 15, 'C', 'Es algo impaciente y esto provoca que tenga alguna dificultad aunque no lo demuestra'),
(1745, 129, 16, 'B', 'Es capaz de hacer varias cosas a la vez. Sabe priorizar y organizarse '),
(1746, 129, 17, 'B', 'Coopera en todo lo que puede. Por otra pare le he pedido que me ponga en copia en toda su cominicación escrita con el cliente para ayudarlo a formarse'),
