(1950, 142, 8, 'B', 'De acuerdo con el trabajo asignado, y por su experiencia puede trabajar con autonomía'),
(1951, 142, 7, 'B', 'Está comprometido con su trabajo y con la empresa aunque la labor que realiza en este momento sea más sencilla'),
(1952, 142, 4, 'C', 'Acepta que toma algunas decisiones que no le corresponderían por su puesto. A partir de ahora trasladará a su mando\r\n'),
(1953, 142, 3, 'C', 'Tiene algunas carencias y toma el compromiso de practicar más la escucha activa y también trasladar incidencias, mejoras, atc con Pilar y conmigo'),
(1954, 142, 2, 'C', 'Se basa en el conocimiento adquirido de su larga experiencia laboral. \r\nEJEMPLOS:\r\nTe muestran un estudio en una hoja excel que te parece interesante. Crees recordar esas formulas?'),
(1955, 142, 1, 'B', 'Se adapta a los cambios sin cuestionarlos aunque no colabora de forma activa\r\nEJEMPLOS:\r\nPara el buen funcionamiento de empresa, a partir de ahora deberemos rellenar en los pedidos, además del destinatario, su dirección completa, población, país y teléfon'),
(1956, 142, 9, 'C', 'Tiende a trabajar en \"automático\". En adelante intentará tener en cuenta más los detalles\r\nEJEMPLOS:\r\nLos pedidos nunca se graban bien. El sistema no acepta los decimales si le pones un punto en lugar de una coma'),
(1957, 142, 10, 'B', 'En ocasiones tiende a prejuzgar. Se compromete a escuchar mas y dialogar'),
(1958, 142, 11, 'C', 'Se siente cómodo con la rutina'),
(1959, 142, 13, 'B', 'Siente interés por los clientes de Airpharm y presta ayuda siempre que le sea posible.\r\nEJEMPLOS:\r\nTe comento que tenemos un nuevo cliente muy importante. Esperas a que te de mas informacion o intentas buscar informacion en su pagina web. Consultas en que'),
(1960, 142, 14, 'C', 'No tiene demasiada capacidad de persuasión puesto que le cuesta argumentar	\r\nEJEMPLOS:\r\nUn companero de otro dpto. te pide que le hagas un favor y que realices una tarea de forma continuada, que consideras que no es tuya. \r\n'),
(1961, 142, 15, 'C', 'En ocasiones de estrés reconoce que es algo pesimista y se ve superado'),
(1962, 142, 16, 'B', 'Conocedor de su trabajo, sabe distinguir lo importante de lo urgente basado en el día a día'),
(1963, 142, 17, 'C', 'Aunque es persona colaboradora, debido a su circunstancia no puede prestar demasiada colaboración'),
(1964, 142, 18, 'C', 'En general ningún colaborador tiene clara la visión General de Negocio en Airpharm. Creo que la empresa debería explicar más sobre sí misma'),
(1965, 142, 19, 'C', 'Bajo su punto de vista los resultados se van cumpliendo en el día a dia.'),
