(2014, 146, 8, 'B', 'Tiene mucha confianza en si mismo. En alguna ocasión puede perder las formas si no estás de acuerdo con él.'),
(2015, 146, 7, 'A', 'Se trata de una persona muy comprometida con su trabajo y se esfuerza por hacerlo bien, pudiendo contar con él ante cualquier requerimiento'),
(2016, 146, 4, 'C', 'Tiende a tomar decisiones que no le corresponden y si reporta lo hace a la par de su actuación'),
(2017, 146, 3, 'B', 'En su comunicación es correcto. Tiene la imperiosa necesidad de seguir su propio criterio. Si esta convencido de su teoría, le cuesta mucho dar \"su brazo a torcer\". No repota a no ser que le preguntes'),
(2018, 146, 2, 'B', 'En el trabajo, se basa en sus propios conocimientos creyendo que con esto dispone de todo el conocimiento aunque siente curiosidad por adquirir nuevos conceptos.'),
(2019, 146, 1, 'B', 'Se adapta al cambio no sin cuestionarlo antes. (\"lo hago porque se tiene que hacer pero no estoy de acuerdo\") '),
(2020, 146, 9, 'B', 'Según su criterio no es una persona detallista aunque por lo que comenta, no lo parece, porque resuelve sus propias incidencias antes de reportarlas. Intentaré fijarme'),
(2021, 146, 10, 'C', 'Tiende a prejuzgar sin analizar ni tampoco te da la oportuniad de escuchar. Tiene necesidad de ser escuchado mas que escuchar. Es posible que genere algún conflicto.'),
(2022, 146, 11, 'B', 'Aporta ideas y soluciones asumiendo la implantación'),
(2023, 146, 13, 'B', 'Siempre dispuesto a ayudar y dar soluciones , aunque desde la distancia (via mail) se siente más seguro que desde la cercanía. No se siente cómodo con el cliente delante.'),
(2024, 146, 14, 'C', 'Es una carencia general del Dpto. No sabe decir que \"no\" con argumentos y acaba asumiendo él mismo la tarea'),
(2025, 146, 15, 'C', 'Se esfuerza ante la presión para acabar desistiendo. Despues de esto, su discurso es negativo y sus quejas constantes.'),
(2026, 146, 16, 'B', 'Se organiza bien y sabe priorizar de acuerdo con los requerimientos que se le solicitan'),
(2027, 146, 17, 'B', 'Se muestra disponible cuando se le necesia. Es buen compañero. Compara su trabajo con el del resto del equipo. '),
(2028, 146, 18, 'C', 'Como el resto del Dpto, no tiene clara la visión de negocio'),
(2029, 146, 19, 'B', 'Prioriza los objetivos del equipo antes que los individuales'),
