(2116, 152, 8, 'B', 'dominio important. Pregunta 12?\r\n\r\nMEJORAS:\r\nseguimos mejorando el autocontrol para no dejarnos llevar por la energía negativa en momentos de estress.\r\nMás confianza, más flexibilidad . \"deixar anar és molt sà\"\r\n'),
(2117, 152, 7, 'B', 'y con el grupo?\r\n'),
(2118, 152, 4, 'B', 'muy autónomo. Sería bueno compartir más\r\n\r\nMEJORAS:\r\ncontinuamos compartiendo momentos de decisiones importantes'),
(2119, 152, 3, 'B', 'Muy bueno para sintetizar, ir al punto clave. Completar a veces alguna información.\r\n\r\nMEJORAS:\r\nVamos a trabajar la energía invisible- en la cual no sólo cuenta la comunicación verbal, si n la no verbal- transmitir al otro buscando su felicidad. Ponemos más atención a la necesidad del otro. \r\n'),
(2120, 152, 2, 'A', 'compartir el autoaprendizaje\r\n'),
(2121, 152, 1, 'B', 'Descripción Orgullo vs Flexible\r\n\r\nMEJORAS:\r\nTomamos conciencia de buscar la mejor manera de atender \"siempre\" al teléfono, priorizando las llamadas y/o disculpando la espera si el receptor lo permite'),
(2122, 152, 9, 'A', 'muy buena atención al detalle\r\n'),
(2123, 152, 10, 'A', 'muestra mucha educación y respeto\r\n\r\nMEJORAS:\r\nSensibilidad interpersonal: empatía con el otro				\r\nSeguimos pendientes de la necesidad de escuchar al otro. 				\r\n'),
(2124, 152, 11, 'A', ''),
(2125, 152, 13, 'A', 'muy buena orientación al cliente\r\n\r\nMEJORAS:\r\nseguir muy pendiente de las necesidades de lo otros- tanto cliente/proveedor/cliente interno. De acuerdo a nuestro desempeño como empresa de servicios.'),
(2126, 152, 14, 'B', ''),
(2127, 152, 15, 'B', 'MEJORAS:\r\nevaluar las situaciones de presión para seguir priorizando y relajarnos con la confianza en nosotros mismos '),
(2128, 152, 16, 'B', 'muy buena organización de su trabajo\r\n\r\nMEJORAS:\r\nseguimos con una MUY BUENA  planificación del trabajo'),
(2129, 152, 17, 'B', ''),
(2130, 152, 18, 'A', ''),
(2131, 152, 19, 'A', 'Muy involucrado por hacer bien el trabajo\r\n\r\nMEJORAS:\r\ncontinuar dando un servicio de atención personalizado'),
(2132, 153, 8, 'A', ''),
(2133, 153, 7, 'B', ''),
(2134, 153, 4, 'B', 'Contraresta la evaluación del riesgo con la intuición alimentada por la experiencia. Ofrece respuestas rápidas pero debido a la urgencia no siempre de calidad'),
(2135, 153, 3, 'B', 'El flujo de información es adecuado pero no regular. Comunica mejor los datos que las ideas\r\n'),
(2136, 153, 2, 'B', 'Posee conocimientos específicos en su área. Abierto a recibir formación complementaria'),
(2137, 153, 1, 'B', 'No siempre se comparte información, se considera que no siempre comporta crecimiento\r\n'),
(2138, 153, 9, 'B', ''),
(2139, 153, 10, 'A', ''),
(2140, 153, 11, 'B', ''),
(2141, 153, 13, 'B', 'A pesar de no siempre ofrecer información detallada ayuda a resolver los problemas y necesidades de trabajo. El tiempo y esfuerzo que se le requiera de forma adicional ha de estar justificado.\r\n'),
(2142, 153, 14, 'B', ''),
(2143, 153, 15, 'A', ''),
(2144, 153, 16, 'B', 'Los métodos de planificación de la compañía no resultan transparentes. El grado de impulsividad esta estrechamente relacionado con la presión del día a día\r\n'),
