(2231, 159, 8, 'B', 'Persona segura de si misma y muy respetuosa. En ocasiones se puede sentir incómoda ante nuevas situaciones pero se acaba adaptando.'),
(2232, 159, 7, 'A', 'Es una persona muy comprometida con la empresa \r\n'),
(2233, 159, 4, 'B', 'No requiere de mi supervisión para tomar decisiones aunque no estoy segura de que su análisis sea exahustivo.'),
(2234, 159, 3, 'C', 'En mi opinion, no es muy dada a comunicarme situaciones especiales con el cliente sino que intenta solucionarlas ella. Nos comprometemos a tener más comunicación entre nosotras'),
(2235, 159, 2, 'B', 'Es una persona inquieta y participa activamente en casi todas las formaciones propuestas, excepto en alguna de ellas, que requiera de una larga duracion en el tiempo, por su responsabilidad con el trabajo. \r\n\r\n\r\n'),
(2236, 159, 1, 'B', 'Se muestra abierta a los cambios con poca o casi ninguna reticencia aunque los afronta con algo de nerviosismo\r\n'),
(2237, 159, 9, 'C', 'Tras mostrarle un ejemplo reconoce que no es tan analítica como pensaba, por lo que se compromete a pensar más en el detalle'),
(2238, 159, 10, 'B', 'Silvia es una persona amable, cordial y extremadamente responsable. Se relaciona con todo el mundo. Intenta siempre velar por el buen clima laboral'),
(2239, 159, 11, 'B', 'Muy conocedora de su trabajo utiliza mecanismos conocidos aunque como ya he comentado antes se compromete a analizar más en detalla las posibles mejoras'),
(2240, 159, 13, 'B', 'Se puede contar con ella en todo momento. Intenta siempre ofrecer respuestas tanto al cliente externo como interno, aunque con el interno a veces tengo la sensación de que asume responsabilidades que no son suyas.'),
(2241, 159, 14, 'C', 'Como el resto del equipo no sabe decir ¨no¨ con argumentos. Después de mostrarle un ejemplo, reconoce que le falta argumentación'),
(2242, 159, 15, 'B', 'Ella resiste bien la presión, de hecho le gusta trabajar con presión, pero exterioriza demasiado nervisismo que repercute en las personas que le rodean. Lo ha entendido y vamos a poner soluciones a esto. '),
(2243, 159, 16, 'C', 'Se organiza bien aunque en puntas de faena no tengo claro que establezca demasiado un orden de prioridades por intentar asumir todo el trabajo. Me presto a darle más apoyo en esos momentos.'),
(2244, 159, 17, 'B', 'Está disponible para cualquiera de sus companeros y trabaja estrechamente con su backup. Participa actívamente en reuniones aunque primero prefiere escuchar.'),
(2245, 159, 18, 'C', 'Tiene poca  visión de negocio y le gustaría tener concepos más claros, por lo que entiendo, esto sería una tarea de comunicación por parte de la empresa.'),
(2246, 159, 19, 'B', 'No escatima en esfuerzos en conseguir los resultados aunque no tiene una medición de ellos'),
