(2587, 195, 13, 'B', 'Genis tiene una mente esquemática pero no analítica\r\n6. Como backup suya no tengo la sensación de que me explique de manera detallada y aunque le pregunte te explica de manera general\r\n11. Los de su responsabilidad sí\r\n'),
(2588, 195, 14, 'C', '5. pero más por obstinación que por argumentación\r\nTodo dependerá de su punto de vista. Si coincides, estupendo pero si no... cuesta hacerle entender'),
(2589, 195, 15, 'C', '3. En realidad le cambia el humor'),
(2590, 195, 16, 'B', ''),
