(2592, 195, 18, 'C', ''),
(2593, 195, 19, 'B', '8. Tiene muy en cuenta los objetivos,'),
(2594, 196, 8, 'B', 'C-2: Algunas veces le surge inseguridad.\r\nC-4: Un poco pues mas bien se acomoda a la rutina\r\nHa mejorado respecto al año anterior pero debemos seguir trabajando esta competencia es un poco  como la competencia de autonomía y toma de decisiones.\r\nMejora: Proporcionarle mas seguridad en si misma.\r\nCompromiso: Ella a que poco a poco sea mas autónoma y yo a no estar tan pendiente de ella.'),
(2595, 196, 7, 'A', 'A-12: En este comportamiento Mireia  no se sentía  del todo motivada anteriormente, creo que por la rutina de cada día hacer el mismo trabajo, por lo que la opción de mejora que se me ocurrió que podía funcionar y hemos puesto en marcha ha sido la de que todos los colaboradores incluyéndome yo podamos realizar  todas las tareas de nuestro departamento y creo que esta funcionando !!\r\nTengo que resaltar que Mireia tiene un compromiso  y dedicación alto  con la compañía.\r\nCompromisos: seguir haciendo cambios internos en nuestra área de trabajo para recibir mas motivación.'),
(2596, 196, 4, 'B', 'C-3: Aquí puntualizar que en algunas ocasiones \"si\".\r\nB-6: Perfectamente identifica y actúa, pero alguna vez aun necesita que le confirmes si es correcto lo que ella ha decidido.\r\nA-10: Da soluciones pero creo que sin tener presente las consecuencias  a largo plazo .\r\nEs mucho mas autónoma pero aún debemos de seguir mejorando mas.\r\nCompromiso: Introducir tareas que haga a que ella tome mas decisiones y se acostumbre a resolverlas sin ayuda de depender de mi. \r\n'),
(2597, 196, 3, 'B', 'B-6: En este comportamiento ha habido una mejora considerable pues  sus ideas son más claras a la hora de transmitirlas, aunque aún puede ser mejorada.(su comunicación es bastante mas firme).\r\nB-8: En este comportamiento también ha mejorado, la información que facilita es perfecta pero se apoya bastante en mi . \r\nAún habiendo estas pequeñas mejoras debo decir que Mireia es muy comunicativa pero le falta seguridad en si misma.\r\nEsta competencia la dejamos en puntuación \"B alta\".'),
(2598, 196, 2, 'B', 'B-8: En este comportamiento consideramos que como mejora faltaría algo de formación en el dpto. de aduanas para poder adquirir mas conocimientos.\r\nA-10: En este  comportamiento ha mejorado mucho  pero aún necesita algunas veces  corroborar conmigo  cuando surgen problemas.\r\nOpción de mejora: Seguir intentando a dar mas solución a los problemas por si  sola.\r\nCompromiso: ayudarla a buscar la manera mas propicia para resolver los problemas que puedan ir surgiendo en las distintas tareas, a través de toda la información que pueda aportarle por parte mía.'),
(2599, 196, 1, 'B', 'C-2: La mayoría de las veces espera instrucciones para realizar cambios, pero ha avanzado  en este aspecto pues anteriormente era siempre.\r\nLe he dado apoyo en este aspecto, por ejemplo haciendo que me diera ideas a la hora de realizar cambios.\r\nMejoras: Seguir contribuyendo a los cambios aportando más ideas y teniendo más iniciativa.\r\nCompromisos: Continuar ofreciéndole mi apoyo.'),
(2600, 196, 9, 'B', 'A-9: Ha mejorado en este comportamiento suele fijarse mas  en los detalles pero debemos de continuar mejorando.\r\nPara que pudiera mejorar en este comportamiento pensé en alguna tarea para trabajar mas la atención al detalle \"facturar\" y esta funcionando. \r\nMejoras: Buscar mas funciones que realice que se presten mas al detalle.'),
(2601, 196, 10, 'A', 'A-11: Atento a que no se generen conflictos no esta.\r\nTengo que resaltar que es una persona extraordinaria en el sentido que su temperamento es muy equilibrado siempre tiene una sonrisa, es cordial y no es para nada conflictiva.'),
(2602, 196, 11, 'B', 'B-5: He puesto no pues hay una parte que no cumple 100% detecta incidencias pero no es persona de proponer muchas ideas aunque ha habido una mejora en este aspecto, pero creo que se puede mejorar mucho mas.\r\nB-6:  Es persona de identificar pocas mejoras .\r\nMejoras: Buscar métodos para que tenga mas predisposición a implementar ideas, mejoras etc.'),
(2603, 196, 13, 'A', 'Mireia da un  extraordinario servicio a los  clientes tanto internos como externos de la Organización.  \r\nPuntualizar que para mi esta competencia nunca puede alcanzar la perfección,  pues creo que continuamente debemos de buscar retos nuevos para mejorar aún más nuestro servicio al cliente tanto interno como externo.\r\nCompromisos: Buscar e innovar nuevos métodos para que el servicio que damos a los clientes sea cada día mejor.');
INSERT INTO `com_dic_usr_com` (`duc_id`, `duc_du_id`, `duc_com_id`, `duc_grado`, `duc_observaciones`) VALUES
(2604, 196, 14, 'B', 'En esta competencia la opción de  mejora que propusimos anteriormente era adquirir habilidades para contraargumentar.\r\nEn este caso se me ocurre alguna formación que pueda hacer para que pueda adquirir estas habilidades'),
(2605, 196, 15, 'A', 'C-4: Este comportamiento esta ya superado se maneja ya bien ante un mayor número de  problemas habituales .\r\nEn nuestra área de trabajo hay momentos en los que tenemos que \"correr\" y esto hace que tengamos la habilidad para trabajar bajo mucha presión.'),
(2606, 196, 16, 'A', 'En esta competencia Mireia organiza y planifica bien su trabajo, por lo que creo que no hay mejora a realizar.\r\n\r\n\r\n\r\n\r\n'),
(2607, 196, 17, 'A', 'Como ya comentado antes,  hemos puesto en marcha el trabajar todos día a día en equipo, todavía  es pronto para evaluar bien esta competencia .\r\nMireia es la persona ideal para trabajar en equipo siempre esta dispuesta a todo lo que le pidas, su carácter siempre equilibrado la hace ideal para esto.\r\nC-3: Suele estar en silencio no porque considere que su opinión no cuenta, sino porque no suele intervenir simplemente, es persona de escuchar más y acatar lo que se decida.\r\nMejora:: Trabajar día a día con todas las tareas del departamento para llegar a ser un equipo compenetrado y que llegue el día que todos hagamos de todo.\r\nQue participe más en dar a conocer su opinión en las reuniones.\r\nCompromiso: Luchar  cada día para conseguirlo , pues tenemos tendencia a volver a nuestras costumbres y es algo muy difícil de llegar a conseguir.\r\n\"Sera todo un reto\".\r\n\r\n'),
(2608, 196, 18, 'C', 'Creemos que está competencia tiene poca a afectación, no podemos aplicarla del todo a nuestro departamento.'),
(2609, 196, 19, 'C', 'B-7: Tengo que puntualizar que aunque es \"no\" empieza a mirar el progreso de objetivos cosa que antes era un \"no\" rotundo.\r\nA-12:Tengo que decir que sin darse cuenta  se marca algún objetivo como por ejemplo al realizar una tarea nueva hasta que no consigue realizarla bien no para.\r\nCompromiso: Ponernos mas metas  y retos a conseguir.'),
