(2644, 198, 16, 'B', 'B+'),
(2645, 198, 17, 'B', 'B-'),
(2646, 198, 18, 'C', 'Hablamos de como identificar esta competencia en el trabajo.\r\nLe he comentado que para su area es muy importante tener una visión y conocimiento del mercaado:\r\n- Evolución tipos de interés\r\n- Evolución fluctuación'),
(2647, 198, 19, 'B', 'B+'),
(2648, 199, 8, 'B', 'B-\r\nLa meva inseguretat de vegades influeix en la meva Autoafirmació. De vegades no hem sento important al departament i influeix en la meva motivació.  Per sort són èpoques contades.\r\n'),
(2649, 199, 7, 'A', 'Crec que la meva trajectòria demostra la meva dedicació a la companyia i la meva implicació a la meva feina. \r\nHe de reconeixer que no sempre estic amb la mateixa motivació.\r\n'),
(2650, 199, 6, 'B', 'B-\r\nNo crec que aquesta competència sigui meva. Tinc una persona que m\'ajuda però per exemple no faig reunions periódiques amb ella.\r\n\r\nAcción: reuniones periódicas con su equipo\r\n'),
(2651, 199, 5, 'B', 'B-\r\nPer mi saber delegar és una de les feines més difícils a la gestió de persones ja que has de tenir molta confiança a les persones que delegues. Reconeixo que hores d\'ara, la meva falta de confiança fa que no delegui el que m\'agradaria. Encara que treb'),
(2652, 199, 4, 'B', 'Considero que porto anys al meu càrreg i això fa que decisions que jo \"pugui prendre\" las prengui amb seguretat, encara que sempre procuro que Xavi estigui enterat de tot i hem doni la seva aprovació. \r\n'),
(2653, 199, 3, 'B', 'Reconeixo que de vegades efectes externs poder afectar la meva comunicació.\r\nTambé tinc la sensació que no sóc bona \"oradora\" i que de vegades hem costa expresar-me i comunicar-me\r\n'),
(2654, 199, 2, 'B', 'B-\r\nTinc moltíssimes ganes d\'aprendre. Intento aprofitar al màxim totes les oportunitats que Airpharm hem dona per formar-me. La meva posició requereix que hagi de compartir coneixements amb d\'altres àreas i ho faig sense problemes.\r\n'),
(2655, 199, 1, 'B', 'B-\r\nReconec que sóc una persona que hem costen els canvis, tot i que quan es produeixen no tic problemes en adaptarme a tots els nivells\r\n'),
(2656, 199, 9, 'B', 'B+\r\nHem sento bastant segura amb aquesta competència ja que crec que sóc una persona molt analítica i amb atenció al detall. \r\n'),
(2657, 199, 10, 'B', 'Intento ser sensible amb les persones que m\'envolten. \r\n'),
(2658, 199, 11, 'C', 'Crec que tinc iniciativa encara que no innovo molt. De vegades hem falta temps per portar a termeel meu dia a dia, per lo que hem costa bastant pensar en idees noves i innovadores. \r\n'),
(2659, 199, 12, 'B', 'Sento que hem queda molt per ser un \"líder\".. Encara que també crec que per ser lider has de neixer? Una de les senyals que hem fa veure que no sóc bona líder és que de vegades hem sap greu reprendre els errors de la persona que està al meu departament.\r\n'),
(2660, 199, 13, 'A', 'Soc responsable del àrea de clients i com el seu nom indica, tinc contacte directe amb ells.\r\nConsidero que tinc en general molt bona relació amb ells.\r\nCrec que aquesta competència sem dona be.\r\n'),
(2661, 199, 14, 'B', 'No crec que sigui bona negociadora. Intento relacionar-me amb companys i clients d\'una forma cordial, i hem funciona molt be. Ara bé davant situacions complicades, necessito el recolzament del meu jefe.\r\n'),
(2662, 199, 15, 'A', 'Son una persona sensible,  i haig de reconeixer que sota presió ho passo malament? i poder puc cometre fallos. També haig de dir que a Administració és habitual la presió per lo que acabes per acostumar-te.\r\n'),
(2663, 199, 16, 'B', 'B+\r\nConsidero que aquesta competència és molt important per mi, i treballo per ella. Créc que sé identificar prioritats. Les dos creus del grau A , les he marcat ja que crec que ho\r\nfaig a petita escala.\r\n'),
(2664, 199, 17, 'B', 'B+\r\nNo tic problemes en treballar amb gent per exemple d\'altres departaments. I això és treballar en equip diàriament.\r\n'),
(2665, 199, 18, 'C', 'Els anys que porto a l\'empresa fa que tingui coneixement del mercat, encara que no molt específicament com el pot tenir persones d\'altres departaments. Créc que és una competència més comercial, encara que està be tenir una petita visió del mercat. \r\n\r\nXA'),
(2666, 199, 19, 'A', 'Sempre intento treballar per aconseguir els meus objectius, encara que no és fàcil. Créc que la meva inseguretat frena la meva empenta. Respecte a la orientació a resultats, encara que sigui un gra de sorra a la companyia sempre intento contribuir en ells'),
