(2674, 312, 8, 'B', 'C1-La experiencia me permite no demorar las tomas de decisiones'),
(2675, 312, 7, 'B', ''),
(2676, 312, 6, 'C', 'B1+2-Nos comunicamos a nivel grupal sin personalizar'),
(2677, 312, 5, 'B', 'A2-Necesito mejorar mi motivación al dpto.'),
(2678, 312, 4, 'B', 'Resolución de incidencias es parte mi trabajo diario'),
(2679, 312, 3, 'A', 'Cada vez pongo más intención en escuchar al otro antes de intervenir'),
(2680, 312, 2, 'B', 'Aprovecho los cursos que puedan reciclar mi área de trabajo'),
(2681, 312, 1, 'B', 'A3-No soy participo en las decisiones tomadas en los comites\r\n'),
(2682, 312, 9, 'B', ''),
(2683, 312, 10, 'A', 'C1-Es bueno ver primero el argumento del otro'),
(2684, 312, 11, 'C', 'B3-Cómo crear cauces para el desarrollo?'),
(2685, 312, 12, 'B', 'Cada colaborador establece sus prioridades.  Procuro ser un ejemplo y uno más de ellos.'),
(2686, 312, 13, 'B', ''),
(2687, 312, 14, 'B', ''),
(2688, 312, 15, 'B', 'c1- No dispongo de guías. C4 El estress no puede ser una excusa para no cumplir con el trabajo.\r\n\r\nSoco - ha entrado grado B, aunque realmente no estaba indicado en la evaluación'),
(2689, 312, 16, 'B', 'La planificación y organización: son tareas primordiales en tráfico marítimo '),
(2690, 312, 17, 'A', ''),
(2691, 312, 18, 'C', 'No realizo estudios de mercado'),
(2692, 312, 19, 'C', 'Necesidad de mejora- siempre que las tareas de operativa me lo puedan permitir.\r\n\r\nSoco - indica grado C, si bien no estaba alimentado en la evaluación\r\n\r\nTODOS LOS DATOS ALIMENTADOS SON AUTOEVALUACIÓN DE ANABEL, NO DISPONGO DE DATOS DE CIERRE CON EMILI.\r\n'),
(2693, 242, 1, 'A', 'Hacer una puntualización, como he dicho anteriormente en la evaluación de Mireia, estamos  empezando a realizar los colaboradores y yo  todas las tareas que conlleva nuestra área dentro del departamento de aduanas. Aunque su grado competencial sigue siendo \" A \" comentar que cuesta un poquito el ponerse día a día a estos nuevos cambios.\r\nPor lo que nuestro compromiso será seguir con este cambio con el objetivo de alcanzar que todos seamos capaces de abarcar todas las tareas del departamento.\r\n'),
(2694, 242, 2, 'B', 'B-8: Falta formación en aduanas.\r\nA-12: En la evaluación anterior pusimos \"No\" por error.\r\nHemos avanzado en esta competencia pues va adquiriendo mas conocimiento de aduana al ir realizando tareas nuevas.\r\nCompromiso: Realizar  alguna  formación de aduanas y por mi parte seguir ayudando a Jenny en nuevas tareas para que vaya ampliando sus conocimientos.'),
(2695, 242, 3, 'A', 'C-3: En la evaluación anterior pusimos \"Si\" por error.\r\nB-8: Facilita la información puntualmente pero no necesita siempre apoyo.\r\nEn esta competencia debo decir que es una persona muy comunicativa y se preocupa de preguntar \" el porque de las cosas\" lo que considero un punto fuerte en ella.'),
(2696, 242, 4, 'B', 'C-2 ;C-3: hemos puesto \"NO\" cuando es faena rutinaria pero si sale de lo habitual a veces es \"SI\".\r\nla opción de mejora de la evaluación anterior que era \"tomar decisiones por si sola\" ha mejorado muchísimo la veo con mas seguridad.\r\nCompromiso: seguiremos trabajando en ello, yo me comprometo a continuar dándole mas  apoyo para que adquiera mas seguridad.\r\n'),
(2697, 242, 7, 'B', 'En  la anterior evaluación de esta competencia Jenny me comento que en ocasiones no se sentía motivada.\r\nSe me ocurrió poner en funcionamiento (como ya he mencionado antes) hacer trabajos diferentes dentro de nuestra área y esta funcionando!! .\r\nCompromisos: seguir haciendo cambios internos en nuestra área ,retos nuevos, responsabilidad, etc.'),
(2698, 242, 8, 'B', 'C-3: A veces si son de un nivel \"alto\" puede causar un poco de incertidumbre.\r\nB-6: En tareas nuevas a veces necesita consultar.\r\nB-8: No suele implicar demora en la toma de decisiones.\r\nAquí ha adquirido mas confianza en ella misma por lo que ahora la veo una persona firme al enfocar una situación o problema sobre todo en su trabajo de día a día .\r\nCuando sale de su rutina es mas insegura por falta de mas conocimientos.\r\nCompromiso: seguir ampliando conocimientos '),
(2699, 242, 9, 'A', 'Jenny es hábil para resolver problemas y tiene un punto muy fuerte a tener en cuenta \" la atención al detalle\"  es muy observadora .'),
(2700, 232, 1, 'C', ''),
(2701, 232, 2, 'B', ''),
(2702, 242, 10, 'A', 'B-5: Si, pero no solo en lo laboral.\r\nA-11: Si pero no esta atenta a conflictos que se puedan generar.\r\nResaltaría que no es persona conflictiva y no presta atención a los conflictos  que se puedan generar a su alrededor.\r\nPor lo que creo que su puntuación seria mas correcta en \"A\".'),
