(2727, 242, 11, 'B', 'B-6: Si, pero creo que podría aportar mas mejoras .\r\nB-8: Aquí tengo que destacar que es una persona que se preocupa cuando estas enseñando alguna tarea nueva en preguntar el por qué  de las cosas y de la manera de hacerlas.\r\nA-10: he puesto \"no\" porque considero que son muy pocas las veces de iniciativa debido a la rutina del trabajo.\r\nA-12: Si que elabora plan de acciones pero falta realizar seguimiento y evaluar eficacia.\r\nMejora: Tener mas seguridad (que tiene mucho mas que la evaluación anterior) debemos de seguir en ello.\r\nCompromiso: Darle trabajos con mas responsabilidad por ejemplo hablar con clientes, proveedores , etc. (creo que esto seria bueno para que cogiera mas seguridad en si misma).\r\nY también el realizar cada día trabajos diferentes fomentara a que tenga mas iniciativa e innovación.'),
(2728, 242, 13, 'A', 'En general su comportamiento con los clientes internos y externos es buena.\r\nComo he mencionado en la evaluación de Mireia tenemos que continuar buscando nuevos retos para mejorar el servicio a los clientes externos/internos.\r\nMejoras: Buscar  e innovar mas métodos para que  el servicio que ofreces al cliente interno/externo sea cada día mejor.\r\n'),
(2729, 294, 7, 'B', ''),
(2764, 242, 16, 'B', 'A-10: Aquí puntualizar que anteriormente era \"no\" pero considero que en su día a día ya es capaz de  programar acciones ante incidencias y prever para un futuro.\r\nTiene buena planificación.\r\nMejora: trabajar la capacidad de organizar los trabajos en grupo.\r\nCompromiso: ayudarla enseñándole personalmente el seguimiento de principio a fin de las tareas que realizaremos  todos los colaboradores y yo.'),
(2765, 242, 17, 'C', 'Hace poco que hemos puesto en marcha el trabajar todos día a día en equipo, es pronto para evaluar bien esta competencia, pero si han habido algún cambio:\r\nC-4: Demuestra mucho  interés por el resto de trabajo en equipo pero la tendencia es volver a su faena .\r\nMejora:: Trabajar día a día con todas las tareas del departamento para llegar a ser un equipo compenetrado y que llegue el día que todos hagamos de todo.\r\nCompromiso: Luchar  cada día para conseguirlo,  pues tenemos tendencia a volver a nuestras costumbres y es algo muy difícil de llegar a conseguir.\r\n\"Sera todo un reto\".'),
(2766, 242, 18, 'C', 'Poca afectación de esta competencia.'),
(2767, 242, 19, 'C', 'C-3:Si actúa con normas y procedimientos estandarizados pero si esta atento  a los resultados demandados.\r\nB-7:Decir que acostumbra a revisarlos mas que antes pero aún debe de hacerlo con mas regularidad.\r\nA-12: No se marca objetivos retadores pero no es persona que se acomode, sino que se interesa por hacer nuevas tareas.\r\nCompromiso: Fijarnos mas metas.'),
(2768, 255, 1, 'B', 'B-5: Al llevar más tiempo en la compañía, empieza a participar más  en los cambios que se van haciendo en nuestra área de trabajo adaptándose perfectamente.\r\nB-7 : En relación a la evaluación anterior también ha mejorado en este comportamiento aunque le falta mas \"empuje\".\r\nA-10: Aquí  ha habido una mejora considerable, supongo que al llevar mas tiempo en la compañía ha adquirido mas confianza con el resto del equipo  y es más\r\ncomunicativo a la hora de comunicarnos algún cambio que se produzca.\r\nMejoras: Más empuje/iniciativa  a la hora de realizar tareas nuevas, empezar a realizar cambios dentro de su área de trabajo etc.\r\nCompromisos: Por mi parte darle todos los conocimientos que pueda necesitar para nuevos cambios que vayamos realizando.\r\n\r\n\r\nResumiendo veo '),
(2769, 232, 4, 'C', 'Toma de decisiones con supervisión'),
(2770, 264, 1, 'A', ''),
(2771, 255, 2, 'C', 'C-4: Puntualizar que en el trabajo concreto que realiza sí (en nuevas tareas de nuestra área esta siendo formado) con resultados satisfactorios!!\r\nB-8: Tiene bastantes más conocimientos que cuando llegó a la compañía pero aún requiere de más.\r\nA-9: Puntualizar que le gusta aprender cosas nuevas pero le falta bastante iniciativa y más soltura.\r\nA-10: Hemos puesto \"si\" pero puntualizar que solo en su trabajo diario, en el departamento todavía \"no\".\r\nA-12: Si pero me comenta que depende mas de la compañía .(formación en aduanas)\r\nMejoras: Formación en aduanas\r\nCompromisos: seguir formándolo en más tareas de nuestro departamento para que vaya adquiriendo más conocimientos.'),
(2772, 255, 3, 'B', 'B-6: Me comenta Salvatore que la dificultad que tenia  al expresar conceptos de forma clara y concisa ya han sido superados al entender mas los procesos de nuestro departamento.\r\nB-8: Necesita del apoyo de colaboradores o responsables en ciertas tareas pero decir \" positivamente\" que concretamente en sus tareas ya lo realiza solo.\r\nEn el grado A -9 y A-10 empieza a conocer las necesidades de dentro y fuera del departamento con lo que sus respuestas son más acordes a las necesidades de los demás\r\ny también a destacar que no con regularidad pero ya se atreve a informar de forma mas precisa por ejemplo : cuando hay un problema, algún cambio por lo que aunque \r\nfalta mejorar ya lo pondría en estado afirmativo.\r\nMejora: hacer alguna formación centrada en la comunicación .\r\nCompromiso: Empezar poco a poco a  comunicarse mas asiduamente  por teléfono ,hablar con el cliente, con terminales de handling etc'),
(2773, 255, 4, 'B', 'C-4:Resaltar que en su trabajo día a día  ya toma decisiones por si solo.\r\nB-6 Y B-8: Teníamos como mejora pero en su día a día ya lo hace por el mismo.\r\nEn el grado A prácticamente esta igual evaluado, excepto A-11: pues empieza a informarse antes de tomar una decisión por lo que indicaría un \"si\"adquirir mas seguridad.\r\nResaltar que ha mejorado muchísimo pues ya es capaz de identificar y encontrar soluciones a los problemas que surgen a su día a día.\r\nMejoras: Empezar a tomar decisiones en  nuevas situaciones que se pueden presentar en las nuevas tareas, buscar soluciones a problemas que puedan presentarse  etc.\r\nCompromiso: Ayudándole,  se me ocurre  por ejemplo :darle pequeñas tareas con algún tipo de problema para que pueda ir tomando decisiones , resolver los problemas etc.'),
(2774, 255, 7, 'B', 'En esta competencia igual que Mireia y Jenny estaban faltos de \" motivación\" y la mejora  que se me ocurrió es la mencionada anteriormente\r\nTodos estamos aprendiendo todos los trabajos del departamento así el día a día no se hace tan rutinario y esta funcionando !!\r\nMejora: Seguir realizando la mejora mencionada pues es muy laboriosa y nada fácil,\r\nCompromiso: ser muy constante para llegar a lograrlo, seguir avanzando en cambios en nuestra área de trabajo.'),
(2775, 255, 8, 'B', 'C-3: Aquí mencionar que antes le podían suponer alguna dificultad por el tiempo que llevaba en la compañía , pero actualmente en su trabajo diario no le ocasionan dificultad alguna.\r\nB-6:Ante tareas nuevas suele recurrir a colaboradores.\r\nConociéndolo más creo que Salvatore tiene la capacidad de realizar cualquier tarea  con éxito.\r\nCreo que aún le falta seguridad en si mismo, sobre todo cuando sale de faenas rutinarias y quizás por que no lleva el tiempo suficiente en la compañía, pero remarcar que ha mejorado positivamente en relación a la anterior evaluación. \r\nMejoras: Adquirir mas seguridad y a ser mas autónomo.\r\nCompromisos: Seguir formándose en tareas nuevas y yo ampliar sus conocimientos.'),
(2776, 255, 9, 'B', 'C-2: Aquí decir que ya no necesita ayuda cosa que antes si ha mejorado muy favorablemente.\r\nA-9:  En su día a día detecta perfectamente los errores perro en nuevas tareas debemos seguir trabajando en la \"atención al detalle\".\r\nMejoras: continuar centrándose mas en los detalles en las nuevas tareas, hacerle partícipe en la aportación de ideas para la resolución de problemas.\r\nCompromisos: Ayudarle a través de tareas que pueda desarrollar dichas mejoras.'),
(2897, 251, 14, 'B', '3. depende del tema a tratar sí'),
(2898, 251, 15, 'B', '4. no  pero se angustia más de lo habitual\r\n11. se desestabiliza'),
