(2864, 232, 6, 'C', 'Grado B - pregunta 1 - Hace 1 mes hemos hecho una, pero no lo tenemos interiorizado aún. \r\nGrado C - pregunta 3 - Demuestro mi disponibilidad pero reconozco que soy reacia de entrada. '),
(2865, 232, 7, 'B', 'Grado B - pregunta 1 - no siempre es fácil mantenerse motivado.\r\nGrado B - pregunta 4 - he crecido profesionalmente aprendiendo de mi superior y de su excelente trabajo.  '),
(2866, 232, 8, '', 'Grado A - pregunta 2 - tengo mucha inseguridad'),
(2867, 255, 10, 'B', 'No genera conflictos, no presta atención a los que se puedan generar a su alrededor.\r\nResaltar que es una persona con gran capacidad de escucha pero necesita que las personas le expresen sus sentimientos, pensamientos para poder \"ayudar\" a los demás.\r\n\r\n'),
