(2896, 251, 13, 'B', ''),
(2868, 255, 11, 'B', 'C-3: Destacar que al haber transcurrido mas tiempo  ya se ha podido valorar este comportamiento  que el año anterior no se pudo por el  tiempo que llevaba.\r\n \"no\" en su trabajo día a día.\r\nB-5: Destacar que ya propone ideas cuando detecta incidencias.\r\nB-7: En su trabajo diario es capaz de dar respuestas eficaces a los problemas sin apenas tener que consultar.\r\nMejoras: Tener mas iniciativa a la hora de realizar nuevos trabajos, proponer mejoras , pues veo que es\" cómodo\" en el sentido que hace todo lo que le dices pero no tiene iniciativa a la hora de realizar nuevas tareas.\r\nCompromisos: Ayudarle día a día  asignándole diversas tareas, haciéndole mas participe a la hora de realizar algún cambio etc. \r\n\r\nlas tareas a realizar'),
(2869, 255, 13, 'B', 'Por el tiempo que lleva da  buen servicio al cliente.\r\nLe falta más tiempo y rodaje para poder dar mas servicio a los clientes \"externos\", pues con los  \"internos\" el servicio es mejor en el sentido de que si alguien \r\nviene a pedirle información, documentación etc.  se desenvuelve  perfectamente.\r\nMejoras: Trabajar más  los clientes \"externos\".\r\nCompromisos : Darle yo formación de nuevas tareas que requieran comunicarse con  clientes o proveedores \"externos\".\r\nComo he dicho en las anteriores evaluaciones, para mi esta competencia nunca puede alcanzar la perfección,  pues creo que continuamente debemos de buscar retos nuevos para mejorar aún más nuestro servicio al cliente tanto interno como externo.'),
(2870, 255, 14, 'B', 'Esta competencia  ha mejorado respecto al  año pasado por haber adquirido más confianza con el entorno.\r\nSalvatore es mas de \"escucha activa\" que de \"convencer\" , va ligado a la competencia de comunicación,\r\nMejoras: proponemos alguna formación en la que entraran herramientas y habilidades  para desarrollar más la persuasión, comunicación etc.'),
(2871, 255, 15, 'B', 'B-5: En alguna ocasión ya se ha encontrado en situaciones de volumen de trabajo y su rendimiento ha sido muy satisfactorio.\r\nMejoras: Realizar mas tareas en donde este mas sometido a presiones.'),
(2872, 255, 16, 'B', 'Tiene buena planificación en su trabajo.\r\nMejoras: Planificar prioridades más allá del día a día en trabajos no tan habituales.\r\nCompromisos: Buscar formulas para poder aplicarlas.'),
(2873, 255, 17, 'B', 'A-9: Casi siempre le tienes que pedir colaboración le cuesta tener iniciativa propia.\r\nMejoras:: Trabajar día a día con todas las tareas del departamento para llegar a ser un equipo compenetrado y que llegue el día que todos hagamos de todo.\r\nCompromiso: Luchar  cada día para conseguirlo,  pues tenemos tendencia a volver a nuestras costumbres y es algo muy difícil de llegar a conseguir.\r\n\"Sera todo un reto\".\r\n-10: Puntualizar que empieza a compartir información que le pueda llegar a el con el resto del equipo'),
(2874, 255, 18, 'C', 'Creemos  que esta competencia tiene poca afectación en nuestro departamento de Aduanas.'),
(2875, 255, 19, 'C', 'C-2: Si cumple los objetivos sin esperar al último momento.\r\nMejoras: mirar el progreso de objetivos, marcar metas y retos.\r\nCompromisos: Ayudarle a conseguir las metas a través de nuevas tareas.'),
