(2909, 301, 1, 'B', 'Ha mejorado la toma de consciencia de buscar la mejor manera de atender \"siempre\" el teléfono.\r\nNo parece abierto ante los puntos de vista distintos al suyo que no sean razonables pero tomamos el compromiso de estar abiertos a otras opiniones y mejorar en flexibilidad.'),
(2910, 301, 2, 'B', 'Comparte los conocimientos adquiridos.\r\nPor motivos familiares, no siempre puede disponer del tiempo o el interés por algún curso de reciclaje o ampliacion para el propio desarollo profesional.'),
(2911, 301, 3, 'C', 'En la comunicación, en ocasiones se es algo escueto. Intentaremos acompañar algo más de detalle/argumentación/justificación/ en nuestra comunicación ya que será favorable para el receptor y se gana en confianza. \r\n(preguntas 5,6)'),
(2912, 301, 4, 'B', 'Tiene un nivel de autonomía muy satisfactorio y sabe cuando precisa de la intervención / supervisión del responsable del depto. '),
(2913, 301, 7, 'B', 'Se precisa de un poco más de  flexibilidad para modificar acciones pero no hay problema en cambiar (pregunta 7).\r\nHay un compromiso firme con la compañía.\r\n'),
(2914, 301, 8, 'B', ' Los cambios nos ponen en alerta y provoca reacciones de protección. Nos comprometemos a hacer un ejercicio de autocontrol y confianza en el trabajo realizado y no dejar que el trabajo nos domine. (preg 4)'),
(2915, 301, 9, 'A', 'Se valora su precisión y atención elevada al detalle!'),
(2916, 301, 10, 'B', 'Implicación por los demás- faltaría ofrecer un poco de escucha y apoyo en los momentos de mucho volumen, siempre que tengamos nuestra mesa controlada. (preg 5)\r\nEstaremos más atentos a la opinión del compañero y a interesarse por conocer qué le sucede. (preg 11)'),
(2917, 301, 11, 'B', 'Los mecanismos conocidos y rutinarios nos dan control y confort, pero estamos dispuestos a salir de la zona de confort e incorporar iniciativas e innovaciones por parte de la cía y/o de los compañeros. (preg 4)\r\n\r\n'),
(2918, 301, 13, 'B', 'Matenemos la orientación positiva al cliente de modo que nuestro trato y servicio continue siendo personalizado.\r\n'),
(2919, 301, 14, 'C', 'Posibilidad de un poco más de persuasión incluso en aquellos momentos que  un cliente no tenga la razón y nos resulte incómodo. Poder darle confianza al cliente conforme todo irá bien. '),
(2920, 301, 15, 'C', 'Algún momento de tensión se puede escapar de las manos.\r\nConsiderar la posibilidad de solicitar de ayuda del dpto. (preg 7)\r\nBuscar un poco de calma ante los momentos incómodos (preg 11)'),
(2921, 301, 16, 'B', 'Debemos tener muy en cuenta los posibles imprevistos  que surgen en por lo que debemos mantener una actitud calmada y resolutiva ante estas situaciones incómodas. '),
(2922, 301, 17, 'B', 'Aprovecharemos los momentos de menos volumen de trabajo en la mesa para ofrecer ayuda a los compañeros. \r\nMantenemos el poder compartir la mejoras de gestión que se puedan descubrir.'),
(2923, 301, 18, 'B', 'El dpto viene dirigido por las negociaciones que del dpto comercial, por nuestra parte la visión de negocio se basa en mantener un buen servicio y atención al cliente.'),
(2924, 301, 19, 'B', 'Siempre hay un esfuerzo en tener el trabajo listo a tiempo y gestionar las tareas para llegar a finallizar las expediciones de acuerdo con las necesidades del cliente. Continuar dando un servicio de atención al cliente personalizado y mantenimiento del cliente.'),
(2925, 282, 1, 'B', 'Es tan amplia la flexibilidad que podemos confluir excesivamente en el otro y olvidar nuestro propio criterio que también debe ser escuchado y respetado por el otro, pues diferentes puntos de vista también resulta muy enriquecedor. '),
(2948, 261, 10, 'B', '2.4.6- En ocasiones hay una reacción de defensa que no corresponde a la intención de quién se dirige a nosotros, y podría surgir un conflicto interno y con el otro que no resulta beneficioso para la relación. Si nos sentimos seguros y somos abiertos y claros: no hay nada que temer. \r\n12. Interesarse por lo que le sucede al otro nos ayudará a comprender su comportamiento.\r\n\r\n'),
(2926, 282, 2, 'A', 'Gran voluntad de autoaprendizaje y de compartir los nuevos conocimientos. Interés en ampliar conocimientos (formaciones relacionadas con el sector).'),
(2927, 282, 3, 'B', 'En ocasiones la comunicación puede ser más extensa de lo necesario, (ofrecemos una amplio abanico de posibilidades ) pero la intención es para que el interlocutor reciba toda la información de una sola vez.\r\n '),
(2928, 282, 4, 'C', '(preg 1) Necesidad de corroborar que lo hago bien... podemos confiar en nuestras grandes capacidades profesionales. '),
(2947, 261, 9, 'B', '3. Podemos considerar evaluar los datos conjuntamente cuando sea necesario...\r\n9. Seguiremos pendientes de los detalles, para la gestión de las tareas que lo requieren.\r\n'),
(2929, 282, 7, 'A', 'Elevado compromiso y dedicación a la Cía. Es prácticamente insuperable!!!'),
(2930, 282, 8, 'C', '1.2- Necesidad de reconocimiento cuanto podemos confiar plenamente en nuestras aptitudes con autoafirmación. \r\n10.Profundo análisis antes de tomar una decisión, con lo cual se asegura muy bien de que el resultado sea positivo.'),
(2931, 282, 9, 'A', 'Hay una voluntad y esfuerzo en analizar profundamente las situaciones y poder llegar a las mejores conclusiones antes de tomar una decisión. '),
(2932, 282, 10, 'B', 'preg 8 y12)-En ocasiones anteponemos al otro antes que a nosotras mismas por lo que el intercambio en la relación queda desequilibrado. También es necesario tener una sensibilidad con una misma.  \r\n'),
(2933, 282, 11, 'A', '5-6-7 Siempre muy atenta a introducir ideas resolutivas que ayuden al equipo a mejorar. Persona muy proactiva.'),
(2934, 282, 13, 'A', 'Alta orientación al cliente, aunque en ocasiones, por no contradecir nos podemos perder en acciones más resolutivas y eficaces que ayudarán al cliente a modificar su tendencia a no salir de la zona de confort. \r\nInsuperable amabilidad y atención al Cliente!! Gran cuidado y mantenimiento de los clientes!!'),
(2935, 282, 14, 'B', 'Gran voluntad de negociación e influencia para beneficio de la Cía. Se adelanta a las tareas propias de comercial. Se esfuerza, pero al no tener toda la confianza en nuestras capacidades y confluir tanto con el otro perdemos los poderes de persuasión y pasamos a la complacencia. (preg 1 y 9)\r\n'),
(2946, 261, 8, 'B', '1. Seguiremos compartiendo algún asunto, especialmente si es una incidencia, lo comentamos y pondremos puntos en común.'),
(2936, 282, 15, 'B', '3. 4. En época de alto volumen- sería beneficioso priorizar en los argumentos extensos. Ir más al grano. 4. No hay bloqueo, pero se pretende seguir con la misma dedicación extensa y no hay tanto tiempo.\r\nSe mantiene una actitud muy positiva y favorable para el entorno aun en momentos de presión- Gracias!!'),
(2937, 282, 16, 'A', 'Buena organización y gran capacidad de adelantarse a las incidencias, con posible acciones de contingencia si fuesen necesarias!!'),
(2938, 282, 17, 'A', 'Siempre tiene una actitud de colaboración con el grupo..incluso puede llegar a priorizar antes las tareas del otro. '),
(2939, 282, 18, 'B', 'Aunque es el dpto. comercial quién tiene poder de visión y decisión por su parte tiene en cuenta revisar las casuísticas económicas y de gestión que favorezcan a la cía. '),
(2940, 282, 19, 'A', 'Enfoque a la orientación de resultados con el cuidado y atención de las diversas tareas de gestión.\r\n'),
(2941, 261, 1, 'B', '1 Algo reticente... lo comentamos.- 8. la empatía y la comprensión del otro siempre nos ayuda a entender otras visiones. \r\nExiste una actitud de adaptación para no entrar en conflicto, pero en ocasiones puede haber resistencia en abrirse al otro y a en comprender.\r\n10. 11. Faltaría un poco más de comunicación sobre los cambios que afectan a su entorno.'),
(2942, 261, 2, 'B', 'Está abierta a los cursos de formación que ofrece la empresa.\r\n12. En algunos casos hay una tendencia a la zona de confort- ej, conocer la plataforma del seguro'),
(2943, 261, 3, 'C', '4.7. comunicación en cuanto a las incidencias/ obstáculos que puedan surgir. Si podemos compartir más, nos ayudarán más, tanto a nivel de volumen como a nivel de situaciones complejas. \r\n9.10.11- si podemos comunicar a tiempo, nos permitirá mayor bienestar y fluidez en el puesto de trabajo. siempre recordando que el otro me puede ayudar.\r\n'),
(2944, 261, 4, 'B', '1. 3. Puede contar con el seguimiento de su superior si se abre a comunicar. 2.Especialmente autónoma al tomar decisiones- eso es muy favorable para avanzar, pero también es importante compartir en ocasiones de duda. las situaciones compartidas abren el corazón y la confianza en los demás. '),
(2945, 261, 7, 'B', '3.4- sería beneficioso un compromiso también con los otros departamentos (ej. comercial, aduanas...)'),
(2949, 261, 11, 'B', 'Voluntad de aportar ideas que ayuden en la mejora de las gestiones.'),
(2950, 261, 13, 'B', 'Mantendremos la atención al cliente, respondiendo a sus correos en el tiempo adecuado y a sus solicitudes habituales y puntuales.'),
(2951, 261, 17, 'B', '5.9.Sería beneficioso a nivel personal/laboral ofrecernos para asumir nuevos retos/clientes que podrían alentar nuestra motivación.'),
(2952, 261, 18, 'B', 'El dpto viene dirigido por las negociaciones que del dpto comercial, por nuestra parte la visión de negocio se basa en mantener un buen servicio y atención al cliente.'),
(2953, 261, 19, 'B', 'Cumplimos debidamente con lo requerido en las distintas tareas:bookings, respuestas mail, preaviso bls, envío bls, comunicaciones de incidencias etc...'),
(2954, 261, 14, 'B', 'Continuaremos siendo sólido y honestos en nuestros argumentos. La verdad siempre le llega al otro y convence auténticamente.'),
(2955, 261, 15, 'B', 'Siempre nos mantendremos presentes y atentos al trabajo para poder abordarlo con mayor tranquilidad. '),
(2956, 261, 16, 'B', '1. Comentamos si necesitamos que los demás organicen nuestras prioridades? Mantenemos la prioridad de las diferentes tareas de los envío y de mantener al cliente informado. Gracias,'),
(2957, 240, 1, 'B', 'Hay voluntad por llegar a un entendimiento en las relaciones con los distintos actores.'),
(2958, 240, 2, 'B', 'Dispuesta a participar en los diferentes proyectos, ...pero falat auto-motivación para buscar más conocimientos.'),
(2959, 240, 3, 'B', '4. Intento que el discurso sea controlado para que la comunicación no se desvía del asunto tratado y no entremos en emocionalidad innecesarias. Tarea no siempre fácil de llevar. 3. Reporto a dirección cuándo ya he agotado todas las posibilidades de gestión. 4. La mejor manera de llegar y ayudar al otro es conociendo sus debilidades y en ocasiones su situación personal. 2. Intento estar disponible siempre que me requieren los compañeros.4 Sigo aprendiendo a escuchar, pero todavía me queda un trecho.\r\n'),
(2960, 240, 4, 'B', 'Debido a la experiencia se adquieren conocimientos y seguridad a la hora de tomar decisiones de forma autónoma. No suelo comunicar cada una de las incidencia a mi responsable, sólo en casos graves en los que debe intervenir y aportar sus recursos e influencias.'),
(2961, 240, 5, 'B', 'Todavía por aprender a delegar: aunque con el tiempo hay más capacidad en delegar. No obstante al ser parte del equipo operativo no siempre puedo molestar al compañero. Para las reuniones y cursos siempre delego las tareas que tengo activas, con plena confianza!! 4. aprovecho las evaluaciones para enfatizar el sentido de compromiso y responsabilidad requerido.3. Procuro estar abierta a otras maneras ofrecidas por el compañer@. Me siento muy tranquila con las capacidades  y aptitudes de los compañeros.'),
(2962, 240, 6, 'B', '3. El objetivo es que todos sepamos llevar todos los cliente. 1.si detecto momentos de malestar/tensión procuro averiguar qué ocurre y ofrecer ayuda. Al ser un equipo pequeño, la comunicación es constante, en el día a día. '),
(2963, 240, 7, 'A', '1. Es importante tener en cuenta a Todos los departamentos involucrados para el beneficio de la empresa. 3. Me siento muy parte de la organización, dándole el mismo valor que a mi vida personal.3 Tener un equipo cohesionado y en armonio es indispensable. 1 Intendo darles soporte cuando hay momentos de mucha presión para que podamos compartir y hacer más liviano el trabajo.'),
(2964, 240, 8, 'A', '1. si conozco bien la casuística y estoy seguro, puedo contradecir con confianza los criterios del superior, siempre contando con el beneficio de la empresa.\r\nNo arriesgo demasiado con el dpto. cuando considero que todo funciona satisfactoriamente. En general confío en mi experiencia y voluntad de hacer lo mejor posible.'),
(2965, 240, 9, 'B', 'La organización de las prioridades es una tarea imprescindible en nuestras gestiones.\r\nEn la gestión de envíos el detalle es de máxima prioridad, pues un pequeño despiste en los datos pueda dar lugar a incidencias irreversibles.'),
(2966, 240, 10, 'A', 'Es importante ser abierto y transparente, por igual ante cualquiera de los colaboradores, sin mostrar preferencias ni juicios a ninguno de ellos. Procurar crear un ambiente homogéneo en el cual todos podamos confiar de todos. 3 En ocasiones las ideas preconcebidas no bloquean y tapan nuevas oportunidades. Intentar estar al nivel de la evolución continua en las relaciones. 1. Escucho pero por supuesto quiero ser escuchada. Mucha atención en evitar cualquier disputa.'),
(2967, 240, 11, 'C', '4. Participo en las mejoras Kaizen. Reconozco no ser excesivamente innovadora ni con grandes iniciativas.'),
(2968, 240, 12, 'B', '1. Intento dar ejemplo en cuanto apoyar en momento de volumen, en estar calmada en momentos de tensión y evitar conflictos. Las estrategias serían el comportamiento. Procurar un ambiente positivo.B3- procuro estar atenta para que las cargas estén bien equilibradas.'),
(2969, 240, 13, 'B', '1. Las comunicaciones con el cliente se producen en el día a día, identificando siempre como mejorar y ofrecer el mejor servicio en base a sus necesidades. El cliente es siempre la máxima prioridad.'),
(2970, 237, 1, 'B', 'Todo y que el interés por la Organización esta fuera de toda duda, debería mejorar un poco el ponerse a la defensiva ante opiniones distintas'),
(2971, 237, 2, 'B', 'Debe mejorar el apartado de Formación'),
