(3017, 295, 9, 'B', 'La atención al detalle es uno de los puntos más fuertes de Sofía. Dentro de un departamento de calidad es una competencia muy importante. Falta algo de formación en sistemas informáticos de la compañía. Por otro lado, a veces la gran atención al detalle choca un poco con el establecimiento de prioridades por el ritmo de trabajo que hay en el departamento.'),
(3018, 295, 10, 'A', ''),
(3019, 295, 11, 'A', 'Realiza su trabajo con bastante autonomía e iniciativa'),
(3020, 295, 13, 'A', ''),
(3021, 295, 14, 'A', 'Procura expresar su punto de vista y el del departamento en cualquier negociación'),
(3022, 295, 15, 'A', 'Es un punto fuerte, trabaja con resistencia y efectividad ante situaciones de presión'),
(3023, 295, 16, 'B', 'En algunos casos es necesario que comentemos prioridades.\r\nEn la compañía no existen métodos de planificación'),
(3024, 295, 17, 'B', 'Buena colaboración en el trabajo en equipo'),
(3025, 295, 18, 'B', 'No sigue mucho las tendencias del sector'),
(3026, 295, 19, 'A', ''),
(3027, 204, 1, 'B', ''),
(3028, 204, 2, 'B', 'Muy interesada en temas de formación aunque el área donde me cuesta más formarme es en la tecnológica'),
(3029, 204, 3, 'B', 'Debido al intenso ritmo de trabajo la comunicación no siempre es lo fluida que debería.\r\nAunque en algunas ocasiones no es posible informar regularmente, tengo muy en cuenta el informar sin falta de todo lo relevante, tanto con mi superior jerárquico como con las personas del equipo '),
(3030, 204, 4, 'B', 'A veces me cuesta tomar decisiones impopulares'),
(3031, 204, 5, 'B', 'La gestión de la delegación es difícil, aunque trabajo para que el equipo se sienta motivado y asuma responsabilidades. A veces por falta de tiempo cuesta dar instrucciones detalladas y hacer seguimiento de los temas delegados. En este sentido, ciertos temas los siguen personas de responsabilidad dentro del equipo'),
(3032, 204, 6, 'B', 'La gestión de personas requiere un tiempo del cual no siempre se dispone. Creo que el equipo sabe que estoy abierta a tratar cualquier tema del cual tengan inquietud, y estos temas se tratan habitualmente. Es difícil mantener un ritmo de reuniones periódicas.'),
(3033, 204, 7, 'A', ''),
(3034, 204, 8, 'A', 'Mi área no es un área dentro de la compañía donde sea conveniente asumir riesgos'),
(3035, 204, 9, 'B', 'Tengo equilibrio entre pensamiento analítico y gestión rápida de algunas situaciones. Estos dos aspectos a veces chocan entre ellos, pero la falta de atención al detalle la suplo delegando estas tareas a personas del equipo que tienen muy alta esta competencia'),
(3036, 204, 10, 'B', ''),
(3037, 204, 11, 'B', ''),
(3038, 204, 12, 'B', 'No me considero muy carismática pero genero respeto dentro del equipo \r\n'),
(3039, 204, 13, 'A', ''),
(3040, 204, 14, 'B', 'Sería conveniente formarme más en aspectos de negociación'),
(3041, 204, 15, 'A', ''),
(3042, 204, 16, 'B', 'Realizada una primera formación en gestión de proyecto. Se detectó la necesidad de realizar una segunda formación para definir una sistemática dentro de la empresa.\r\nHasta la fecha la gestión del proyecto la hacía, aunque de manera informal. En la actualidad he empezado aplicar las técnicas aprendidas durante la formación'),
(3043, 204, 17, 'A', ''),
(3044, 204, 18, 'A', ''),
(3045, 204, 19, 'B', 'Aplicando nuevas técnicas aprendidas durante la formación de gestión de proyectos que subsanarían los \"no\" indicados en este capitulo'),
(3046, 172, 2, 'B', ''),
(3047, 172, 3, 'C', 'Necesita intercambiar más información sobre su trabajo'),
(3048, 172, 4, 'B', ''),
(3049, 172, 7, 'B', 'Falta información de la estrategia de la compañía para incrementar el compromiso'),
(3050, 172, 8, 'A', ''),
