(3052, 172, 10, 'A', 'Punto muy fuerte'),
(3053, 172, 11, 'B', 'La propuesta de mejoras de momento se está realizando puntualmente. Desde el área de mejora continua como key user este aspecto se puede llegar a fomentar más ya uqe por el conocimiento profundo de muchas áreas de la empresa, puede llegar a aportar mejoras importantes en los procesos..'),
