(3055, 172, 14, 'C', 'Sería deseable formación en técnicas de negociación'),
(3056, 172, 15, 'A', 'Punto fuerte'),
(3057, 172, 16, 'C', 'Realizada formación de proyectos. Compromiso a aplicar la sistemática aprendida en nuevos proyectos que surjan'),
(3058, 172, 17, 'A', 'punto fuerte'),
(3059, 172, 18, 'C', 'Estar un poco más comprometido con este aspecto'),
