(3098, 227, 10, 'B', 'GRADO C -4 También en ámbito personal si hay una relación más personal.'),
(3099, 227, 11, 'B', 'B-\r\n\r\nGRADO C-2  Sí el problema no puedo solucionarlo sí consulto a mi superior.\r\nGRADO C-3  Me cuesta identificar las mejoras que debo proponer a mi superior, creo que las adapto al trabajo según me surge.\r\nGRADO A-4: Sí pero si me las proponen.'),
(3100, 227, 12, 'B', 'GRADO C-4  Reviso el trabajo cuando es una tarea nueva que no tiene bien asumida.\r\nHay que tener en cuenta que sólo tengo un colaborador, por lo que todas las acciones son difíciles de implantar.'),
