(3114, 266, 1, 'A', 'El asumir nuevas tareas es un aspecto de motivación. Se destaca esta habilidad como punto fuerte.'),
(3115, 266, 2, 'B', ''),
(3116, 266, 3, 'B', 'Sería necesaria formación en gestión de conflictos ya que ahora está coordinando el equipo de almacén y a veces se pueden producir situaciones de diferencia de opiniones'),
(3117, 266, 4, 'B', 'Hay una evolución muy positiva en esta competencia. La tendencia personal es muy resolutiva pero dentro del área donde trabajamos a veces hay que sopesar y esperar autorizaciones de clientes para cualuqir decisión'),
(3118, 266, 7, 'A', ''),
(3119, 266, 8, 'B', ''),
(3120, 266, 9, 'B', 'A veces por presión y urgencias se da prioridad al tiempo en lugar de la atención al detalle. Se está trabajando a nivel personal porque en el área de calidad es una competencia importante.'),
(3121, 266, 10, 'B', ''),
(3122, 266, 11, 'A', ''),
(3123, 266, 13, 'B', ''),
(3124, 266, 14, 'B', 'Tal y como solicitado en otro punto del cuestionario sería conveniente una formación en gestión de conflictos y técnicas de negaciación'),
(3125, 266, 15, 'A', 'Trabaja mejor con presión. Es un punto fuerte'),
(3126, 266, 16, 'B', 'No conoce los métodos de planificación de la empresa porque a fecha actual se están empezando a diseñar'),
(3127, 266, 17, 'B', ''),
(3128, 266, 18, 'C', 'Le gustaría disponer de más información de la compañía y del sector. En este punto sería bueno hacer algo más. Se toma el compromiso de estudiar diferentes alternativas para ver cual sería la mejor para mejorar el conocimiento del sector'),
(3129, 266, 19, 'B', ''),
(3130, 173, 13, 'B', ''),
(3131, 173, 14, 'C', 'Se recomienda formación en gestión de conflictos y técnicas de negociación para generar mayor confianza en sí misma en esta competencia'),
(3132, 173, 15, 'C', 'En el ámbito físico (trabajo de almacén) es más resolutiva y con buena resistencia a la presión. En otro ámbito ante presión puede llegar a no ser tan efectiva (no por falta de predisposición).\r\nEs muy metódica y los trabajos los prefiere hacer uno detrás de otro'),
(3133, 173, 16, 'B', 'No conoce las herramientas de planificación de la compañía porque se están creando en este momento.\r\nUn punto fuerte es el orden y es muy metódica en su trabajo\r\nUna vez diseñadas las herramientas de planificación puede ser interesante para ella el conocerlas para aplicarlas a su puesto de trabajo'),
(3134, 173, 17, 'B', ''),
(3135, 173, 18, 'C', 'Le gustaría disponer de más información de la compañía y del sector. En este punto sería bueno hacer algo más. Se toma el compromiso de estudiar diferentes alternativas para ver cual sería la mejor para mejorar el conocimiento del sector'),
(3136, 173, 19, 'B', ''),
(3137, 244, 1, 'C', 'Baja adaptación al cambio y poca flexibilidad, debería mejorar esta competencia.'),
