(3169, 253, 1, 'B', 'Me identifico con la flexibilidad y gestión del cambio. Tengo facilidad para adaptarme a los cambios y a las personas.'),
(3170, 253, 2, 'B', 'Para mi el autoaprendizaje es una manera de actuar. Ante cualquier duda o desconocimiento; investigo, busco, pregunto y me formo si es necesario. Solo de esta manera es posible avanzar en conocimiento.'),
(3171, 252, 1, 'A', 'adfaldkjflaksdjf'),
(3172, 252, 2, '', ''),
(3173, 234, 1, 'B', 'Estaría muy bien poder participar en equipos de trabajo y grupos que persigan objetivos de mayor dimensión, y trabajar en situaciones diversas y campos distintos del propio'),
(3174, 253, 3, 'B', ''),
(3188, 320, 8, NULL, NULL),
(3189, 320, 7, NULL, NULL),
(3175, 253, 4, 'B', 'Sí pienso que tengo cualidades para trabajar con autonomía, y llegado el momento tomar decisiones, valorando pros y contras.'),
(3176, 253, 7, 'B', 'Me siento comprometida con los objetivos de la empresa. Desde mi posición colaboro y trabajo para alcanzar los objetivos de la empresa y los asignados a mi puesto, dándole relevancia al trabajo bien hecho, que al final es la imagen que proyectamos. '),
(3177, 253, 8, 'B', 'Me gustan los retos, superarme y ver de lo que soy capaz. Para alcanzar el éxito en una tarea, además de la confianza en uno mismo, está el trabajo y la constancia. No desistir.'),
(3178, 253, 9, 'B', ''),
(3179, 253, 10, 'B', 'Me considero una persona que cumple requisitos para tener una buena sensibilidad interpersonal'),
(3180, 253, 11, 'B', 'Me identifico como persona con iniciativa para realizar tareas que favorezcan del desarrollo del trabajo, aportando nuevas soluciones, si son necesarias.'),
(3181, 253, 13, 'B', 'Mi forma de ser lleva implícita esta cualidad \"Comportamiento de ayuda y compromiso con otros miembros\"'),
(3182, 253, 14, 'C', 'No tengo un don destacado para la persuasión y la negociación, pero si que según en que ambientes, me desenvuelvo mejor que en otros. Por ejemplo, entre amigos e iguales mejor que con superiores jerárquicos.'),
(3183, 253, 15, 'B', 'Pienso que la Resistencia a la presión, dependerá del límite de presión y de la duración en el tiempo, además del trato ofrecido por el superior.\r\n'),
(3184, 253, 16, 'B', 'Utilizo un Plan de trabajo elaborado en Excel, donde marco las tareas a realizar. Mi asignación de prioridades va en función de los plazos marcados.'),
(3185, 253, 17, 'B', 'Considero que soy apta para trabajar en equipo y de forma individual, pero creo que soy más productiva, resolutiva e imaginativa, cuando trabajo en solitario.'),
