(3284, 456, 3, 'B', 'Adapta el discurso al interlocutor para que llegue mejor el mensaje.\r\nLa comunicación es una habilidad que tiene bastante desarrollada, se ha puesto un B porque siendo una habilidad tan importante, siempre hay recorrido de mejora'),
