(3377, 359, 1, 'B', '8.Podemos estar más atentos a les necesidades de ayuda del grupo, si nos ofrecemos también nos considerarán en nuestro momentos críticos de trabajo.9. Informar un poco más cuando surjan situaciones complicadas nos permitirá disuadir el conflicto con más fluidez.11. Eres abierta a los puntos de vista distintos del tuyo.\r\nExiste una actitud de adaptación para no entrar en conflicto, \r\n10. 11. Faltaría un poco más de comunicación sobre los cambios que afectan a su entorno- informaremos más a nuestro responsable.'),
(3378, 359, 2, 'B', 'En general  abierta a los cursos de formación que ofrece la empresa. \r\n6. Saber consultar cuando se precisa de apoyo con las distintas plataformas de la cías. marítimas, seguro etc..\r\n12. preferimos esperar a cuando se precisa antes de adelantarnos. Intentaremos salir de nuestra zona de confort e implicarnos más\r\n'),
(3379, 359, 3, 'C', '4.7. comunicación en cuanto a las incidencias/ obstáculos que puedan surgir. Si podemos compartir más, nos ayudarán más, tanto a nivel de volumen como a nivel de situaciones complejas. 9.10.11- si podemos comunicar a tiempo, nos permitirá mayor bienestar y fluidez en el puesto de trabajo. siempre recordando que el otro me puede ayudar. '),
(3380, 359, 4, 'B', '1. 3. Puede contar con el seguimiento de su superior si se abre a comunicar. 2.Especialmente autónoma al tomar decisiones- eso es muy favorable para avanzar, pero también es importante compartir en ocasiones de duda. las situaciones compartidas permiten que confíen en nosotros. \r\n'),
(3381, 359, 7, 'B', '6.Buena imagen del depto.: es responder a todos los mails a tiempo- se ha mejorado.\r\n11. valorar expandir nuestra posibilidad de colaborar con el equipo y así mostrar un interés por gestiones/ clientes más allá de los nuestros. - como muestra de compromiso y dedicación por la compañía. \r\n\r\nComo?3.Auto-proponerse retos: ofrecer ampliar a embarques de mayor complejidad- también para salir de la rutina y auto-motivarse y adquirir nuevos conocimientos.'),
