(3423, 463, 3, 'A', 'Creo que me comunico bien tanto con Dirección, como con los distintos Responsables de Dpto., miembros equipo Admon. y filiales\r\nLo más importante en la comunicación es escuchar lo que no se dice'),
(3424, 463, 4, 'A', 'A -\r\nSoy capaz de tomar decisiones, si bien cuando considero que son de alto nivel, antes consulto a Dirección.'),
