(3426, 463, 6, 'B', 'B+\r\nRespecto a pregunta 1 Grado A \"Identificado y preparado sucesor\", es un tema que se me ha requerido y que voy pensando en ello, si bien se me generan una serie de dudas e incertidumbres que debo hablar con D.G.'),
