(3485, 359, 9, 'B', '9.Si,seguiremos pendientes de los detalles, para la gestión de las tareas que lo requieren.\r\nCómo? seguimos con esa línea de atención que precisan las diferentes gestiones .'),
(3486, 359, 10, 'B', 'Cómo ? intentamos comprender a los compañeros para un mejor ambiente laboral.\r\n\r\n'),
(3559, 340, 8, 'B', 'C-3: Si son de  un nivel muy alto debido que no es una faena habitual pueden suponer dificultad (solo en las nuevas tareas).\r\nB-6: Como ya comentado, a veces en tareas nuevas necesita algo de ayuda pero menos que el año pasado.\r\nSeguir ampliando conocimientos para alcanzar mas autonomia'),
(3487, 359, 11, 'B', ' \r\n'),
(3534, 466, 15, 'A', '9. Ante decisiones complejas, ¿buscas el consenso de tu Superior? Si, pero pienso que debería empezar a ser mas independiente en algunos aspectos.\r\n7. ¿Resuelves, sin inconvenientes, varios problemas a la vez logrando alcanzar tus objetivos la mayoría de veces? Si, pero mi actitud puede cambiar en estos momentos me suelo agobiar y bloquear a veces,\r\n1. ¿Transmites a tu entorno laboral emociones pesimistas que impactan tanto en tu trabajo como en el de tu área? Considero que a veces sí, porque me agobio y transmito ese estrés, que se transforma en actitudes pesimistas. Por eso es uno de mis compromisos no siempre pensar en lo peor.'),
(3535, 466, 16, 'B', '4. En ocasiones, ¿puedes mostrarte impulsivo o poco organizado a la hora de enfocar las tareas de tus funciones? Impulsiva si , poco organizada no. Pero suelo ser impulsiva en situaciones de mucho trabajo. Por lo que reconozco que aunque tenga mucho trafico en determinados casos debería pensar las cosas en frío.'),
(3536, 466, 17, 'B', '5. ¿Comparas que tu trabajo esté en relación al del resto del equipo? Considero que el trabajo está repartido conforme a nuestra experiencia y conocimientos.\r\n1. ¿Ofreces tus conocimientos o compartes información, únicamente cuando se te solicita? Considero que comparto la información siempre aunque no se me pregunte por ella.'),
(3537, 466, 18, 'B', '10. ¿Te mantienes informado sobre el desarrollo de nuevos productos o servicios de los competidores y, por lo tanto, eres capaz de interpretar las posibles “amenazas” que ello pudiera suponer para la Empresa? Si pero me gustaría formarme más en cursos para estar mas informada.'),
(3538, 466, 19, 'B', '12. Sí, pero a veces me siento un poco estancada en lo mismo.\r\n1. No considero que sea una persona que ponga excusas cuando no he alcanzado mis objetivos suelo asumir mis errores.'),
(3539, 338, 2, 'B', 'B-8: Seguimos pensando que faltaría algo más de formación en aduanas.\r\nA-10: Ha mejorado mucho más que el año pasado, es mas autónoma.\r\n'),
(3540, 340, 1, 'A', 'Llevamos ya un año con cambios en nuestra área (como ya comente el año pasado) y se ha adaptado muy bien.\r\nSeguir con la gestión al cambio.'),
(3488, 359, 13, 'B', 'Cómo? \r\n8. Para identificar a los principales clientes y sus necesidades, estamos animados a gestionar nuevos envíos. \r\nMantendremos la atención al cliente, respondiendo a sus correos en el tiempo adecuado y a sus solicitudes habituales y puntuales.\r\n'),
(3523, 466, 8, 'B', ''),
(3524, 466, 7, 'B', '9. Admiro su trabajo y valentía ante situaciones, pero no trabajo solo para que brindarle mi talento.'),
(3525, 466, 4, 'B', '6. Me cuesta identificar el problema en concreto.\r\nRespecto al Grado C, me comprometo a empezar a ser mas independiente.'),
(3526, 466, 3, 'B', '9. En el día a día es complicado pararte a conocer las necesidades de cada uno, por si me preguntan o noto inseguridad si intento dar soluciones.\r\n'),
(3489, 359, 14, 'B', '9.La escucha activa no nos resulta incómoda, y estamos dispuestos a escuchar al otro. \r\nContinuaremos siendo sólidos, firmes y honestos en nuestros argumentos. '),
(3531, 466, 11, 'B', '2. ¿Tiendes a dar respuestas automáticas y basadas en la costumbre, por lo que tu capacidad espontánea de respuesta disminuye? Los procedimientos casi siempre son los mismo por lo que hace que mis respuestas se repitan bastante.'),
(3532, 466, 13, 'B', ''),
(3533, 466, 14, 'A', ''),
(3490, 359, 15, 'B', 'Cómo? mantener la calma y la cabeza fría para pensar y gestionar y ver nuevas vías de solución. \r\n\r\n\r\n'),
(3528, 466, 1, 'A', '11. ¿Eres abierto y no defensivo ante los puntos de vista distintos del suyo, mostrando un interés para la Organización/Compañía? Considero que si que soy abierta  a conocer/escuchar distintos puntos de vista , pero muchas veces soy defensiva con mis argumentos. No considero que de esta forma no muestre interés por la empresa.'),
(3529, 466, 9, 'B', ''),
(3530, 466, 10, 'A', '8. Debería controlar mas mis impulsividades y dejar que la otra persona exponga sus opiniones antes de querer yo dar las mias.'),
(3491, 359, 16, 'B', 'Mantenemos la prioridad de las diferentes tareas de los envíos y de mantener al cliente siempre bien informado. \r\n10.12 Las prioridades las marcan el ritmo del trabajo con su diversas casuísticas, por lo que precisamos de más atención.'),
(3492, 359, 17, 'B', '8.9. Seguiremos disponibles para nuestros compañeros. Cómo? adquiriendo más conocimientos para tener más herramientas y poder ayudar. '),
(3527, 466, 2, 'A', '11. Sí, por ejemplo el procedimiento paraduanero CITES , era algo que se dominaba poco. A raíz de cometer errores e interesarme por como hacerlo bien se han adquirido mas conocimientos.\r\n4. Lo necesario si considero tenerlo , pero en funciones básicas. '),
(3493, 359, 18, 'B', 'El dpto viene dirigido por las negociaciones que del dpto comercial, por nuestra parte la visión de negocio se basa en mantener un buen servicio y atención al cliente'),
(3494, 359, 19, 'B', 'Cómo?\r\nSeguiremos cumpliendo:  con lo requerido en las distintas tareas:bookings, respuestas mail, preaviso bls, envío bls, comunicaciones de incidencias etc...\r\n '),
(3495, 380, 2, 'A', '3.busca nuevos procedimientos y no se queda anclada en el pasado. siempre re-actualizándose. \r\nGran voluntad de autoaprendizaje y de compartir los nuevos conocimientos. Interés en ampliar conocimientos (formaciones relacionadas con el sector).\r\n\r\n'),
(3496, 380, 3, 'A', '5.9 Un poco de escucha activa nos puede ayudar a permitir que el otro se desarrolle y proceda de manera independiente. Hay un poco de proteccionismo para ayudar, siempre.8.Proactiva a la hora de comunicar cualquier situación confusa y adelantarse a futuras posibles incidencias. \r\n4.Hay una prolongación en las explicaciones- cómo progresar? ser consciente de la escucha activa y ser más conciso en la comunicación. Tomar consciencia de ser más concisa y clara para evitar confusión al interlocutor.\r\n'),
(3497, 380, 4, 'B', '1. Necesidad de corroborar que lo hago bien... Cómo? confiando en nuestras grandes capacidades profesionales. 3. Capacidad de decidir por si misma a la hora de tomar decisiones. 4.Cada vez hay más seguridad.\r\n0.Gran capacidad de adelantarse a posibles problemas. En general, cada vez más autónoma.'),
(3498, 380, 7, 'A', 'Elevado compromiso y dedicación a la Cía. Es prácticamente insuperable!!!\r\nBúsqueda de la aprobación de cliente externo e interno, compañeros y superiores.'),
(3499, 380, 8, 'B', '1.2- Necesidad de reconocimiento cuanto podemos confiar plenamente en nuestras aptitudes con autoafirmación. Cada vez probamos más de ir buscando soluciones por nuestra cuenta. 8. Ya podemos actuar con más firmeza y decisión. Sabemos que somos profesionales y lo sabemos hacer. \r\n10.Profundo análisis antes de tomar una decisión, con lo cual se asegura muy bien de que el resultado sea positivo'),
(3500, 380, 9, 'A', 'Hay una voluntad y esfuerzo en analizar profundamente las situaciones y poder llegar a las mejores conclusiones antes de tomar una decisión.\r\n9. Trabaja al detalle máximo lo que se avanza a posibles errores. Muy buen control del detalle y el análisis.'),
(3501, 380, 10, 'B', 'preg 8 y12)-En ocasiones anteponemos al otro antes que a nosotras mismas por lo que el intercambio en la relación queda desequilibrado. También es necesario tener una sensibilidad con una misma.\r\nMuy cohesionadora de grupo, evita enfrentamientos, juicios y críticas entre los compañeros. '),
(3502, 380, 11, 'A', '5-6-7 Siempre muy atenta a introducir ideas resolutivas que ayuden al equipo a mejorar. Persona muy proactiva'),
(3503, 380, 13, 'A', 'Alta orientación al cliente, aunque en ocasiones, por no contradecir nos podemos perder en acciones más resolutivas y eficaces que ayudarán al cliente a modificar su tendencia a no salir de la zona de confort- ( que no siempre le favorece) cómo??\r\nInsuperable amabilidad y atención al Cliente!! Gran cuidado y mantenimiento de los clientes!!'),
(3504, 380, 14, 'B', '1. Falta un poco de imposición en lo que es justo y en su justa opinión.\r\n6. Flexibilidad de adaptación al otro.\r\nGran voluntad de negociación e influencia para beneficio de la Cía. Se adelanta a las tareas propias de comercial. Se esfuerza, pero al no tener toda la confianza en nuestras capacidades y confluir tanto con el otro perdemos los poderes de persuasión y pasamos a la complacencia. (preg 1 y 9), cómo mejorar?\r\n'),
(3505, 380, 15, 'B', '3. 4. 11.En época de alto volumen- sería beneficioso priorizar en los argumentos extensos. Ir más al grano para concretizar y rentabilizar el tiempo.cómo? las nuevas herramientas informáticas ayudan a completar datos informativos de manera automática.\r\n4. No hay bloqueo, pero se pretende seguir con la misma dedicación extensa y no hay tanto tiempo. - Cómo- podemos seguir trabajando con el autocontrol?adquiriendo más seguridad, con el tiempo.\r\nSe mantiene una actitud muy positiva y favorable para el entorno aun en momentos de presión- Gracias!!'),
(3506, 380, 16, 'B', 'Buena organización y gran capacidad de adelantarse a las incidencias, con posible acciones de contingencia si fuesen necesarias!! No obstante, podemos dispersarnos en indagar tan profundo en el amplío abanico de posibilidades que puede llevarnos más tiempo del necesario.. Cómo mejorar el establecimiento de prioridades?\r\n'),
(3507, 380, 17, 'A', 'Siempre tiene una actitud de colaboración con el grupo..incluso puede llegar a priorizar antes las tareas del otro.'),
(3508, 380, 18, 'B', 'Aunque es el dpto. comercial quién tiene poder de visión y decisión por su parte, Esther tiene en cuenta revisar las casuísticas económicas y de gestión que favorezcan a la cía.\r\n'),
(3509, 380, 19, 'A', 'Enfoque a la orientación de resultados con el cuidado y atención de las diversas tareas de gestión.'),
(3510, 399, 1, 'B', 'Ha mejorado la toma de consciencia de buscar la mejor manera de atender \"siempre\" el teléfono. 8. Se aprecia una evolución en empatizar con el otro y así evitar las relaciones laborables incómodas. Eso favorece el trabajo.\r\n-Como podríamos mejorar la flexibilidad ante los momentos de cambios o imprevistos en el trabajo?  adaptándose en el momento concreto. '),
(3511, 399, 2, 'B', 'Comparte los conocimientos adquiridos.\r\nPor motivos familiares, no siempre puede disponer del tiempo o el interés por algún curso de reciclaje o ampliacion para el propio desarollo profesional.(7.9)\r\n'),
(3512, 399, 3, 'B', 'En la comunicación, en ocasiones se es algo escueto. Intentaremos acompañar algo más de detalle/argumentación/justificación/ en nuestra comunicación escrita y oral ya que será favorable para el receptor y se gana en confianza.  como? En general, la comunicación ha mejorado. Nos seguiremos centrando en aportar el máximo de información a los clientes y ambiente laboral.'),
(3513, 399, 4, 'B', '3. Podemos contar con el superior en todo momento si hay dudas.\r\n Tiene un nivel de autonomía muy satisfactorio y sabe cuando precisa de la intervención / supervisión del responsable del depto.\r\nBuen planificador. (10)'),
(3514, 399, 7, 'B', 'Se precisa de un poco más de flexibilidad para modificar acciones pero no hay problema en cambiar (pregunta 7).\r\nHay un compromiso firme con la compañía. '),
(3515, 399, 8, 'B', 'Los cambios nos ponen en alerta y provoca reacciones de protección. Nos comprometemos a hacer un ejercicio de autocontrol y confianza en el trabajo realizado y no dejar que el trabajo nos domine. (preg 4)\r\n3. Los retos y cambios repentinos (muy propios en esta profesión) nos incomodan en ocasiones? -se puede mejorar?practicando el autocontrol.- intentando actuar de manera más comprensible con el problema.'),
(3516, 399, 9, 'A', 'Tiene una excelente atención al detalle y minuciosidad con sus tareas.\r\nPensamiento basado en el análisis totalmente.'),
(3517, 399, 10, 'B', 'Implicación por los demás- faltaría ofrecer un poco de escucha y apoyo en los momentos de mucho volumen, siempre que tengamos nuestra mesa controlada. (preg 5) ?\r\nla sensibilidad con el otro ha mejorado en cuanto a que hay mayor empatía.\r\n'),
(3518, 399, 11, 'B', '\r\n'),
(3519, 399, 13, 'B', 'Matenemos la orientación positiva al cliente de modo que nuestro trato y servicio continue siendo de máxima atención. cómo?entendiendo sus necesidades y cumpliéndolas.'),
(3520, 399, 14, 'C', 'Posibilidad de un poco más de persuasión incluso en aquellos momentos que un cliente/ compañero no tenga la razón y nos resulte incómodo. \r\nPoder darle confianza al cliente conforme todo irá bien. preg.2- cómo? utilizando argumentos sólidos y honestos.\r\n'),
(3521, 434, 1, 'A', 'Prácticamente desde mi incorporación a la compañía he vivido cambios relevantes dentro de la compañía, y creo que me adapto a éstos. En cuanto a la flexibilidad cognitiva, social y de entorno también tengo esta capacidad (diferentes directores, diferentes grupos,...), pero creo que esta competencia debe ser inherente al puesto de RRHH. He de mejorar en cuanto a la promoción e implantación de cambios dentro mi área.'),
(3522, 338, 1, 'A', 'Aquí ha habido una mejora considerable pues  se ha adaptado y asimilado muy bien todos los cambios realizados en nuestra área.'),
(3541, 340, 2, 'B', 'Ha adquirido mas conocimientos al ir realizando nuevas tareas, pero faltaría mas formación en aduanas.\r\nCompromiso: Seguir ayudándola para que vaya ampliando mas conocimientos en aduanas.'),
(3542, 340, 3, 'A', 'Como comente en la evaluación anterior es una persona comunicativa y se interesa de preguntar \"el porque de las cosa\".'),
(3543, 340, 4, 'B', 'C-3: Cuando se sale de la rutina \"si\".\r\nA-9: Puntualizar que depende que situaciones \"si\".\r\nHa adquirido mas confianza a la hora de tomar decisiones, debemos de seguir trabajando en ello.'),
(3544, 338, 3, 'A', 'Mireia es una persona muy comunicativa y ha cogido bastante seguridad en si misma por lo que creo que su calificación será \"A\".\r\nNos comprometemos ha que siga trabajando en la \"autoconfianza\".'),
(3545, 338, 4, 'B', 'C-3: Solo si el problema es muy complejo.\r\nA-10: En su trabajo del día a día lo aplica satisfactoriamente.\r\nSiendo mucho mas autónoma podemos mejorar en la toma de decisiones y para ello vamos realizando tareas nuevas.'),
(3546, 338, 7, 'A', ' Mireia tiene un compromiso y dedicación alto con la compañía.\r\nSeguimos haciendo cambios en nuestra área de trabajo para no perder la motivación.'),
(3547, 340, 7, 'B', 'Al realizar nuevas tareas como veníamos comentando se siente mas motivada.\r\nSeguimos realizando cambios en nuestra área para sentirnos mas motivadas.'),
(3548, 338, 8, 'B', 'C-4: Hemos puesto \"no\" aunque  en alguna ocasión ante nuevas situaciones pero mucho menos que antes.\r\nAunque ha cogido mas confianza en si misma aun debemos seguir trabajando en ello'),
(3549, 338, 9, 'A', 'A-9: Al haber realizado tareas que requerían mas atención ha logrado adquirir mas habilidad a la hora de detectar errores .\r\n\"Se ha vuelto mucho mas observadora\".\r\nSeguir realizado tareas que requieran atención al detalle.'),
(3550, 338, 10, 'A', 'Como comentado en competencia anterior hay que resaltar que es una persona que tiene un temperamento muy equilibrado,  buen carácter, es cordial y\r\nno es nada conflictiva.'),
(3551, 338, 11, 'B', 'B-5: Hemos puesto \"si\" pues aporta mas ideas para la prevención de incidencias.\r\nEn general hemos puesto igual que el año pasado, aunque ha habido mejoría debemos de seguir trabajando el tema de la \"iniciativa\".'),
(3552, 338, 13, 'A', 'Mireia da muy buen servicio a los clientes tanto internos como externos.\r\nPero lo dicho anteriormente , es una competencia que siempre puede ser mejorable buscando e innovando nuevas ideas para dar un servicio mejora los clientes.'),
(3553, 338, 14, 'B', 'Seguimos pensando que la mejora seria adquirir habilidades para  contra-argumentar, convencer etc.\r\nRealizar alguna formación para poder adquirir dichas habilidades.'),
(3554, 338, 15, 'A', 'Debido a que en nuestro departamento en general hay momentos clave que debemos \"correr\", Mireia con los años que lleva en la compañía esta muy acostumbrada a\r\ntrabajar bajo presión y ello no hace que el trabajo mengüe en calidad.\r\n'),
(3555, 338, 16, 'A', 'Como dicho en competencias anteriores Mireia planifica bien su trabajo, por lo que creo que no hay mejora a realizar'),
(3556, 338, 17, 'A', 'C-3: Aquí ha cambiado bastante pues interviene mas en las reuniones.\r\nResaltar que hemos logrado mucho, pues como había explicado anteriormente habíamos puesto en marcha algo que considero bastante difícil que era el que todas lográramos hacer todas las tareas de nuestra área y lo hemos conseguido, aunque aún queda camino que recorrer.'),
(3557, 338, 18, 'C', 'Seguimos pensando que esta competencia tiene poca afectación y no podemos aplicarla de todo en nuestro departamento por lo cual queda igual que el año pasado.'),
(3558, 338, 19, 'B', 'B-7: Ya revisa el progreso de sus objetivos.\r\nTenemos que continuar marcando mas objetivos, metas y retos,'),
(3560, 340, 9, 'A', 'Tiene un punto fuerte a tener en cuenta \"la atención al detalle\" es observadora y hábil en resolver problemas.'),
(3561, 340, 10, 'A', 'A-11: Si pero no esta atenta a conflictos que se puedan  generar.'),
(3562, 340, 11, 'B', 'B-6: Aporta mas mejoras.\r\nAl realizar diferentes tareas ha adquirido mas iniciativa pero debemos de seguir trabajando en ello.'),
(3563, 340, 13, 'A', 'En general el trato con los clientes internos y externos es buena.\r\nEsta es una competencia que siempre debemos de buscar retos nuevos para mejorar aún más nuestro servicio con los clientes internos y externos.'),
(3564, 340, 14, 'A', 'Es una persona que persuade y convence.'),
(3565, 340, 15, 'B', 'Ante una excesiva presión tiene cambios de actitud, los cuales ya han mejorado bastante.\r\n'),
(3566, 340, 16, 'A', 'Tiene buena planificación .\r\nDebemos de profundizar mas a lo que se refiere la planificancio y organización de trabajos en equipo en algunas ocasiones.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nTiene buena planificación y organización.\r\n\r\n\r\n'),
(3567, 340, 17, 'B', 'Se adapta perfectamente al trabajo en equipo pero a veces tiene tendencia a realizar primero la faena individual .\r\nSeguir trabajando día a día con todas las tareas del departamento para estar mas compenetradas'),
(3568, 340, 18, 'C', 'Pensamos que esta competencia tiene poca afectación y la hemos dejado igual al año apasado'),
(3569, 340, 19, 'C', ''),
(3570, 445, 1, 'A', 'Compromiso para propuesta y puesta en marcha de nuevos temas / equipos de trabajo de mejora procesos RRHH. (ej: Dibujar proceso incorporaciones, propone Mary a MC)\r\nEstar atenta a posibles mejoras en entorno Digitalización (2019??, quizás 2020)\r\n\r\nAcordamos es necesario un mejor grado de flexibilidad antes nuevos cambios, no siempre el mantener lo existente es la mejor alternativa (por ejemplo, reports, sistemas...)\r\n'),
(3571, 445, 2, 'B', 'Me faltan conocimientos del área laboral, idioma y nuevas tecnologías.\r\nActualmente, por situación familiar, poco tiempo para la formación\r\n\r\nCompromiso 2019:  vemos posibilidades de formación básica (aprox 40 horas) en RRLL.'),
(3572, 445, 3, 'B', 'Compromiso mejora comunicación escrita, fundamentalmente mails mas sintéticos y concisos. (intentar evitar intercambio de varios mails sobre un mismo asunto)\r\nHemos de intentar evitar el constante \"ok saludos\"  , \"ok gracias\", \"ok reviso y te digo\"...\r\n\r\nFalla la comunicación con personas de distinto rango jerárquico. Nos comprometemos a que ante situaciones difíciles se comparte con Soco, quien actuará de mentora.'),
(3573, 445, 4, 'B', 'Intentamos que Mary tenga mas autonomía resolviendo consultas a colaboradores, consensua posible respuesta con Soco antes de dar por definitivo.\r\nSoco mirará de derivar mas temas que hasta ahora viene resolviendo directamente, delegando temas.'),
(3574, 445, 5, 'A', 'Fortaleza:  aplica paciencia en grado máximo en todo aquello que explica / delega.\r\nA mejorar:  dar mas espacio para pensar, no explicar todo, la otra persona debe equivocarse y rectificar por si misma.\r\nMenos \"trabajar en pareja\".'),
(3575, 435, 1, 'A', 'quizás  soy un poco reticente  a recibir  diferentes puntos de vista  aunque si finalmente considero que es bueno para  la organización  los acepto.'),
(3576, 435, 2, 'B', ' necesitaría adquirir más conocimientos y  actualización  en el área de Aduanas necesaria  para nuestra gestión diaria, mi compromiso es realizar curso de  Representante  Aduanero   para 2019'),
(3577, 435, 3, 'B', 'Puntos a mejorar: en situaciones de  presión  mi discurso verbal   no es tan controlado como desearía   y quizás entorpece  gestionar conflictos  con rapidez.'),
(3578, 435, 4, 'B', ' Considero que ante  grandes decisiones si que preciso de supervision  de mi superior, pero en el día a día  no es necesario, tampoco en cada decisión se hace un  profundo análisis  debido a la rapidez en nuestro dia a dia '),
(3579, 371, 1, 'B', ''),
(3580, 371, 2, 'A', '12. No se actualizan debido a  faltan de Cursos ( ej aduanas)\r\n08. Tengo los conocimientos , pero me haría falta ( y por ello voy) a clases de ingles, para ser más resolutiva y perder el miedo al idioma.'),
(3581, 371, 3, 'B', '11.No, simplemente si la información viene de 3º u otro medio, si la comparto pero no la busco.\r\n8.  Facilito puntualmente la info a mis superiores/compañeros para que todos estemos informados. \r\n7. Me considero profesional correcto, y con disponibilidad, pero no preciso.(cometo errores ) \r\n6. No, reconozco que le doy muchas vueltas para llegar al punto final .\r\n2. NO, siempre me excedo de información/detalles'),
(3582, 371, 4, 'C', '11. contrasto mi punto de vista con mi superior ante situaciones desconocidas.\r\n09. No tomo decisiones , pero si aporto nuevos puntos de vista\r\n08. Sí, aunque aun me queda aprender.\r\n07. Rápida no, intento pensar en mi decisión par no equivocarme.\r\nGrado C.  Requiero  del aprobamiento/ comprobación ante decisiones nuevas, pero no preciso del reconocimiento si ya han surgido anteriormente ese \"problema/duda\" '),
(3583, 371, 7, 'B', '11. Si, pero no por ser valorado por mi superior/departamento sino para logar los objetivos marcados tanto por la empresa y para mi.\r\n3. Me comprometo tanto con los profesionales cercano y no tan cercanos\r\n4. Me compromento con los objetivos de la empresa, no solo con los mios particulares.\r\n9. Admiro el trabajo que desempeña , pero no trabajo para brindarle mi talento, sino , para cooperar juntos con el de la compañía.'),
(3584, 435, 7, 'A', 'Puntualizaría en el grado B.pregunta  2 que  mi nivel de  de desempeño y  alcance de objetivos no es   sólo por ser bien valorado  por mi superior/departamento si no por mi misma también.'),
(3585, 435, 17, 'B', 'Aunque debería  celebrar más los éxitos de mi equipo y hacérselo saber regularmente.'),
(3586, 435, 11, 'A', ''),
(3587, 371, 8, 'A', '9. No tengo seguridad al hablar , aunque lo que diga será verídico.'),
(3588, 371, 9, 'B', '2. depende del asunto a tratar.'),
(3589, 371, 10, 'B', '8. Suelo escuchar primero, y luego hablar yo. \r\n6. No me gusta el mal rollo, entre compañeros, pasamos demasiadas horas juntos para tener conflictos, además no se trabaja bien así.'),
(3590, 371, 11, 'C', '7. por ello,  siempre consultando con mi  superior\r\n\r\n'),
(3591, 371, 13, 'B', '12. Cada vez, debido a la experiencia, soy capaz de estructurar las respuesta que le tengo que dar a mis interlocutores.\r\n6. quizás, como indicado en otras cuestiones, no vaya al grano directamente, pero siempre la información es la real.\r\n2. Me gustaría saber qué opinión tienen sobre mi trabajo los clientes ( externos/ internos)\r\n'),
(3592, 371, 14, 'B', '7.Acepto las ideas , aunque no las comparta.\r\n6. consensuo el otro punto de vista, y se veo que los argumentos son de peso, puedo modificar mi opinión.\r\n5. No me esfuerzo en convencer de mi  ideas, no son persuasiva en ese aspecto, le doy mis razones pero no insisto en que convencerles.\r\n'),
(3593, 371, 15, 'B', '6. Creo que la presión es buena durante poco tiempo, mucho tiempo, hace que el colaborador no esté agusto y no se centre en su trabajo diario.\r\n5. Es inevitable, no puedes estar centrado en trabajo si tienes más estrés de lo que puedes sostener.\r\n4. bajo mi punto de vista, creo que los problemas no ayudan a que estén 100% en tu trabajo, y si son habituales con más motivos.\r\n3. Sé , cual es la prioridad, aunque tenga volumen de trabajo.\r\n1. Me caracterizo por ser una persona positiva. '),
(3594, 371, 16, 'B', '4.  suelo ser más impulsiva a la hora de enfocar tareas. Cada día logro ser más organizada.'),
(3595, 371, 17, 'B', '9. dependiendo el tema a abordar. \r\n5. cada uno lleva una seria de tareas/ embarques  en función al tiempo en la empresa. \r\n3. SI me mantengo en silencio, es porque opino lo mismo de lo que se está hablando, \r\n'),
(3596, 371, 18, 'B', ''),
(3597, 371, 19, 'B', '12. a nivel profesional, los obstáculos los veo como retos personales, y no me acomodo a mi trabajo diario\r\n3. hay procedimientos establecidos,  y no por ello, estas poco atento. \r\n2. Cumplo objetivos en tiempo, no dejo nada para ultimo momento.'),
(3598, 351, 1, 'B', 'A TENER EN CUENTA EN TODA LA EVALUACIÓN, DESFASE ENTRE MOMENTO DE AUTOEVALUACIÓN Y ENTREVISTA. ESTO PUEDE PROVOCAR ALGUNA LAGUNA / FALTA DE CONCRECIÓN DURANTE LA EVALUACION\r\n\r\nSe siente cómoda con los cambios siempre que sean para mejorar y crecer. \r\nNo se siente comoda en la monotonía ni los trabajos repetitivos.\r\nSe intuye un recorrido de mejora, lo dejamos para observar, sin ser capaces de concretar en esta reunión.'),
(3599, 351, 2, 'B', 'Predisposición al autoaprendizaje en todas las tareas que se le encomiendan, sean zonas de confort o no.\r\nQuizas necesario recibir formación de la empresa en materia PRL, ingles, ver a futuro si se formaliza oferta formativa Respon.cat en materia RSC.\r\nInterés por formarse en todo lo que la empresa considere adecuado a su puesto'),
(3600, 351, 3, 'A', 'Comunicación es probablemente una de sus fortalezas, siendo capaz dialogar perfectamente con diferentes interlocutores de diferente jerarquía\r\nPequeño recorrido de mejora en comunicación escrita, compromiso para esforzarse por comunicación sintetica y breve, siempre que la situación lo permita.\r\nPendiente evolución en Comunicación en Público, pendiente de concretar con Instituto Comunicación 5 Fars.\r\n'),
(3601, 351, 4, 'B', 'Me considero una persona analítica y con curiosidad. Me gusta observar y estudiar. Ante problemas o nuevas situaciones, busco la mejor manera de proceder, valoro pros y contras y tomo decisiones, siembre basadas en un análisis previo.');
INSERT INTO `com_dic_usr_com` (`duc_id`, `duc_du_id`, `duc_com_id`, `duc_grado`, `duc_observaciones`) VALUES
(3602, 351, 7, 'A', 'Persona con alto grado de compromiso, dedicación y disponibilidad para las necesidades que se presenten.\r\nSoco solicita labor de acompañamiento para generar compromiso en otras personas, incluido personal dirección (Ej. RSC).  Rafi puede actuar como agente proactivo, proponiendo y facilitando nuevas vías para conseguir compromiso con proyectos transversales.\r\n '),
(3603, 351, 8, 'B', 'La confianza en mi misma, es algo que voy trabajando continuamente. Soy consciente de que tengo capacidad de trabajo, habilidades y virtudes para la resolución de problemas, pero he de seguir trabajando la autoafirmación.\r\nPropósito de mejora. Soco intentará dar mayor feed-back apuntando temas en los que entiende no es necesario buscar consenso, sino simplemente trabajar con autonomía.'),
(3604, 351, 9, 'B', 'Considero que tengo capacidad para observar y elaborar conclusiones\r\nLa atención al detalle que necesitamos con máxima excelencia es calibrar siempre el impacto del trabajo, comunicaciones, informes... etc..en terceras personas /dptos.. Ligado a autoafirmación.\r\ncabe mejorar tambien atención a pequeños errores, tipo presentaciones, informes, ...'),
(3605, 351, 10, 'A', 'Normalmente la sensibilidad hacia otras personas, nos hace estar pendientes no solo de lo que puedan comentar, sino de todo el conjunto de expresiones que acompañan al hablar. Pienso que tengo capacidad para percibir pensamientos y sentimientos y actuar en consecuencia.\r\n\r\nEs una persona que trasmite cordialidad, es cercana, invita al dialogo y siempre con espíritu conciliador. Por tanto Sensibilidad Interpersonal es una fortaleza.'),
(3606, 351, 11, 'B', 'Mi línea de actuación ante las diferentes situaciones que se pueden presentar en el lugar de trabajo, siempre va encaminada a buscar soluciones, con la visión puesta en realizar lo más conveniente para el negocio.\r\nConclusión:  nivel adecuado de iniciativa e innovación. La empresa necesita de Rafi, mayor iniciativa para impulsar RSC en otras delegaciones.'),
(3607, 351, 13, 'A', 'Me esfuerzo por conocer que necesidades tienen las personas con las que colaboro y de que manera facilitar esa información para que sea lo más útil posible.\r\nEsta competencia es una fortaleza.'),
(3608, 351, 14, 'C', 'Pienso que la persuasión no es mi fuerte, pero si creo que dispongo de habilidad de negociación.\r\nA mejorar: poner mas énfasis en defender sus propias ideas, si hay convicción y seguridad en un tema, hay que defenderlo, no \"aceptar\" siempre la decisión del otro.\r\nRafi debes \"creértelo mas\".'),
(3609, 351, 15, 'A', 'Ante situaciones de presión, quizás lo mejor es elaborar un listado de tareas, estimar tiempos, y si realmente no se dispone de tiempo o herramientas necesarias para alcanzar los objetivos, trasladar esta situación al superior.\r\n\r\nA lo mejor el problema no se soluciona, pero si liberas parte de la presión cuando has podido compartirlo, y seguir siendo productivo en la tarea que realices.\r\nNo parece haya que establecer mejoras en esta competencia.'),
(3610, 351, 16, 'A', 'Trabajo con lista de tareas y me voy marcando fechas de entrega. Es la mejor manera que he encontrado para no perder el hilo de las tareas que tengo que hacer y poder entregarlas en tiempo.'),
(3611, 351, 17, 'B', 'El trabajo en equipo permite alcanzar unos objetivos que no siempre se pueden alcanzar de manera individual. Considero que tengo capacidad de adaptación para trabajar en equipo y aportar soluciones en interés del grupo y de la compañía.\r\nEn realidad Rafi prefiere trabajar sola. Dentro del equipo es necesario que Rafi muestre mas sus opiniones, no mantener segundo plano como posición confortable.  Compromiso de empezar a trabajar en esto en grupos reducidos.  En la medida en que sea mas participativa , disfrutará y se enriquecerá mas del trabajo en equipo.'),
(3612, 449, 1, 'A', ''),
(3613, 449, 2, 'A', ''),
(3614, 351, 18, 'B', 'Me preocupa y estoy pendiente de las ultimas noticias y cambios en normativas y leyes en referencia a las competencias que corresponden al puesto que ocupo en la compañía.\r\nMi puesto no está tan dirigido al mercado propio de la organización, sino que es un mercado transversal, PRL y RSC.\r\nFalta indagar y estar pendiente de lo que ocurre en nuestra competencia en términos de RSC y PRL. Saber comparar, tomar ideas, definir estrategias...'),
(3615, 351, 19, 'A', 'Ante un trabajo, me intereso por alcanzar los objetivos propuestos y me gusta aportar ideas nuevas con la intención de mejorarlo.\r\nEl trabajo en RSC siempre lo concebimos en \"estar por encima de lo esperable\", esa es la esencia (opinan Rafi y Soco)\r\n\r\nSiempre orientada a resultados:  cumpliendo objetivos marcados, trabajando para consolidar objetivos marcados por la compañía (contención del presupuesto)'),
(3616, 347, 1, 'B', 'Revisar preguntas 3 y 4. En ocasiones se muestra algo reticente al cambio. Tomamos conciencia e intentaremos mejorarlo\r\nCompromiso: se intentará tomar algunas acciones para intentar trabajar la flexibilidad ante los cambios. Por ejemplo, cambios operativos para minimizar la impresión de papel. Comenzaremos intentando eliminar la impresión de la F.I. para los embarques del Grupo.'),
(3617, 347, 2, 'A', 'Su conocimiento SIEMPRE aporta valor'),
(3618, 435, 5, 'B', 'Respuesta  2 grado A  quizás debería tener un feedback  positivo más regular .\r\nrespuesta 1 grado C  demuestro confianza en mis colaboradores pero teniendo en cuenta la antigüedad de cada   colaborador.\r\n quizás soy  un poco reticente a la hora de recibir aportaciones de mis colaboradores  si no estoy segura de  ellas.'),
(3619, 435, 6, 'B', 'Respuesta 3  grado  C Mi compromiso para  2019  seria acreditarme  con Master  logistica Integral '),
(3620, 435, 8, 'B', 'Respuesta  1 grado C no siempre necesito corroborar cada información que doy  si considero que es lo correcto'),
(3621, 435, 9, 'A', ''),
(3622, 435, 10, 'B', ' Mi observación en esta  grado ha sido una situación en concreto con mi colaboradora Vanessa Lopez  debido a una baja laboral larga ,quizás nuestro dialogo o relación laboral no era tan fluida por un mal entendimiento de su  actitud  ante su desempeño de su trabajo, hasta que nos reunimos tuvimos una conversación  larga, comentando  cada una sus puntos de vistas y  nuestra relación y por supuesto su  actitud ante su desempeño  del día a día  ha mejorado mucho.\r\nRespuesta 3  grado B -   en ciertos momentos de estres , no siempre  llego a comprender  que no se cumpla el nivel de exigencia que se necesita en ciertos momentos.'),
(3623, 435, 12, 'B', 'Respuesta  2 grado A - animando a salir a comer, desayunar juntas y compartir  algo más que trabajo.\r\nrespuesta 4 grado B - considero que debería  ofrecer más feedback positivo  con Mercedes.'),
(3624, 435, 13, 'A', ''),
(3625, 435, 14, 'B', 'Aunque a veces el ritmo del día no se tiene el suficiente tiempo para escuchar, convencer  o argumentar y entiendo que se puede malinterpretar .\r\nNo siempre dispongo de la habilidad  para argumentar y convencer a mi interlocutor.'),
(3626, 435, 15, 'B', 'Respuesta  3 grado A - intento la mayoría de las veces   actuar equilibradamente, quizás momento puntuales de mucha presión no todo lo que me gustaría.\r\nRespuesta  4  grado B  entiendo antes situaciones muy complejas '),
(3627, 435, 16, 'A', 'aunque necesito aveces revisarme si la prioridad de mis tareas es la correcta'),
(3628, 435, 18, 'B', 'respuesta 3 grado A - auditoria de calidad a un proveedor    de servicio marítimo ,era muy reticente a trabajar con ellos pero por contar con esta auditoria necesaria para nuestra empresa, se ha empezado a trabajar con ellos  un poco más además de intentar comprender cómo funcionan y trabajan, conclusión ha  sido que no son tan malos como pensaba.'),
(3629, 435, 19, 'B', 'no perder  de vista los objetivos que me han marcado y revisarlos regularmente.'),
(3630, 445, 6, 'B', 'Ver comentarios de autoaprendizaje.\r\nNo se está proponiendo formación externa a colaboradora, pero sí formación interna sobre los nuevos sistemas del departamento'),
(3631, 445, 7, 'A', 'Solicitamos a Sistemas integración de correo en móvil personal, con esto hemos de conseguir el nivel de compromiso y participación necesario en temas del departamento.'),
(3632, 445, 8, 'B', 'Riesgos si no estoy muy segura no toco, me gusta más la prudencia.\r\nTengo que estar muy segura de que una situación la controlo para asumir riesgos\r\n\r\nAdquirimos compromiso de recibir mas información global de departamento, conforme acontecen nuevas situaciones.  Ligado a revisión constante de correo.'),
(3633, 367, 1, 'B', 'Me considero abierta y flexible. Colaboro en los cambios que se han ido produciendo en la delegación\r\n'),
(3679, 230, 1, 'B', 'A1-2-4 Falta recorrido\r\nB2 abierta pero sigue a la defensiva, aunque adminte mejor otros puntos de vista.\r\nc1. conseguida. Seguimos en nivel B'),
(3634, 367, 2, 'A', 'Siempre estoy dispuesta a aprender cosas nuevas. Creo que aplico mis conocimientos a la operativa diaria (excel, tratamiento documentos, balance beneficios).\r\nMe gustaría continuar con la formación de Gestión Aduanera que quedó interrumpida, creo que podría reforzar así mi autonomía en esta área. '),
(3635, 367, 3, 'B', 'Punto 5: Si, pero debo potenciarla. \r\nPunto 8: Ambas cosas están relacionadas\r\nPunto 9: Reconozco que tiendo a anticiparme a las necesidades de los demás. Soy impaciente, pero me propongo potenciar más la escucha. \r\nPunto 10: Faltan medios para canalizar la información. B-First debería de ser una herramienta más activa (ej. Retornos-No exención Iva-, condiciones particulares clientes...)'),
(3636, 367, 4, 'A', 'En general, procuro analizar las ventajas en inconvenientes en cada nueva situación y decidir en consecuencia y de mantera autónoma. \r\nPunto 4: Dependerá de la importancia de la decisión. '),
(3637, 367, 7, 'A', 'Punto 11. Acostumbro a lograr los objetivos no sólo para ser bien valorado sino porque el trabajo tiene que tener un nivel de calidad, de excelencia.'),
(3638, 367, 8, 'B', 'Punto 8: Si necesito corroborar, lo hago, aunque signifique demorar las decisiones. (Mejor corroborar que lamentar)'),
(3639, 367, 9, 'A', 'Intento actualizar/ampliar la información necesaria y propongo acciones preventivas (ej: procedimientos despacho importación). '),
(3640, 367, 10, 'B', 'Punto 8: No por imposición, sino por impaciencia. Trabajaré mi paciencia. \r\n'),
(3641, 367, 11, 'A', 'Procuro mantener la distancia respecto a los procedimientos y así poder observar posibles mejoras. \r\nPunto 11: Ej. Solicitud de Sonia Aznar sobre despacho importación. \r\nPunto 12: Anotar algunos procedimiento en carpeta compartida y seguirlos. '),
