(3706, 377, 3, 'B', 'Preg. 2 (revisar su comentario a la respuesta: no es muy consciente de si suena bien o mal), 9\r\nA veces demasiado concisa en las respuestas vía mail. Contradicción con su valoración. Cree que a veces no es demasiado concisa\r\nNos dice que está tratando de ser menos concisa en sus mails. Pone atención a ello'),
(3707, 377, 4, 'B', 'Aunque está muy bien consultar y se debe seguir haciendo, a veces falta algo de autonomía, quizá por falta de experiencia aunque ha hecho un salto cuantitativo y cualitativo\r\nRev. preg 3 (comercial), 9, 6 (lo intento), 8 (revisar comentario cuadernillo), 10'),
(3708, 377, 7, 'C', 'Comentario pregunta 9, 10, 11, 12 (revisar en general)\r\nLas evaluadas con la calificación C se resumen en la autoafirmación y la seguridad en ella misma\r\nSe compromete a buscar medios (mediante libros, internet, conocidos especializados en el tema...) a mejorar este aspecto.'),
(3709, 377, 8, 'C', 'Va relacionado con la toma de decisiones\r\nRev, preg 2, 3, 4 \r\nLas evaluadas con la calificación ?C? se resumen en la autoafirmación y la seguridad en ella misma\r\nSe compromete a buscar medios (mediante libros, internet, conocidos especializados en el tema?) a mejorar este aspecto. Mejorando esta competencia, mejorará directamente algunas otras'),
