(3711, 377, 10, 'A', 'Es una de sus mejores competencias. Tiene una facilidad innata para percibir los estados de ánimo de los demás sin que los expresen verbalmente. Practica la escucha activa y comprende perfectamente a los demás'),
(3712, 377, 11, 'A', 'Revisar preg. 4, 6, 7 (lo hace), 10, 11 y 12\r\nConstantemente traslada mejoras o necesidades útiles para todo el Departamento. '),
