(3717, 377, 17, 'B', 'Rev. pregunta 1,5 (no es malo), 6 (necesario)\r\nEsta competencia la vamos a trabajar a nivel departamental porque creemos que todos podemos hacer mucho por mejorar en este sentido'),
(3718, 377, 18, 'C', 'Revisar su valoración personal. Sabe + de lo cree (autoafirmación). 7, 11\r\nLas evaluadas con la calificación C se resumen en la autoafirmación y la seguridad en ella misma.Se compromete a buscar medios (mediante libros, internet, conocidos especializados en el tema) a mejorar este aspecto'),
(3719, 377, 19, 'C', 'Rev. preguntas: 1, 2, 3, 7, 10 (comentario personal), 11, 12\r\nLas evaluadas con la calificación C se resumen en la autoafirmación y la seguridad en ella misma\r\nSe compromete a buscar medios (mediante libros, internet, conocidos especializados en el tema...) a mejorar este aspecto'),
