(3735, 341, 19, 'B', 'Compromiso: Mi compromiso con la cia será el de tomar iniciativas para poder mejorar los trabajos en equipo. Si cada uno trabaja de una manera diferente, tratar de unificar las tareas para que todos trabajemos igual buscando siempre la mayor efectividad posible.'),
(3736, 347, 3, 'B', 'Mucha capacidad de comunicación por escrito de forma muy clara y concisa. La comunicación oral es algo más limitada.\r\nCompromiso: se considera que ofrecerle un curso de coaching en comunicación podría ayudar a mejorar esta competencia. A él gustaría mejorar en esta competencia'),
