(3739, 347, 8, 'B', 'Revisar pregunta 9 (depende también del interlocutor)\r\nCompromiso: Actualmente su situación personal está mejorando, espera que siga por el mismo camino y que eso le permita evolucionar en este sentido, teniendo más confianza en sí mismo.'),
(3740, 347, 9, 'A', 'Es una persona que presta muchísima atención a los detalles y eso hace que su nivel de concentración sea muy elevado y por tanto, el margen de error muy bajo'),
(3741, 347, 10, 'B', 'Revisar pregunta 1, 5 y 9. \r\nCompromiso: sus comentarios: \"Aunque a veces soy algo introvertido, no me considero especialmente egoísta, me gusta pensar en los demás y pensar que todos tenemos los mismos derechos y oportunidades. Creo que puedo mejorar en este aspecto mejorando mi confianza y mi comunicación.\"'),
(3742, 347, 11, 'B', 'Revisar pregunta 4 y 10. La puntuación hace referencia a la Innovación.Iniciativa A. Compromiso: Para mejorar en este punto tratará de analizar dónde puedo aportar su granito de arena para aportar mejoras al departamento / empresa.'),
