(3745, 347, 15, 'A', 'Falta matiz en las preguntas'),
(3746, 347, 16, 'B', 'Revisar pregunta 2, 3 y 4. La B es por la parte: Incluye también la capacidad de organizar el trabajo de otros (a revisar)\r\nCompromiso: En la medida de sus posibilidades (volumen de trabajo) intenta supervisar las tareas de su grupo de trabajo, de todas maneras sabe que debe mejorar en la delegación de tareas.'),
(3747, 347, 17, 'B', 'Compromiso: voluntad de trabajar en equipo. Falta más trabajo conjunto y se intentará mejorar \r\nTrabajar en equipo no es repartir el trabajo. Relacionado con la comunicación.'),
