(3749, 347, 19, 'A', ''),
(3750, 358, 1, 'B', 'Valoración personal: dice que a veces le cuesta adaptarse a los cambios\r\nPreg. 5: se puede aumentar la participación.Preg.10 (relacionada con la preg. 5)\r\npreg. 11¿??. No impulsa cambios. Aquí sólo hago un apunte porque  igual no he sabido expresarme bien, no es lo mismo un cambio personal a uno laboral, o si lo has decidido tu o te ha sido impuesto, para mí lo importante es saber crecer y adaptarte a ellos.'),
(3751, 358, 2, 'C', 'Más Curiosidad para la adquisición de nuevos conocimientos.\r\npreg4, 6, 7. A veces no es que le den la info si no conseguirla por medios propios.\r\nCurso ofimática. Pienso que si tengo curiosidad, quizás debería expresarlo de otra forma para que lleguen los resultados, estoy abierta a cualquier sugerencia que se me ofrezca. Por otra parte sí que es cierto que tendría que reforzar mis conocimientos tecnológicos, soy consciente de ello y lo anoto como uno de mis nuevos compromisos.'),
(3752, 358, 3, 'B', 'La comunicación no es sólo hacer preguntas. Comunicación no verbal. Expresarse abiertamente.\r\npreg. 10, 11. Va un poco en relación a la competencia anterior, mi comunicación no llega como a mí me gustaría o debería, lo estoy trabajando como uno de mis compromisos. Ejemplo de falta de comunicación: no hay traspaso de tareas en época de vacaciones (ni a la ida ni a la vuelta)'),
(3753, 358, 4, 'C', 'Leer valoración personal. Cada uno de nosotros debemos tener la autonomía suficiente para tomar decisiones \r\nComentario preg1, 4 , comentario preg 8, 9-si/no, 10, 12.  En algunas  cuestiones  soy prudente y prefiero preguntar y asegurarme para no perjudicar, tampoco es una dinámica que se repita constantemente. Compromiso: tomo conciencia y a partir de ahora arriesgaré más con mis decisiones'),
(3754, 358, 7, 'B', 'Comentar valoración personal\r\nPreg. 3, 4, comentario preg.6, 7, 9, comentario preg.10 (relacionado preg.6), preg. 11, comentario pregunta 12'),
(3755, 358, 8, 'B', 'Autoafirmación\r\nComentar preguntas en general + comentarios\r\nPreg. 7, 10, 11, 12'),
