(3767, 391, 2, 'B', 'OBSERVACIONS: En la actualidad diría que debería invertir mas tiempo en adquirir nuevos conocimientos (cadena de frío, sector, calidad, etc).\r\nCOMPROMISOS: Vicky se compromete a adquirir nuevos conocimientos en temas que pueden ser de utilidad para mi puesto de trabajo (cadena de frío, sector, calidad, etc).'),
