(3770, 391, 7, 'A', ''),
(3771, 391, 8, 'A', 'OBSERVACIONES: En relación con su definición propia, puedo afirmar que Vicky ha mejorado mucho aspecto desde entonces (2016).'),
(3772, 391, 9, 'B', ''),
(3773, 391, 10, 'A', ''),
(3774, 391, 11, 'B', 'OBSERVACIONES: Podría mejorar en el aspecto de \"aportar estrategias de negocio\". No es precisamente su punto fuerte. \r\nCOMPROMISO: Vicky: \"Si consigo incrementar nuevos conocimientos podré aportar nuevas estrategias de negocio\"\r\n'),
(3775, 391, 13, 'B', 'OBSERVACIONES: Desarrolla muy bien sus tareas de dar soluciones al cliente interno, pero puede mejorar mucho su capacidad de desarrollar mejoras para el Cliente Externo.\r\nCOMPROMISOS: Orientarme más hacia el Cliente Externo que quizá no tengo tan puesto el foco como en el cliente interno, a pesar de que todas las gestiones que hago a nivel interno es para que repercutan favorablemente a nivel externo. Creo que va relacionado también con el Autoaprendizaje. Todo aquello que pueda mejorar a nivel personal en cuanto a la adquisición de nuevos conocimientos relacionados con el sector, puede ser productivo y proporcional en la mejora de la relación con el Cliente Externo'),
(3776, 391, 14, 'A', ''),
(3777, 391, 15, 'A', ''),
(3778, 391, 16, 'A', ''),
(3779, 391, 17, 'A', ''),
(3780, 391, 18, 'B', 'OBSERVACIONES: Como comentado en \"ORIENTACIÓN AL CLIENTE\", tiene recorrido de mejora.\r\nCOMPROMISOS: Va relacionado con las demás competencias en las que hay recorrido de mejora. Cuantas más herramientas personales tenga, directamente afecta a un posible incremento en la visión de negocio.\r\n'),
(3781, 391, 19, 'A', ''),
(3788, 405, 3, 'C', '5 Estoy segura que lo cree pero en mi opinión no es así, necesita ser escuchada\r\n6. De hecho verbalmente hablando son bastante desordenados. \r\n7 Si preguntas sí, sino le cuesta \r\n'),
(3789, 405, 4, 'B', '2. y 3 Depende del tipo de problemática. Cuando ella lo considera\r\n7 no tanto de rapidez como de calidad'),
(3790, 405, 7, 'B', '5 Aplica lo conocido que no quiere decir que sea la del Dpto. aunque en este caso me comprometo a unificar criterios\r\n7 En mi opinión no tanto como pueda creer'),
(3791, 405, 8, 'B', '4. Depende. Si tiene que utilizar herramientas que no conoce sí (BPMS)\r\n'),
(3792, 405, 9, 'B', ''),
(3793, 405, 10, 'B', '7. Aunque depende de la relación que tenga con esa persona'),
