(3795, 405, 13, 'B', ''),
(3796, 405, 14, 'C', ''),
(3797, 445, 9, 'A', 'Todo dentro de mi campo de actuación, implantación de los diferentes software (control presencia, inventario o formación). Análisis de absentismos....\r\n\r\nMejorar atender al detalle de toda la info que centraliza el dpto., alertando a Soco cuando se considera que un tema en cuestión llega al limite de reclamaciones / prioridad.'),
(3798, 445, 10, 'A', 'Se reconoce como excesivamente conciliadora, a veces falta defender mejor los argumentos, con asertividad, saber decir lo que toca cuando toca. No es una acción especial en este punto, salvo ser consciente.\r\nDejamos pendiente posibles nuevas formaciones en GESTION DE CONFLICTOS.'),
(3799, 445, 11, 'B', 'Buena respuesta en esta competencia en su ámbito de actuación directo.\r\nPor mejorar esa misma competencia cuando se trata de procesos departamentales en los que intervienen varias personas (Madrid, Azuqueca, BCN).  Buscar donde falla la cadena de responsabilidades y proponer mejoras para lograr mas eficiencia, menos errores.'),
(3800, 399, 15, 'B', 'En el último año, ha habido una mejora sustancial en cuanto a resistir con más serenidad y control los momentos de presión.'),
(3801, 399, 16, 'A', 'La planificación y organización de la mesa es excepcional. Debido al tipo de trabajo dónde entra en juego la improvisación: las gestiones precisan a menudo un desvío de atención y/o priorización de tareas imprevistas. preg.3-10- como recordatorio.'),
(3802, 399, 17, 'B', 'Siempre dispuesto a colaborar, siempre y cuando se lo solicite el equipo. cómo? Podemos tomar consciencia de avanzarnos a las necesidades del grupo.. preg 9.'),
(3803, 399, 18, 'C', 'Al no tratarse del depto. comercial, las tendencia del entorno o fluctuaciones del mercado no afectan tanto en la labor diaria.'),
(3804, 399, 19, 'B', 'Intentamos mejorar en todas las competencias (un compendío),  comparándolo con la actitud ante cada competencia del año anterior.\r\n'),
(3805, 451, 4, 'A', 'Grado B. 1- los datos, números y conceptos son la base a considerar cuando se debe tomar cualquier decisión.4. debido a mi cargo, debo tomar decisiones habitualmente ante situaciones nuevas e imprevistas.\r\nGrado C.2. es imprescindible ser rápidos en las respuestas antes de que el problema pueda ir a más. 4.Sólo solicito supervisión cuando ya he acotado toda las posibilidades y el resultado no es efectivo. Afortunadamente, apenas preciso de supervisión. '),
(3806, 451, 1, 'B', 'La flexibilidad es una aptitud imprescindible tanto en las gestiones de operativa (los imprevistos en el transporte son muy habituales) como en la relación con los diferentes interlocutores ( pueden llegar a ser hasta 5 los actores involucrado para cada expedición). \r\nLa flexiblidad también será imprescindible para los proyectos de mejora continua y para los nuevas herramientas de trabajo que están en continua actualización.'),
(3807, 451, 2, 'B', 'Grado A.4.5. se requiere más esfuerzo para investigar nuevas tecnologías. Estoy abierta y soy participativa para cooperar con las distintas áreas. (Mejoras Kaizen).\r\nGrado B. 4. Abierta a formaciones diversas que permitan renovación y evolución a nivel profesional y personal.\r\n'),
(3808, 451, 3, 'A', 'Grado A3. Imprescincible argumentar con solidez acompañando datos y hechos- es parte de la casuística de incidencias en la operativa. \r\nGrado C. 1- sólo reporto cuándo se producen incidencias graves que puedan afectar a la cía. No acostumbro a molestar con las incidencia que se puedan resolver en el dpto.y afectan sólo a nivel departamental. Se pretende ser resolutiva.\r\n3.4 Procuro expresar las ideas principales y básicas para no crear confusión al interlocutor. A la vez que tener en cuenta la opinión del otro através de la escucha activa.\r\n'),
(3809, 451, 5, 'A', 'Grado A\r\n1.Tengo total confianza en back-up a la hora de delegar tareas en mi ausencia. Básicamente, a nivel operativo que es lo que requiere de total atención. 3. Las reuniones de competencias son una perfecta herramienta para recordar al colaborador sobre su compromiso y responsabilidad y de las repercusiones en caso contrario.\r\nGrado B.1-4. El equipo siempre deberá reportarme sobre cualquier incidencia de modo que podamos aprender juntos a resolver, además de ganar en confianza.\r\nGrado C.1. Después de compartir tanto tiempo, sé perfectamente en quien puedo confiar más o menos y quién es más o menos honesto.'),
(3810, 451, 6, 'B', 'Grado A.3. Teniendo en cuenta la entrada de nuevos clientes, es imprescindible que los colaboradores Salgan de la Zona De Comfort y se comprometan con la atención y aprendizaje de las casuísticas de estos nuevos tráficos.\r\nGrado B.2.3 Será necesario hacer más reuniones a nivel individual para revisar su evolución y poder ayudar y mejorar.\r\nGrado C. 1-2- siempre que acontece un curso/formación y el trabajo lo permite, procuro asistir.'),
(3811, 451, 7, 'A', 'Grado B.1- Procuro mantenerme motivada en el día a día de mi trabajo, tomando la cía y el trabajo como algo personal.\r\n No siempre es fácil motivar al colaborador que ya asiste con poco interés. '),
(3812, 451, 8, 'A', 'Grado A.Considero tener una actitud positiva ante los nuevos retos confiando en mis posibilidades. al menos lo intento.\r\nGrado B. Procuro ser completamente autónoma a nivel colaboradora y a nivel departamental. Sólo solicito de apoyo en casos extremos.\r\nCon los años de experiencia y la madurez, se va adquiriendo mayor seguridad y autoafirmación.'),
(3813, 451, 9, 'B', 'Grado A.3-ante una incidencia, es imprescindible hacer un estudio detallado del origen y de las repercusiones.\r\nGrado B.4- la experiencia me permite identificar los errores con más facilidad.'),
(3814, 451, 10, 'A', 'Grado A.1. la auténtica intención siempre es descubierta, por lo que es vital ser honesto primero con uno mismo para serlo con el otro. 2.Procuro abandonar ideas preconcebidas, pero no siempre es tarea fácil.\r\nGrado B. Es imprescindible un buen clima de trabajo para lo productividad del dpto. Grado C2- Inevitablemente las tensiones en el trabajo pueden crear reacciones negativas- imprescindible practicar la paciencia y comprensión del otro. 3. Cada colaborador ha sido indicado personalmente que se debe evitar la crítica al compañer@.'),
(3815, 451, 11, 'C', 'Grado A. pertenezco al grupo de mejora - por lo que participo en los proyectos de mejora comunes a la Cía. No obstante, al ser parte principal del equipo operativo y de gestión del Departamento, no dispongo de tanto tiempo para dedicarme plenamente a ello.'),
(3816, 451, 12, 'B', 'Grado A. Con la experiencia he podido comprobar que la manera más eficaz de inspirar y conseguir confianza es con mis propias acciones y no desde el imperativo mandato.2 - Estrategia: Al ser parte del equipo operativo, procuro mostrar todo el interés posible en las gestiones diarias e involucrarme tanto o más en las tareas más insignificantes, como ejemplo de compromiso con el equipo y con la empresa. 4. Procuro tener muy en cuenta a los otros depts e inspirar esta actitud al resto del equipo.\r\nGrado B. 3- las cargas de trabajo están repartidas de acuerdo con las necesidades comerciales y las capacidades/aptitudes de cada colaborador.'),
(3817, 451, 13, 'A', 'Grado A.1. desde tráfico estamos en comunicación constante con el cliente, por lo que somos comunicados en todo momento de sus necesidades o insatisfacciones. 4.Es importante darle al cliente plena confianza por lo que la actitud positiva le da tranquilidad. El cliente es el motor principal en una empresa de servicios, por lo que es importante atenderlo con todo detalle.  Grado C. el cliente interno es tan importante como el externo para propiciar la armonía. De la misma manera los proveedores deben ser bien atendidos.'),
(3818, 451, 14, 'A', 'Grado A 2. Procuro ser honesta en mis argumentos y creo que es la mejor manera de persuadir.'),
(3819, 451, 15, 'A', 'Gracias a la experiencia, a la madurez y a un trabajo de desarrollo personal, cada vez gestiono mejor los momentos de presión.'),
(3820, 451, 16, 'B', 'Grado A. las gestiones de tráfico precisan de una organización exhaustiva de las tareas, ya que en momentos de mucho volumen el caos es incontrolable.\r\n3.las tareas están repartidas en el depto. en función a las necesidades comerciales y por capacidad y aptitud del colaborador.'),
(3821, 451, 17, 'A', 'Grado A.4- es muy importante tratar a todos los componentes del grupo con ecuanimidad.\r\nGrado C. 2el apoyo es importante para los miembros, cada uno a su nivel aporta lo mejor de sí. \r\n4.mi trabajo está en completa relación con el resto del equipo,  siendo una operativa más y gestionando las mismas tareas. '),
(3822, 451, 18, 'B', 'Grado A./ Grado c 3. lo que más nos puede diferenciar con la competencia, a parte de los precios, es nuestra atención exclusiva al cliente.'),
(3823, 451, 19, 'B', 'Grado A.1.Los objetivos vienen marcados por el volumen de envíos. Las gestiones de cada expedición van marcando el ritmo.\r\n2. compete al dpto. comercial.\r\n'),
(3824, 434, 2, 'B', 'Javier a nivel personal podrá ser mas proactivo en su autoaprendizaje, sobretodo en temas ofimáticos / informáticos.  Resto de áreas sí están en nivel adecuado.\r\nNecesario realizar formación Excel.  Javier busca y miramos de incorporarla en 2019 si hay cabida.'),
(3825, 434, 3, 'B', 'En ocasiones tengo la impresión que debo de mejorar en la habilidad de comunicarme de una manera más efectiva. Las mejoras dependen exclusivamente de Javier y son:\r\n- Buscar mejor el \"cuando\", momento de trasmitir el mensaje.  A veces se dilata.\r\n- No ser tan permeable a la comunicación negativa de interlocutores CE\r\n- Organizar mejor las reuniones con CE (anticipación)\r\n- Cuando conoce un tema , no limitarse a escuchar la opinión del director, posicionarse con visión RRHH desde primer momento.\r\n\r\nSi es necesario apoyarse en Soco para asegurar el camino en temas CE y comunicación con Dirección.'),
(3826, 434, 7, 'A', 'Aunque he contestado todo que SI, lo que me daría un grado de competencia A, pienso que debo de mejorar en cuanto al conocimiento de los objetivos de la compañía para poder interiorizarlos\r\nConocer objetivos depende de la transmisión que hace la empresa.  \r\nSoco ve una fortaleza clara en compromiso y dedicación, calificación excelente.  Opinión corroborada con Carlos.'),
(3827, 434, 8, 'C', 'Esto es mi eterno problema.... me falta creérmelo...\r\nEn muchas ocasiones consigo realizar con exito las tareas que se me encomiendan... pero con el sufrimiento innecesario de ese convencimiento  de ser capaz.\r\n\r\nA trabajar CREERSELO, creer y estar convencido de tus capacidades. Depende de Javier. Soco reforzará con su feed-back.\r\nDebemos explorar caminos para mejorar esta autoafirmación.\r\n'),
(3835, 445, 12, 'A', 'recorrido de mejora en grado B, necesitamos hacer entender la labor de departamento como un todo, no exclusivamente propiedad sobre las tareas, todos los miembros del equipo deben velar por la buena consecución de las tareas , independientemente de en qué punto de la cadena pueda haber fallos (ej: trasmitir a Sandra las faltas de entrega de Javier no se pueden quedar ahí, debemos asumir la responsabilidad todo el equipo y hacer lo necesario para no romper la cadena)'),
(3836, 445, 13, 'A', 'Si bien es correcto valorar en A porque desde RRHH trabajamos con esta voluntad de orientación siempre a nuestro cliente...\r\nRecorrido de mejora:  saber decir NO, saber cuando responsabilidad es RRHH o no, ... hay que definir mejor las \"parcelas\".\r\nEn caso de duda, pedir feed-back a Soco antes de responder. Si conseguimos acotar mejor la responsabilidad de RRHH, evitaremos intercambios de mail interminables, que nos hacen perder tiempo.'),
(3828, 350, 1, 'A', 'No seguir exclusivamente instrucciones para instrumentar los cambios, sino  participar activamente y proponer tareas necesarias para llevar a cabo ese cambio. '),
(3829, 350, 2, 'A', 'Áreas de mejora de conocimiento: nuevas tecnologías (office / redes sociales).\r\nPropuesta formación Excel nivel intermedio, mejor dominio fórmulas. Alguna formación en redes.\r\n'),
(3830, 350, 3, 'A', 'Evitar excesos de mails. Evitando \"ok, gracias\", \"lo miro y te digo\", \"ok, saludos\"'),
(3831, 350, 4, 'B', 'No preguntar siempre a Meri que debe hacer, sino proponer qué haría. \r\nTenemos que conseguir mayor autonomía y toma de decisiones.'),
(3832, 350, 7, 'B', 'Buen grado de compromiso en su área de actuación.  Debemos adquirir mayor grado de compromiso con el departamento, alertando las veces que haga falta cuando la cadena se rompe en algún punto, ya sea responsabilidad propia, o de otro compañero. Esforzarse por cumplir con objetivos del departamento, aunque no sean propios.\r\nEj. formaciones PRL, vigilancia de la salud. etc. de delegaciones.'),
(3833, 350, 8, 'B', 'No hay falta de confianza. Quizás habría que entrenar más la capacidad de dar feedback en el departamento'),
(3834, 350, 9, 'B', 'Muy buena atención al detalle. Faltaría entrenar más el pensamiento analítico para mirar más allá de las tareas cotidianas o más allá de la simple petición.\r\nEjemplo, te piden algo, ser capaz de intuir el por qué de la petición para saber dar la mejor respuesta.'),
(3837, 350, 10, 'A', 'Gran sensibilidad interpersonal'),
(3838, 350, 11, 'B', 'Prestar atención a aquellas tareas que se puedan mejorar o optimizar dentro de su ámbito o en el departamento'),
(3839, 350, 13, 'A', 'Muy buena orientación al cliente, interno, externo y dentro del departamento'),
(3840, 350, 14, 'B', 'Competencia que se requiere poco en su ámbito de actuación, más allá de solicitar al personal la documentación necesaria (control presencia y formación). En este caso, muy buena capacidad para conseguir lo necesario.'),
(3841, 350, 15, 'A', 'Buena capacidad para priorizar y tolerar la presión.'),
(3842, 350, 16, 'A', 'Ningún problema a la hora de planificar y organizar el propio trabajo\r\nMayor dificultad para planificar el trabajo de otros, por movilidad de agenda'),
(3843, 350, 17, 'A', 'Ningún problema para trabajar en equipo y colaborador. Solo prestar más atención a la consecución de objetivos departamentales'),
(3844, 350, 18, 'C', 'No se tiene esta capacidad'),
(3845, 350, 19, 'B', 'Mucho esfuerzo por conseguir resultados propios, se requiere mas atención para conseguir resultados de departameto'),
(3846, 445, 14, 'B', 'Todo lo puntuado en A y B, hace referencia a la interlocución con proveedores (nuevas implantación soft, ETT, ...)\r\nPero, tenemos recorrido de mejora con interlocutores internos (algunos mandos, directores... etc.). Para mejorar:\r\n- antes de tratar un tema, preparar bien el argumentario. Reflexionar y aglutinar info / dtoas necesarios\r\n- imaginar esa conversación antes de mantenerla. Prever toda la info que va a ser necesaria.\r\n- Si es necesario , consensuar con Soco\r\n- En resumen, tener un discurso solvente  y solido.\r\n\r\nPersuasión , inlfuencia - ligado con comunicación. Necesario prepararse mejor antes de tratar un tema. Si evita varios mails sobre mismo tema e intenta condensar en un solo mail todo lo que afecte en el tema a tratar, el discurso será mas solvente y se reconocerá como mas fiable.  esto ayudar e disminuir discusiones o diferencias de criterios a veces interminables.'),
(3847, 445, 15, 'A', 'Actualmente Soco no puede evaluar esta competencia. No hay situación de presión en dpto. RRHH Barcelona.\r\nEs necesario que Soco traspase parte de sus temas, pero Mary debes actuar con autonomía, en la medida que yo paso un tema, yo no voy a estar en primera línea.\r\nEn resumen, algunos de los temas que lleva Soco actualmente , deberán ir pasando a Mary.'),
(3848, 445, 16, 'A', 'Esta competencia la valoraremos con mayor objetividad el próximo ejercicio.\r\nPor ahora debemos balancear mejor el trabajo, Mary puede empezar a asumir tareas de Soco desde ya (análisis de casos conciliación, presentación temas normativos a CD, preparar temas para CE...)'),
(3849, 445, 17, 'A', ''),
(3850, 445, 18, 'C', 'No se trata tanto de conocer clientes, operativa, etc...  Se trata mas de tener una visión critica y un interés por conocer que hace nuestra competencia en nuestras áreas de actuación  (que sabemos de ellos en términos selección, formación, aplicación convenios, RSC....)'),
(3851, 445, 19, 'B', 'Orientada a resultados en microtemas, ej. presupuesto formación, claramente SI.\r\nOrientación a resultados en ámbitos relacionados con RRLL o similares NO, falta evolución.  Veremos que formaciones pueden ser oportunas.\r\nOrientación en otras parcelas del dia a dia, marcarte objetivos de mejora (ej. absentismo, selección...).  buscar ser mas eficiente en lo que ya esta en curso, anticipar soluciones.Esto quiere decir, apoyarte menos en Soco y ante problemas , conflictos, etc... reflexionar y proponer la solución. O sea, propones meta para trabajar tu misma para llegar a ese resultado. NO esperar a que siempre la directriz la marque Soco.'),
(3852, 390, 1, 'A', 'Comentar pregunta 2 (proactividad para impulsar los cambios). Comentar pregunta 11, en ocasiones algo defensivo\r\nEstá trabajando en ello para hacer una mejor gestión de las críticas hacía su trabajo o hacía su persona.'),
(3853, 390, 2, 'A', 'Se esfuerza para tener la información actualizada'),
(3854, 390, 3, 'A', 'Gran capacidad comunicativa aunque a veces debería ser más directo en sus exposiciones. Acordamos que no siempre es su cometido hacer según qué exposiciones. Se compromete a ser más conciso'),
(3855, 390, 4, 'A', 'Comentar pregunta 12'),
(3856, 390, 7, 'B', 'Por motivos laborales se siente desmotivado . A pesar de que proyecta una buena imagen de la compañía, vamos a trabajar la motivación para que podamos evolucionar en esta competencia. Él seguirá comprometido con los compañeros, la empresa y con los clientes\r\nPregunta 2, 7 (sí pero a veces algo reticente), preg.12 (faltaría motivación personal?)'),
(3857, 390, 8, 'B', 'Falta la valoración personal. En ocasiones se siente incómodo/defensivo ante alguna valoración \"crítica\". Compromiso: Estoy trabajando para mejorar la aceptación de las críticas. Pregunta 4'),
(3858, 390, 9, 'A', 'Es una persona que hace un análisis profundo de diferentes elementos, aspectos, etc. Tal y como indica en su valoración, el puesto de trabajo lo requiere\r\nPregunta 9 (lo hace y es importantísimo que siga haciéndolo)'),
(3859, 390, 10, 'A', 'Vela por el buen clima laboral intentando que no se generen conflictos'),
(3860, 390, 11, 'B', 'Es una persona con gran iniciativa, aunque ha menguado algo en los últimos años. A qué es debido?. Por motivos LABORALES ha habido una bajada de INICIATIVA debido a la DESMOTIVACION. De todas maneras, sigo aportando. Trabajaremos la motivación'),
(3861, 390, 13, 'A', 'Ayuda y sirve constantemente a los clientes internos y externos. Esta competencia está muy desarrollada'),
(3862, 390, 14, 'A', 'Falta valoración personal'),
(3863, 390, 15, 'C', 'Falta la valoración personal. Va relacionada con la siguiente competencia, con el establecimiento de prioridades. \r\nPregunta 3, 4, 5, 12'),
(3864, 390, 16, 'C', 'A veces se puede priorizar de manera que lleguemos a mejores tiempos a según qué tareas. Vamos a revisar cómo nos organizamos o en qué tareas se está empleando más tiempo para conseguir mayor productividad sin necesidad de crear estrés.\r\nCapacidad de organizar el trabajo de otros¿? Preg. 3\r\n'),
(3865, 390, 17, 'B', 'Relacionado con la iniciativa. Ha perdido un poco esa actitud. Esta competencia la vamos a trabajar a nivel departamental porque creemos que todos podemos hacer mucho por mejorar en este sentido. Pregunta 5. Es importante comparar para equilibrar. David comenta: \"es genial que sea algo que queráis trabajar. Me parece un tema clave en este departamento la verdad, siempre que se respeten las habilidades personales de cada uno y que se encuentre la fórmula para conjugar todas ellas para un fin común.'),
(3866, 390, 18, 'A', 'FALTA LA VALORACIÓN PERSONAL\r\n'),
(4165, 349, 13, 'B', ''),
(3867, 390, 19, 'B', 'FALTA LA VALORACIÓN PERSONAL\r\nmotivación? Revisión de la Productividad personal: lo hace/ revisa?¿\r\nPregunta 5, 10. Revisamos de la Productividad personal. Hay diferencias con el resto del equipo. Quizá su dedicación en otras cuestiones hace que no se pueda focalizar en otras tareas. Revisamos para incrementar la productividad. '),
(3868, 434, 4, 'C', 'Aunque he contestado en la mayoría que Si, y en el día a día suelo tener autonomía en la toma de decisiones, considero que debo mejorar en esta competencia.\r\n\r\nEn el dia a dia, nada a mejorar, hay autonomía.\r\nEn temas puntuales, donde la acción a realizar esta clara, Javier no debe esperar conformidad de Soco.  Actuar e informar, aun a riesgo de equivocarse.  Mas actuar e informar, menos preguntar y esperar.'),
(3869, 434, 9, 'B', 'Atención al detalle es optimo, A.\r\nPensamiento analítico no hemos tenido ocasión de observar suficientemente, debemos poner a prueba. Probablemente Soco delegar algún tema de los \"complejos\" (Javier lo tomará como un reto!!)'),
(3870, 434, 10, 'A', 'Fortaleza indudable, reconocida interna y externamente.');
INSERT INTO `com_dic_usr_com` (`duc_id`, `duc_du_id`, `duc_com_id`, `duc_grado`, `duc_observaciones`) VALUES
(3871, 417, 1, 'B', 'Nivel compañía: Sí, considero que acompaño e impulso el cambio, a la vez que aporto mi punto de vista\r\nNivel personal: necesito identificar en mi interlocutor buen conocimiento de lo que expone, sino mi flexibilidad merma.\r\n'),
(3872, 417, 2, 'A', 'A3. Considero tengo recorrido mejora en ampliar conocimientos operativos y financieros.\r\nA medio plazo, veo necesario realizar un PDD (Iese, Esade??)\r\n\r\n\r\nAunque considero lo prioritario en estos momentos a nivel formativo es DIGITALIZACIÓN.\r\n'),
(3873, 417, 3, 'B', 'C4 - Sí, pero quisiera dedicar mas tiempo para conocer necesidades de los demas. La voragine del dia a dia me deja poco tiempo para interactuar con las personas.\r\n\r\nRecorrido de mejora en :\r\nA2 - definir Plan de Comunicación determinando el medio mas idoneo. Muy ligado a transformación digital / Redes Sociales.\r\nA4 - mejorar discurso emocional, convencer desde la emoción. Inteligencia emocional.\r\n'),
(3874, 434, 11, 'C', 'Falta recorrido, debe mejorar:\r\n- Adelantarse a acontecimientos: ej: puede ser beneficioso provocar reunión CE sin petición de la RLT, \"conflictos\" en los que podemos trabajar con mayor anticipación...\r\n- Asumir riesgos, se acepta el error, es importante equivocarse.\r\n- Proactivo en aportación de mejoras a procesos del departamento.'),
(3875, 434, 13, 'A', 'Fortaleza de Javier, vocación de servicio a su cliente interno, siempre interesado en entender y satisfacer sus necesidades.'),
(3876, 434, 14, 'C', 'He de mejorar en esta competencia, sobre todo de cara a las reuniones del comité. También en la relación con sus superiores, si esta convencido de algo, hay que defenderlo.\r\n\r\nQuizas alguna formación en Negociación.'),
(3877, 434, 15, 'B', 'Se maneja bien en la incertidumbre, falta de planificación, etc...\r\nMejorable:  resistencia en la presión por desacuerdo (CE).\r\nCompetencia para observar a futuro, sensación de que en situación muy exigentes hay bloqueo, no recordamos casos exactos en el momento de la evaluación.'),
(3878, 417, 4, 'A', 'A1 - lo ideal seria no tomar decisiones estratégicas cuando la información disponible tiene alto componente de ambigüedad, pero esta no es la realidad de Airpharm y considero hay que actuar cuando la situación lo requiere. Ej: externalizar nomina (con pocos elementos que ayuden en la decisión), iniciar proyecto Digitalización , arranque proyecto Are@8'),
(3879, 417, 5, 'B', 'A2. La motivación y el compromiso se trabajan con el propio ejemplo. Actuando de igual modo con todo el equipo, hay algún caso en que el compromiso no es todo lo que desearía.\r\nA4. Imposible coaching permanente.  Busco la eficiencia, siempre, pero el coaching permanente no es viable, por tiempo.\r\n\r\nPuntuo como B, pues diferentes motivos me hacen estar muy involucrada en el dia a dia (en algunos temas), hay que buscar la manera de delegar mas y distanciarse \r\n'),
(3880, 434, 16, 'B', 'Compromiso de mejora en planificación, no dejemos que la improvisación que acompaña al puesto afecte en todos los ámbitos.\r\nValdra la pena organizar carpetas de e-mail.'),
(3881, 434, 17, 'A', ''),
(3882, 434, 18, 'C', 'Vision de negocio en interno seria ok, pero falta la visión y reacción a las tendencias que nuestro ámbito de actuación tiene fuera:  formación, convenios, salarios..'),
(3883, 434, 19, 'C', 'Esta competencia está en un nivel adecuado, quizás sí la compañía debe ofrecer mas oportunidades de participación en otras metas de mayor envergadura (ej:Presupuestos,)\r\nFalta mejorar análisis de información, en ocasiones Javier no esta recibiendo información necesaria para hacerlo (a partir de ahora facilitaremos presupuesto formación y observaremos si falta información de otros temas)'),
(3884, 417, 6, 'B', 'C1. si mantengo reuniones, aunque menos de las que yo quisiera.  No encuentro el tiempo necesario, ultimo año incluso complicado encontrar breves momentos para reflexionar antes de tomar decisiones.\r\nC2. Sobretodo en la reunión anual de evaluación por competencias.'),
(3885, 417, 7, 'A', 'Me considero una persona altamente comprometida con Airpharm y con máxima dedicación, a veces incluso en exceso.'),
(3886, 417, 8, 'A', 'B2 Siempre predispuesta a cambios en mi rutina laboral, sino mal andaríamos.  Me gustan los nuevos desafíos.  Importante nuevo proyecto:  Digitalización\r\n\r\n\r\nPienso que la autoafirmación es una de mis fortalezas. Con frecuencia llevo a cabo acciones que otros parecen evitar, asumiendo la responsabilidad que ello conlleva'),
(3887, 417, 9, '', ''),
(3888, 443, 1, 'B', 'Clientes es un departamento que ha de ser muy flexible a los cambios ya que además de los propios en nuestro día a día, tratamos con otros departamentos y nos tenemos que adaptar a sus propios cambios continuamente.\r\nPersonalmente creo que con los años he ganado en experiencia y me adapto mejor a ellos. \r\nSi es cierto que a veces me cuesta \"liderar\" cambios porque mi forma de ser no la considero de \"líder\" y no me es fácil ser proactiva en ese sentido.\r\nPero como he contestado en algún punto, creo que aunque a veces lo vea complicado, me adapto rápido. '),
(3889, 443, 2, 'B', 'Estoy totalmente abierta y preparada para el autoaprendizaje. Quizás me faltaría un poco de seguridad en mi misma para poder emprender acciones nuevas (punto A.3)\r\nEn reuniones que tengo con otros departamentos, por ejemplo de Impagados con los comerciales, me gusta atender a sus comentarios para estar informada de entresijos de la empresa que de una forma u otra me pueden ayudar en mi día a día. '),
(3890, 443, 3, 'B', 'Creo que no tengo facilidad verbal y eso hace que a veces me cuesta comunicar lo que quiero expresar. \r\nSi que es cierto que me esfuerzo mucho en ello y que el hacer presentaciones en diferentes reuniones me ha ayudado a expresarme mejor y perder miedo. \r\nEn cuanto a la comunicación con mi equipo, creo que es fluida igual que la que tengo con otros departamentos. '),
(3891, 443, 4, 'A', 'Creo que en este aspecto he mejorado con el tiempo ya que la experiencia me ha enseñado como proceder en muchos casos a la hora de tomar decisiones.\r\nSi es cierto que en la mayoría de los casos necesito supervisión. \r\nGrado A. Punto 1. Es lo que más me cuesta. El tomar decisiones que puedan ser \"impopulares\" considero que me es muy difícil. '),
(3892, 443, 5, 'B', 'Me cuesta delegar ya que a veces me falta confianza en personas de mi alrededor, pero poco a poco intento confiar un poco más. \r\nPor ejemplo la pregunta 1 del grado B hace un tiempo sería un NO rotundo. Ahora el NO con matices.. \r\nCreo que al igual que yo, mis colaboradores, ya tienen más experiencia y eso siempre ayuda. \r\nEn el Grado C. Punto 1. He puesto un NO pero tampoco sería tan claro como hace un tiempo, ya que quizás les cueste tomar decisiones, pero conocen perfectamente su trabajo. '),
(3893, 443, 6, 'B', 'En el Grado B.  No hacemos reuniones individuales pero si es cierto que continuamente exponemos problemas, mejoras, puntos de vista entre el equipo de clientes. Por lo que considero que la comunicación entre las 3 es fluida. '),
(3894, 443, 7, 'A', 'Hay épocas de todo, de motivación y de desmotivación. Pero creo que siempre he mantenido mi dedicación a la empresa dentro de mis posibilidades. '),
(3895, 443, 8, 'C', 'Reconozco que en este sentido tengo mucho que mejorar. Me cuesta dominar mis sensaciones o sentimientos y a veces influyen en mi toma de decisiones. '),
(3896, 443, 9, 'A', 'Creo que estas cualidades las tengo. Soy una persona, que aunque a veces me pueda despistar, tengo un pensamiento analítico y atención al detalle. \r\nNo me he puesto una A porque la afirmación 1 y 2 del Grado A he puesto un NO. Ante problemas complejos, a veces puedo tener más problemas para buscar soluciones y necesito el apoyo de mi superior. '),
(3897, 443, 10, 'B', 'En este punto reconozco que tengo camino que recorrer. A veces soy visceral y me pueden influir sentimientos personales. '),
