(3907, 227, 19, '', ''),
(3908, 443, 11, 'B', 'Esta competencia no me es fácil pero intento trabajarla todo lo que puedo y poco a poco voy obteniendo resultados. \r\nA veces el día a día hace que no puedas dedicarte mucho a innovar en ideas nuevas. Pero intento hacerlo.'),
(3909, 437, 6, 'B', ''),
(3910, 443, 12, 'B', 'En esta competencia hay varios puntos:\r\n*** Intento mantener el equipo unido. Como mínimo laboralmente. Personalmente es más difícil porque somos muy diferentes.\r\n*** Me considero una persona eficaz, aunque mi talón de Aquiles es el \"Delegar\". Muchas veces, por falta de confianza no delego. Y sé que es algo que va en contra mío, pero los errores reiterados o la falta de rapidez, hace que a veces prefiera hacer las cosas yo. \r\n*** Superviso hasta donde puedo.. A veces es imposible estar encima de todo el trabajo de mis colaboradores. Aunque intento poner sistemas de control. '),
(3911, 443, 13, 'A', 'En la pregunta 1 del Grado A he puesto un No Aplica ya que creo que no está dentro de mi trabajo el reunirme personalmente con los clientes.\r\nEl resto de preguntas he puesto un SI ya que mi departamento está muy orientado al cliente y es vital hacer las cosas bien ante él. Y creo que se hacen bastante bien o como mínimo se ponen todos los esfuerzos en ello. '),
(3912, 443, 14, 'C', 'Grado A. He puesto en todos un NO ya que son afirmaciones muy rotundas. Quizás en el punto 2, cuando dice que su discurso verbal y su comportamiento SIEMPRE proyectan fiabilidad... yo no diría siempre. Como he comentado en alguna otra competencia a veces tengo problemas de seguridad y eso influye en mi manera de proyectar mis explicaciones o ponencias en algún caso. \r\nGrado B. He puesto a todo que NO. Me pasa un poco con el Grado A. Veo afirmaciones muy claras. En todas pondría \" A VECES\" ... o \"DEPENDE\".. \r\nGrado C. Este grado lo veo más factible para mí. '),
(3913, 443, 15, 'B', 'Grado A. He puesto 2 NO ya que, aunque el trabajo sale (casi) siempre, a veces me pongo más nerviosa de lo que me gustaría y me da miedo transmitirlo a mis compañeras.\r\nGrado B. El NO de la afirmación 2 es un poco relacionado con los NO del Grado A\r\n\r\n'),
(3914, 443, 16, 'A', 'Creo que sé priorizar bien y eso hace que me organice según prioridades.\r\n'),
(3915, 443, 17, 'B', 'Reconozco que una de las cosas que más me cuesta (a parte de delegar) es gestionar a personas... y por consiguiente gestionar según qué conflictos en mi equipo, de ahí mi NO en el Grado A - 1'),
(3916, 443, 18, 'C', 'Gran parte de estos puntos creo que no me aplican. Ya que son a un nivel superior del mío'),
(3917, 443, 19, 'A', 'Mi trabajo, siempre que esté a mi alcance, va orientado a resultados.'),
(3918, 344, 1, 'B', 'En algunos casos Jordi evita el cambio o no es claro sobre él. Por ejemplo NAS PL. Inicialmente lo ve correcto y hasta lo propone, y después le ve las complicaciones. Quizás un análisis previo completo ayudaría a mitigar estas situaciones.'),
(3919, 344, 2, 'B', 'Como mejora, en algún caso con la experiencia que tiene debería no tener la dependencia de otros compañeros de area. Creo que Jordi sería totalmente capaz de solucionar alguna incidencia sin el \"comodín de la llamada\"'),
(3920, 407, 1, 'B', 'No pone objeciones en cambios pero si cuestiona si ve falta de sentido en ellos. \r\nAunque siempre trata de cumplir con ellos\r\nLos N/A son preguntas que no entrarían dentro de su área de trabajo. '),
(3921, 176, 1, '', ''),
(3922, 425, 1, 'B', 'Dualidad en el tema gestión del cambio. En algún caso es visto por áreas usuarias como resistente al cambio. Y en cambio en muchas ocasiones es el promotor del cambio. \r\nDiscrepancia punto C.1, considero que en muchos casos no se pone en el lugar del otro.\r\n'),
(3923, 425, 2, 'A', ''),
(3924, 425, 3, 'B', 'En general en sistemas tenemos una falta en la comunicación. Deberíamos ser en muchos casos mas divulgadores e informar más proactivamente de errores y acciones que realizamos ya se por vía mail o news.\r\nDiscrepancia puntos en los puntos C1. Si que es cierto que en muchos casos proactivamente informa, pero deberíamos, no solo responsabilidad de Jaume, periodificar y celebrar reuniones transversales agiles donde esa información fluya transversalmente.\r\nEn muchos casos Jaume al querer ser muy preciso, hace que sus exposiciones sean muy largas y detalladas. En estas reuniones deberíamos ser muy sintéticos.'),
(3925, 344, 3, 'B', 'Por comentarios y reuniones con usuarios debemos intensificar más el uso de mails para informar de informar de incidencias al usuario. También usar la plataforma news o intranet para aumentar el conocimiento de los usuarios en determinados temas. '),
(3926, 425, 4, 'A', ''),
(3927, 344, 4, 'B', 'En algunos casos, cada vez menos, excesiva dependencia de algún compañero de departamento.\r\nHe cambiado punto 10 y 11.\r\n'),
(3928, 425, 7, 'A', 'Creo que en estos momentos no solo en el caso de Jaume se está produciendo unos cambios muy importantes tanto en el negocio como en la dirección de Airpharm, esto está afectando directamente al dia a dia, y la toma de decisiones se ha complicado en estos últimos tiempos.'),
(3929, 344, 7, 'A', 'Un mayor conocimiento de la visión de negocio y prioridades de la compañía ayudaría a optimizar y priorizar correctamente la dedicación a la compañía.'),
(3930, 344, 8, 'B', 'En mejora desde la última vez que lo hablamos. Pero hay aún mucho margen de mejora en la confianza en uno mismo y no tener depencias de terceros del departamento. \r\n'),
(3931, 425, 8, 'B', 'Discrepancia punto B.2, creo que justamente una de sus mayores virtudes, el tener una visión global y analítica, hace que en algún caso retarde la implementación de alguna solución por intentar ser exhaustivo en el análisis y posibles implicaciones. Difícil balanceo.\r\nDiscrepancia punto B.4, en la mayoría de casos su opinión es referencia absoluta. Pero cuando tiene dudas, cosa normal, imposible saberlo todo, puede llegar a dar la percepción al usuario que está poniendo excusas a la implementación de alguna solución. Vamos que sería más fácil decir no lo sé, lo estudiamos.'),
(3932, 344, 9, 'B', 'En algún caso falta analizar mejor las consecuencias. NAS pl.'),
(3933, 425, 9, 'A', ''),
(3934, 425, 10, 'B', 'Discrepancia C.2. Creo que Jaume, en muchos casos en que no está de acuerdo no lo expresa verbalmente.'),
(3935, 425, 11, 'A', 'Uno de los puntos fuertes de Jaume, es la innovación y buscar nuevas soluciones. Lo único que ha veces lo frena es en algunos casos \"la parálisis por análisis\". \r\nDiscrepancia B.3, le faltaría crear los cauces. Crea demasiada distancia entre el y sus compañeros. Le tiene una mezcla de miedo y respeto. Y Jaume lo sabe, y creo que \"abusa\".'),
(3936, 425, 13, 'A', 'No solo es un problema suyo, en estos últimos tiempos se respira en ciertas áreas un cierto nerviosismo. Y sistemas recibe.\r\nDiscrepancia A.1: cliente referido a cliente interno.'),
(3937, 425, 14, 'B', 'Al querer ser muy preciso con el interlocutor, a veces, no adapta su argumentación. Necesita sintetizar y bajar el nivel según a quien se dirija.'),
(3938, 425, 15, 'A', ''),
(3939, 425, 16, 'B', 'Una mayor visibilidad de las prioridades del negocio le facilitaría esta tarea.'),
(3940, 425, 17, 'B', 'Algunos usuarios o compañeros de departamento tienen una percepción de que es dificil trabajar con equipo con Jaume. Debido basicamente a su busqueda de la excelencia, exceso de atención al detalle, y explicaciones no suficientemente sintetizadas.'),
(3941, 425, 18, 'A', 'Nos falta ver y a veces transmitir desde dirección las prioridades del negocio y los puntos claves. Se deberían dar mini divulgaciones por área explicando sus principales tareas, y desde dirección mostrar mas claramente el camino a seguir.'),
(3942, 425, 19, 'B', 'En muchos casos esa búsqueda de la mejora por encima de los estándares provoca un cierto \"parálisis por análisis\". \r\nEl punto A.1 discrepancia, una persona del equipo está en muchos casos toma el rol de \"su equipo\", debería gestionarlo en proyectos determinados así. El punto C.1 discrepancia, no por falta de voluntad suya, si no porque de \"dirección\" no fluye claramente las prioridades.'),
