(3946, 438, 4, 'B', 'GRADO A 1 - Sí la decisión que he tomado no es la del resto del equipo, pero estoy segura de que la que yo he tomado es la correcta, haré lo necesario para que entiendan mi decisión. '),
(3947, 438, 5, 'A', 'En esta competencia, respecto al año 2015 me siento con más seguridad con todo lo que tiene referencia con mi colaborador.'),
