(3956, 438, 14, 'B', 'GRADO A 2  - Intento ser lo más fiable posible, pero eso no implica que los demás siempre hagan lo que yo propongo .'),
(3957, 438, 15, 'B', 'GRADO C 4 - Las situaciones de estrés y volumen de exigencia han incrementado en los últimos años, y hace que en ocasiones por querer tenerlo todo controlado, sin darte cuenta se descontrola, pero siempre se soluciona. '),
