(3961, 400, 1, 'B', 'Una de las actitudes más potentes de Toni es su orientación al cliente, en su caso mayoritariamente interno. Y con la intención de dar un servicio rápido a los usuarios puede implementar en alguna caso una solución sin un análisis más exhaustivo.'),
(3962, 400, 2, 'B', 'Absolutamente volcado en su area. '),
(3963, 400, 3, 'B', 'Por comentarios y reuniones con usuarios debemos intensificar más el uso de mails para informar de incidencias al usuario. También usar la plataforma news o intranet para aumentar el conocimiento de los usuarios en determinados temas. '),
(3964, 400, 4, 'B', 'Es extremadamente rápido delante de incidencias o peticiones de usuario. Esto tal como se comenta en el punto \"Flexibilidad y Gestión del cambio\" puede provocar soluciones parciales. Gran mejora en darle autonomía al usuario para que se resuelvan \"incidencias\" del día a día.'),
(3965, 400, 7, 'A', 'Un mayor conocimiento de la visión de negocio y prioridades de la compañía ayudaría a optimizar y priorizar correctamente la dedicación.'),
(3966, 400, 8, 'A', 'Creo que en el día a día y su relación con los usuarios es excelente. '),
