(3969, 344, 11, 'B', 'Margen de mejora. En tareas de I+D el resultado no es suficiente. Por ejemplo ticketing nuevo, no solo ver productos, si no que una vez elegido uno, instalarlo probarlo, etc... Mayor profundidad de investigación y pruebas en algunos casos. \r\n'),
(3970, 344, 13, 'A', ''),
(3971, 344, 14, 'B', 'En muchos casos no usa su capacidad de persuasión. Margen de mejora. '),
(3972, 344, 15, 'B', 'En alguna circunstancia, pocas, salta y la presión del momento le puede. Y otras, quizás lo peor para Jordi, es que se lo queda dentro con el posible consecuencia negativa para él. '),
(3973, 344, 16, 'B', 'Una mejor visión del negocio y disponer de una prioridades más claras le permitirán focalizar más correctamente los esfuerzos. '),
