(3976, 344, 18, 'C', 'Nos falta ver y a veces transmitir desde dirección las prioridades del negocio y los puntos claves. Se deberían dar mini divulgaciones por área explicando sus principales tareas, y desde dirección mostrar mas claramente el camino a seguir.'),
(3977, 437, 8, 'B', 'Enfoques que involucren riesgos siempre consensuado con superior al igual que actuar fuera del nivel de consulta para el cumplimiento de resultados'),
(3978, 437, 9, 'B', ''),
(3979, 344, 19, 'B', 'Debido al punto anterior \"Visión del negocio\" a veces la orientación al resultado puede ser equivocado.'),
