(3986, 368, 1, 'B', 'En la función actual de implantación de procesos clave para la compañía sería clave que LLuis tomara mas protagonismo y fuera el \"evangelizador\" . En relación a la gestión del cambio, creo que sería importante que LLuis participara en sesiones de \"refuerzo\" de las operativas actuales implantadas en departamentos que actualmente usan el bpms más como funcionarios que como herramienta de mejora'),
