(3999, 368, 4, 'B', 'Muy compleja una autonomía completa, al estar implicado en procesos muy transversales necesita apoyarse en el equipo IT.\r\nEn desarrollos en áreas en concreto Lluís es totalmente autónomo.'),
(4000, 368, 7, 'B', 'Comentado que es necesario por parte de dirección especificar más claramente las lineas maestras y prioritarias a seguir. Todo con evitar la nebulosa de que todo es critico.'),
(4001, 368, 8, 'B', 'En ciertas situaciones LLuis se muestra tenso en algunas reuniones de usuario o a posterior. Y quizás en algún momento abusa del modo \"enfadado\" o disgustado'),
(4012, 368, 9, 'A', ''),
(4013, 368, 10, 'A', 'Quizás el punto 4 a veces le provoca situaciones incómodas. Pero sin duda es un referente en el departamento en cuanto a templar los ánimos. '),
(4014, 368, 11, 'B', 'Mayor autonomía en la busqueda de un posible substituto para el bpms actual.\r\nHe cambiado punto 12'),
(4002, 400, 9, 'B', 'Creo que en general es muy resolutivo. Pero un aspecto de mejora vendría de propuestas proactivas en el uso de la herramienta o en algún caso del proceso. Sería conveniente ser más autocritico con lo que ya está implementado y buscar mejoras. '),
(4003, 400, 10, 'B', 'Creo que en muchas ocasiones limita su opinión y no la expresa. '),
(4004, 400, 11, 'B', 'Creo que tiene capacidad de sobras para proponer nuevas iniciativas tanto dentro como fuera de su ámbito. '),
(4005, 400, 13, 'A', ''),
