(4008, 400, 16, 'B', 'Una mejor visión del negocio y disponer de una prioridades más claras le permitirán focalizar más correctamente los esfuerzos. '),
(4009, 400, 17, 'A', ''),
(4010, 400, 18, 'C', 'Nos falta ver y a veces transmitir desde dirección las prioridades del negocio y los puntos claves. Se deberían dar mini divulgaciones por área explicando sus principales tareas, y desde dirección mostrar mas claramente el camino a seguir.'),
(4011, 400, 19, 'B', 'Debido al punto anterior \"Visión del negocio\" a veces la orientación al resultado puede ser equivocado.'),
(4015, 368, 13, 'B', 'Muy buena orientación al cliente, pero para buscar la excelencia intentar ser proactivo con las áreas que usan el sistema sin sacarle todo el potencial. Vamos, ir a buscarse problemas :-)'),
(4016, 368, 14, 'B', 'Solo en algunos momentos, faltaría más persuasión y darle un par de vueltas para convencer al usuario. En algún caso la percepción del usuario es de que Lluís se muestra inflexible. '),
(4017, 368, 15, 'B', 'En pocas ocasiones cuando aparece algún error se muestra muy \"rondinaire\".'),
