(4032, 407, 2, 'B', 'ARLETTE\r\n1. No doy por hecho que tenga que ir ya que se realizan promociones diversas dirigidas a diferentes niveles y puestos\r\n3. Aplico los pasados y los aprendidos en el trabajo actual\r\n4. Si, aunque siempre se aprende, ya que no se puede saber todo\r\n10.No. si es algo muy preciso y complejo.,\r\n11. Intento aplicar mis conocimientos aunque no creo que agregue valor a los resultados.\r\n12. A base de formación\r\n\r\nNEUS\r\nEstoy de acuerdo en todos los puntos menos en el 11. Todo nuestro trabajo desde el del director general hasta la señora de la limpieza, agrega valor a los resultados de la Compañía\r\n12. Acordamos proponer, dentro de la situación actual de la empresa, alguna formación en Excel y Power point '),
(4033, 368, 16, 'A', 'Una mayor visibilidad de las prioridades del negocio le facilitaría esta tarea.'),
(4034, 368, 17, 'A', ''),
(4035, 407, 3, 'B', 'ARLETTE\r\n2. Siempre presto atención a las formas.\r\n3. Interlocutores muy superiores, lo hago de manera más profesional\r\n8. la mayoría de veces necesito apoyo\r\n\r\nNEUS\r\nLa comunicación de Arlette es fluida, aunque a veces su falta de experiencia y su timidez hacen que le cueste un poco, por este motivo ella se puso una A pero hemos puesto finalmente una B ya que es un punto a mejorar.\r\nNo tiene problemas en pedir ayuda siempre que lo necesita. \r\n'),
(4036, 357, 7, 'A', ''),
