(4041, 407, 4, 'B', 'ARLETTE\r\nTomo decisiones hasta cierto punto\r\n1. Es un NO en caso que no sea una función difícil o importante.\r\n2. Lo mismo que el punto 1\r\n3. Idem punto 1\r\n\r\nNEUS\r\nEn el campo que trabaja Arlette creo que tiene bastante autonomía aunque sí es cierto que en muchas ocasiones me pide opinión\r\n\r\nYo creo que la experiencia y los años hace que uno pueda ser más autómata y pueda tomar más decisiones. Además aprende rápido y retiene conceptos.'),
(4042, 335, 1, 'A', 'ESPE\r\nSe considera una persona abierta al cambio. No la más ágil en implantar novedades pero sí abierta al diálogo'),
(4043, 407, 7, 'B', 'Grado C. 2. Debido a que pos las mañanas voy a la universidad, a veces me retraso en mi horario, pero lo recupero sin problemas\r\nGrado A. 9. Entre todas nos complementamos. \r\nGrado A. 11. Intento alcanzar los objetivos que me proponen. Aunque no siempre es posible. \r\n'),
