(4051, 368, 18, 'C', 'Nos falta ver y a veces transmitir desde dirección las prioridades del negocio y los puntos claves. Se deberían dar mini divulgaciones por área explicando sus principales tareas, y desde dirección mostrar mas claramente el camino a seguir.'),
