(4053, 407, 8, 'C', 'Grado C. 4 --> Se, sólo hasta que cojo un poco de práctica\r\nGrado B. 8 --> Necesito corroborar, pero no creo que signifique una demora, sino todo lo contrario\r\nGrado A. 12 --> Siempre consultando'),
