(4055, 407, 10, 'C', 'ARLETTE\r\nGrado C. 2 --> Intento no prejuzgar del todo, teniendo en cuenta que hay varias versiones\r\nGrado B. 5 --> No sólo en el ámbito laboral\r\nGrado A. 10 --> Siempre que sean justificables. \r\nGrado A. 11 --> No velo por el buen clima pero tampoco malmeto.\r\n\r\nNEUS\r\nHablamos de la necesidad de trabajar alguno de estos puntos como por ejemplo el del Grado C. 2\r\n'),
(4056, 407, 11, 'C', 'ARLETTE\r\nGrado C. 1 --> Al trabajar con información dada me limita a resolver algún problema\r\nGrado C. 3 --> No conscientemente\r\nGrado B. 5 --> Suelen ser obstáculos \"leves\"\r\nGrado B. 7 --> Siempre consultando, a menos que esté segura de algo.\r\n\r\nNEUS\r\nLe planteo el intentar ser un poco más proactiva y no acomodarse en la rutina. '),
(4057, 407, 13, 'B', 'ARLETTE\r\nGrado C. 3 --> La respuesta adecuada\r\nGrado B. 6 --> Siempre que pueda y esté informada\r\nGrado B. 7 --> Siempre que pueda y esté informada\r\nGrado A. 9 --> Cuando es necesario\r\n\r\nNEUS\r\nEstamos en un departamento clave en la relación con nuestros clientes. Creo que es necesario orientar nuestro trabajo al cliente. Arlette no tiene mucho trato con ellos pero hay que trabajarlo. \r\n\r\n'),
(4058, 407, 14, 'C', 'ARLLETE\r\nGrado A. 9 --> No soy hábil argumentando ni contra-argumentando, pero eso no me impide tener una escucha activa\r\nGrado A. 11 --> No, siempre respetando las ideas de los demás.\r\n\r\nNEUS\r\nConsidero que está competencia es una C +. Ya que Arlette es una persona que por ejemplo se adapta fácilmente a nuevas situaciones. '),
(4059, 407, 15, 'B', 'ARLETTE\r\nGrado C. 2 --> Intento entregar todo lo que me piden, aunque haya algún retraso\r\nGrado C. 4 --> Rara vez\r\nGrado B. 7 --> No suelen ser problemas muy complicados\r\nGrado A. 10 --> Las situaciones tensas son por volumen de trabajo, no por superiores o por compañeros. \r\nNEUS\r\nCreo que muchos NOes de esta Competencia son \"positivos\" por lo que es claramente una B'),
(4060, 407, 16, 'B', 'ARLETTE\r\nGrado B. 5 --> Priorizo si la situación lo requiere, pero el resultado es el mismo'),
(4061, 467, 8, 'C', 'Pregunta 2, 3, 4\r\nPregunta 9, 11 y 12\r\nVamos a trabajar la confianza'),
