(4088, 335, 2, 'B', 'ESPE\r\nMe gusta aprender y compartir información útil para el desempeño de mis funciones. No reservo nada\r\n\r\nNEUS\r\nLlegamos al acuerdo de ver si puede hacer formación de Excel y Power Point'),
(4089, 335, 3, 'A', 'ESPE\r\nNo me considero problemática a la hora de encajar en grupos de trabajo. Participo de la comunicación en función de las necesidades'),
(4090, 335, 4, 'B', 'ESPE\r\nLa toma de decisiones está muy poco presente en mi día a día laboral. Mis tareas son rutinarias\r\n\r\nGrado C. 2 --> Solo en ocasiones \r\nGrado A. 11 --> No suelo encontrarme con esta casuística en mi día a día\r\nGrado A. 12 --> Habitualmente no. '),
(4091, 335, 7, 'B', 'ESPE\r\nSoy consciente de mi participación en un equipo con el que me siento comprometida. No estoy interesada en individualidades\r\n\r\nGrado A. 12 --> Si me mantengo motivada pero no motivo a mis compañeros si no los veo receptivos por no entrar en conflicto. '),
(4092, 335, 8, 'B', 'ESPE\r\nMe siento segura en mis tareas habituales de trabajo. Otras como presentaciones en público no me resultan cómodas aunque sí me motivan a la hora de mejorar en mi autoafirmación. \r\n\r\nGrado C. 2 --> En alguna ocasión esporádica Sí.\r\nGrado C. 3 --> No me propongo voluntaria aunque no los vea con gran dificultad\r\nGrado C. 4 --> La zona de confort siempre es donde me siento más cómoda. \r\nGrado B. 6 --> Ante nuevas tareas no dudo en consultar\r\nGrado B. 8 --> Si lo considero de importancia y sí tengo dudas lo corroboro. \r\nGrado A. 9 --> No me considero una persona de gran persuasión\r\nGrado A. 10 --> En el área laboral no me muestro firme e intransigente\r\n\r\n'),
(4093, 335, 9, 'C', 'ESPE\r\nA nivel laboral no preciso de gran capacidad de análisis por desempeñar una labor muy repetitiva. Sin embargo analizo cuando es preciso\r\n\r\nGrado C. 2 --> En ocasiones en que existen datos que no domino\r\nGrado A. 9 --> Diría que estoy atenta pero en ocasiones tengo errores. \r\n\r\nNEUS\r\nMe comprometo a intentar ayudarla a poner controles para sus problemas en esta competencia'),
(4094, 335, 10, 'B', 'ESPE\r\nMe considero empático y poco amiga de confrontación personal. Si no llego a consenso no me empeño en debates inútiles\r\n\r\nGrado A. 11 --> Velo por el buen clima pero no intento estar atenta. En ocasiones lo creo contraproducente.\r\nGrado A. 12 --> Solo para intentar rebajar tensión o para dar apoyo. '),
(4095, 424, 11, 'B', ''),
(4096, 424, 13, 'B', ''),
(4097, 335, 11, 'B', 'ESPE\r\nNo me considero persona de gran iniciativa, y no lo considero preciso a nivel laboral en mi actual puesto. Me siento cómoda siguiendo las normas. \r\n\r\nGrado B. 7 --> Siempre consulto y consenso con mi superior'),
(4098, 335, 13, 'A', 'ESPE\r\nSoy consciente de que una empresa vive de sus clientes, además, mi puesto está especialmente ligado a éstos, por lo que la orientación al cliente la siento como necesaria'),
(4099, 335, 14, 'B', 'ESPE\r\nNo considero unas herramientas imprescindibles para desempeñar mis tareas. Me considero persona abierta al diálogo y poco amiga del conflicto.\r\nNo me siento cómoda imponiendo criterios.\r\n\r\nGrado C. 1 --> No me cuesta cerrar acuerdos, pero no por imposición.. suelo ceder\r\nGrado C. 2 --> No dedico gran esfuerzo a imponer mi criterio si no es mayoritario.\r\nGrado B. 7 --> no siempre\r\nGrado A. 11 --> NO siempre'),
(4100, 335, 15, 'B', 'ESPE\r\nEn ocasiones la presión es inevitable, no por ello me siento cómoda pero acepto esa realidad. Mi estrategia es aportar más horas a aquellas tareas no urgentes que han sido aplazadas durante la jornada. \r\n\r\nGrado C. 4 --> NO pero necesito dedicar más tiempo y reorganizarme. \r\nGrado A. 11 --> En la mayoría de ocasiones'),
(4101, 335, 16, 'B', 'ESPE\r\nPlanifico mis tareas de mayor a menor urgencia y posibilidad de conclusión. No necesito habitualmente planificar el trabajo de otros.\r\n\r\nGrado C. 2 --> Es habitual intercalar tareas\r\nGrado C. 3 --> Lo más pesado y menos prioritario suele quedar para el final. \r\n\r\nNEUS\r\nEsta competencia hay que mejorarla también. Ya hemos comentado que hay que trabajarla '),
(4102, 335, 17, 'A', 'ESPE\r\nMe siento cómoda trabajando en equipo. El mío actualmente es reducido pero considero que estamos bien acopladas\r\n\r\nGrado B. 6 --> En ocasiones'),
