(4338, 441, 11, 'A', 'PC: avanzado notablemente. Faltaría el A1 que le falta algo de recorrido.'),
(4339, 441, 12, 'B', 'PC: Situación practicamente igual al año pasado. Aunque esta trabajando en ello.'),
(4340, 441, 13, 'A', 'PC: Avanzado respecto al año pasado. Mayor involucración. A2 y A4 falta recorrido.'),
(4341, 441, 14, 'B', 'PC: tiene que seguir trabajando su discurso verbal, algún colaborador no la acepta como lider y le esta siendo complicado persuadir y negociar. '),
(4342, 441, 15, 'A', 'PC : es resistente sin lugar a dudas a la presión, a mejorado mucho en este competencia'),
(4343, 441, 16, 'B', 'PC: la situación a cambiado y la entrada de muchos clientes ha complicado la situación respecto a organización.\r\nEStoy dando soporte en esta competencia.'),
(4344, 441, 17, 'B', 'PC: tenemos que trabajar conjuntamente esta competencia. La circunstancia del traslado lo hace necesario, así como la actitud en general del equipo.'),
(4345, 441, 18, 'B', 'PC: ha mejorado sensiblemente. Tiene recorrido.'),
(4346, 441, 19, 'B', 'PC: mejorado sensiblemente, queda recorrido.'),
(4349, 448, 3, 'A', 'A4: Aquí sigo diciendo que debido a mi \"temperamento fuerte\" ante situaciones criticas debo de tener mas control (creo haber mejorado mucho).\r\n'),
(4350, 448, 4, 'B', ''),
(4351, 448, 5, 'A', 'A1: Si, pero me aseguro mucho antes de darles el trabajo.'),
(4352, 448, 6, 'B', 'A1: Planteo objetivos de desarrollo pero debo de trabajar mas los planes para que los colaboradores  desarrollen mejor más competencias.\r\nB2: Con Manolo cuando lo requiere.\r\nC2: Puntualizar que intento estar actualizada en mis conocimientos pero sin acudir a seminarios'),
(4353, 448, 7, 'A', 'Mi compromiso y dedicación a la Empresa es del 100% tanto en responsabilidad ,horarios, objetivos,etc.\r\n'),
(4354, 448, 8, 'B', 'A3: A veces si, pero no siempre.\r\nA2: A veces si, pero no siempre\r\n'),
(4355, 448, 9, 'B', 'A2: Puntualizar que transmito a otros colaboradores cuando resuelvo algún problema  de manera que me entiendan pero la mayoría de las veces no son problemas\r\ncomplejos.'),
(4356, 448, 10, 'A', 'B2: No estoy atento a que no se generen, si eso ocurre intento poner \"paz\".\r\n'),
(4357, 411, 1, 'B', 'No se como eliminar barreras internas, de personas que no conocen el funcionamiento de una empresa, intento buscar aliados, que los tengo, pero cambiar algo de los históricos es misión imposible.'),
(4358, 411, 2, 'B', 'De lo mío, Operaciones Farma, se mas que nadie, el problema es que no debo saber transmitirlo o no están preparados para entenderme'),
(4359, 411, 3, 'B', 'No modulo información\r\nNo me considero responsable como interlocutor a todos los niveles, para abajo me es mas fácil que para los lados o para arriba\r\nNo dedico tiempo a conocer necesidades. Sigo igual que 2015'),
(4360, 411, 4, 'A', 'Aunque analizo muy poco, raras veces me equivoco. No tenemos situaciones especialmente difíciles\r\nel MBA me dio seguridad en toma de decisiones'),
(4361, 411, 5, 'A', 'Falta algo de estimulación y motivación, mas allá de Juanmi, Antonio, Ruben y Emilio\r\nDelego mucho mas que hace tres años, aunque hay temas difíciles de delegar, si lo hiciera estaría fuera del negocio, has de saber dar respuesta de todo en cualquier momento'),
(4362, 411, 6, 'B', 'Soy mentor en mi área, Outsourcing\r\nComunico, formo y planifico poco a las personas que no están en mi circulo mas cercano\r\nEs complicado en Airpharm hacer un plan de carrera'),
(4363, 411, 7, 'A', 'El compromiso y dedicación es total.\r\nCreo que soy de las personas mas comprometidas y que mas horas dedica a esta compañía\r\nCiertas actitudes hacen que me desmotive con facilidad'),
(4364, 411, 8, 'A', 'No siempre me es fácil imponer mi criterio, en C.A. basicamente'),
(4365, 448, 11, 'B', 'A1:Si identifico, pero suele ser de mi departamento y  en alguna ocasión pero pocas con otros departamentos.\r\nA3: solo en algunas ocasiones pero no siempre.'),
(4366, 448, 12, 'B', 'A4: Hacia otros departamentos menos.\r\nC4: Normalmente no, solo cuando se trata de tareas nuevas hasta que considero que ya las pueden realizar con autonomía.'),
(4367, 448, 13, 'A', 'A1: comunicación diaria con el cliente para dar información.\r\nCreo que esta competencia es una de las que nunca puede llegar a alcanzar la perfección, pues siempre hay que buscar métodos, herramientas para mejorar cada vez\r\nmás el servicio que le damos al cliente,'),
(4368, 448, 14, 'B', 'B2: Casi siempre.\r\nB4: Casi siempre'),
(4369, 448, 15, 'A', 'B4: Si son muy complejas si.'),
(4370, 448, 16, 'A', 'A3: Cuando hay \"puntas\" de faena suelo yo organizar las tareas y dar prioridades.'),
(4371, 448, 17, 'A', 'He logrado que todos los miembros del equipo incluyéndome yo hagamos todos las mismas tareas (nada fácil de conseguir).\r\nAún seguimos en ello!'),
(4372, 448, 18, 'C', ''),
(4373, 448, 19, 'B', 'B1: no siempre, en alguna ocasión.'),
(4374, 411, 9, 'B', 'El pensamiento analítico llevado a nuestro ámbito aplica a reclamaciones, el resto no requiere de grandes análisis, visto desde mi punto de vista, quizás ahí esta mi error en pensar que trabajo en cosas simples y son mas complejas de lo que parecen'),
(4375, 411, 10, 'C', 'Si algo me falla es la inteligencia emocional y la sensibilidad\r\nhay camino para mejorar '),
(4376, 411, 11, 'A', 'Así como me considero con mucha iniciativa, innovación y mejora continua, cuando veo que el resto no me sigue, soy el primero en abandonar el barco. No estoy aquí para perder el tiempo, ejemplo MC'),
(4377, 411, 12, 'B', 'Sigue faltando estrategia y feeback a algunos miembros del equipo, son muchos para tenerlos a todos contentos '),
(4378, 411, 13, 'B', 'No me relación con el cliente para detectar necesidades, es un cliente particular\r\nMe suele buscar él a mi, para nuevos proyectos'),
(4379, 411, 14, 'C', 'Debo mejorar la estrategia en negociacion'),
(4380, 411, 15, 'B', 'Sigo sin creer que transmita tranquilidad en situaciones límite\r\nNo requiero el consejo del jefe, hablo poco con él de mi trabajo'),
(4381, 411, 16, 'C', 'Me falta mucho de gestión de proyectos, a mi y mas de uno\r\nAirpharm vive del día a día, nos cuesta mucho planificar a largo'),
(4382, 411, 17, 'B', 'Creo que soy un buen líder y participo en equipos multidepartamentales\r\nMe falta quizás investigar que mas puede aportar cada miembro del equipo'),
(4383, 411, 18, 'B', 'No analizo al mercado tanto, como para estar al día de los cambios\r\nCreo que no aplica a Airpharm, tenemos una posición privilegiada de first mover y a un cliente cautivo de nuestros servicios exclusivos e integrales'),
(4384, 411, 19, 'B', 'Me considero muy orientado a resultados, pero la definición de objetivos 2019 no esta hecho por mi, así que hay una involución respecto a otros años\r\nMe sigue faltando gestión de proyectos'),
