(4387, 410, 3, 'B', 'Grado A-2- Elaboro y transmito información. El inconveniente es la regularidad en todo.\r\nMantengo a nivel de Mandos regularidad, con el equipo sin embargo no con una frecuencia regular y determinada. Todo provocado por la situación de volumen de trabajo.\r\nB-3- Intento adaptarme al lenguaje en cada momento. Pienso voy mejorando en cuanto a precisión y directa al grano.\r\nC-2 Igual que A2 es un problema de regularidad. Tengo calendarios de reuniones fijados, el problema es poder cumplirlas.'),
