(4412, 230, 10, 'B', 'c2-avanzado en cordialidad, aunque sigue necesitando mejorar el tema de los perjuicios.\r\nb1-b3-ha avanzado en escucha actia.\r\na3 no abandona facilmente, cierto grado de terquedad y de ideas preconcebidas.Carencias.\r\na2.Aunque le escuchan,esta luchando y tiene que fortalecer su nueva situación.Tiene que trabajar su liderazgo\r\na1tiene que trabajar más su imparcialidad. A mejorado sensiblemente pasando de grado C al actual b'),
(4413, 230, 11, 'B', 'b3 carencias en fomentar iniciativas.\r\nb1carencias en establecer planes de acción, etc.\r\na1 carencias en detectar e involucrar, posiblemente por falta de tiempo.'),
(4414, 230, 12, 'B', 'Situación practicamente igua. Si actuará más en delegación y confianza hascia los colaboradores podría centrarse más en las mejoras de los proyectos. Las ramas no le dejan ver el bosque.'),
(4415, 230, 13, 'B', 'situación practicamente igual.'),
(4416, 230, 14, 'B', 'c1. A mejorado su escuchga activa. Discurso verbak con ciertos matices (a comentar)\r\nA tiene que seguir trabajando su discurso y su imagen de lider.'),
