(4472, 393, 19, 'A', ''),
(4473, 372, 1, 'B', 'Rosa opina que se adapta bien a los cambios, especialmente si son positivos, sigue instrucciones y las asume rápidamente.\r\n3. Rosa indica que no pone objeciones ante los cambios, pero yo no estoy del todo de acuerdo, yo sí creo que antes averigua que repercusiones tiene para \r\nella cualquier cambio y primero se informa.  \r\n\r\nEn cuanto a flexibilidad, considera que lo es en general, pero también influye la actitud de la otra persona, si lo es.'),
(4474, 274, 1, '', ''),
(4475, 274, 2, '', ''),
(4476, 274, 3, '', ''),
(4477, 274, 4, '', ''),
(4478, 274, 7, '', ''),
