(4481, 274, 10, '', ''),
(4482, 274, 11, '', ''),
(4483, 372, 2, 'A', 'Rosa se considera autodidacta, intentando buscar la solución con las herramientas que están a su alcance, pero no repara en preguntar para aprender o realizar un trabajo.\r\nYo estoy totalmente de acuerdo en este punto, además considero que es una persona curiosa.\r\n\r\nPor ejemplo cuando hay algún problema con un courier intenta indagar hasta al final para ver que ha sucedido, se involucra bastante en buscar una solución al problema  y es resolutiva. Con el tema de selección de proveedores que atañen a recepción, se esfuerza e intenta averiguar la manera de reducir costes con tarifas, servicios,etc. \r\nTiene interés por aprender y hacer cosas nuevas.'),
(4484, 372, 3, 'A', 'Rosa es una persona comunicativa, aunque le cuesta expresarse en algunas ocasiones, da demasiada información no necesaria, le cuesta sintetizar. Opino igual que ella en que tenemos que trabajar más ese punto, a veces para explicar algo entra mucho al detalle. Le falta capacidad para ser más concreta tanto a la hora de comunicarse como de redactar un correo.'),
(4485, 372, 4, 'B', '1. Rosa ha puesto que no, pero yo no estoy de acuerdo. Necesita que se le haga seguimiento y sobre todo que se le reconozca su trabajo.\r\n\r\n2. Ella indica que no pero no es del todo cierto, depende de la situación.\r\n\r\n8. Rosa ha puesto que sí pero con matices, cierto es que realiza primero las prioritarias pero a veces le cuesta un poco diferenciar las prioritarias de las importantes y las mete en el mismo saco\r\n\r\n11. Según Rosa su puesto no requiere un análisis tan profundo a la hora de tomar decisiones. Mi opinión es que dependiendo de la importancia del tema y de su interés a veces puede ser un poco impulsiva \r\n'),
(4486, 372, 7, 'C', 'Rosa considera que se compromete tanto con la compañía como con sus responsabilidades y su trabajo.\r\n\r\nYo creo que puede dar más de sí y necesitamos más compromiso por su parte.'),
(4487, 372, 8, 'B', '1. Yo discrepo. Pienso que en algunas ocasiones si tiene falta de seguridad en sí misma y en algún caso hemos estado en desacuerdo en alguna acción o alguna actitud que ha mostrado. \r\nTambién, a veces le da importancia a cosas que no la tienen e intento hacerle ver que donde ella ve un problema con un cambio de actitud se puede ver de distinto modo. Ejemplo;  si alguien de algún departamento le pide ayuda pero no le gusta como se lo dice, ella lo ve como una orden y se pone a la defensiva, me lo explica y aunque aquí todos nos conocemos y cierto es que algunos compañeros tienen un modo de solicitar cosas con autoridad, le hago ver que se lo tome como que se lo piden porque depositan su confianza en ella, que saben que si ella se ocupa todo va a salir bien seguro.\r\n\r\n5. A veces le cuesta guardar la compostura ante discusiones que la involucran o ataques directos, es impulsiva y en mi opinión le falta un punto de madurez y tiene que trabajarlo más. Cierto es que cuando estás de cara a los demás como en su caso en recepción, a veces no es fácil lidiar con algunos colaboradores, mensajeros, etc y ese punto lo tenemos que trabajar con más mano izquierda.\r\n\r\nElla es consciente que este punto \"Dominio de uno mismo\" no es precisamente uno de sus puntos fuertes y que tiene que mejorarlo.\r\n   '),
(4488, 372, 9, 'B', '1. Por norma general no, precisamente Rosa es de las personas que entran al detalle de las cosas, a la hora de comentar un tema o redactar un correo suele extenderse porque entra demasiado a describir todo lo que piensa en ese momento, pero en según que aspectos como éste, es un punto fuerte porque algunas de sus funciones requiere ser muy minuciosa y atender a los detalles.     '),
(4489, 372, 10, 'B', '1. Yo discrepo un poquito. Por su trabajo lógicamente se tiene que relacionar con todos, pero yo si creo que se relaciona más con los que tiene más afinidad, pero no lo veo como algo negativo quizás porque creo que en parte es lo que hacemos todos, relacionarnos con quien mejor nos sentimos o tenemos más cerca o con quien trabajamos más.\r\n\r\n2. Rosa intenta escuchar y luego actuar, pero a veces por su carácter, se adelanta a los acontecimientos.\r\n\r\n8. Rosa comenta que depende del caso o situación. Si ve claramente con su argumento que se va a solucionar el problema, intenta hablar primero. Mi opinión es que no siempre es así, depende del caso y de lo enfadada que esté, creo que este es un punto que debería madurar, aunque también es verdad que lo ha ido limando un poquito. \r\n\r\n\r\n '),
(4490, 372, 11, 'C', 'Rosa tiene iniciativa y es proactiva con su trabajo. Intenta adelantarse a acontecimientos para facilitar el trabajo.\r\n\r\nEn este último año hemos notado un mejora dentro del departamento en cuestiones como buscar la manera de reducir más los costes considerablemente como por ejemplo con el envío de facturas que salían por correos sin ningún tipo de control y gracias al control diario y seguimiento de los envíos a clientes hemos conseguido agrupar las direcciones los costes considerablemente. \r\n\r\nOtro ejemplo claro son las tarifas con los couriers y el seguimiento mediante envíos internos de material de oficina de las peticiones de cada departamento\r\n\r\nDe todos modos hay que trabajar más el compromiso con la compañía, no es una persona lineal, a veces tiene subidas y bajadas en su estado de ánimo que le influyen en su manera de trabajar.  '),
(4491, 372, 13, 'C', '1. Rosa se siente incomoda cuando le imponen uno trabajo que no es de su área. Este tema tenemos que trabajarlo más, la mayoría de veces reacciona  molestándose, no por el hecho de hacer el trabajo en sí si no por las maneras.\r\n\r\n3. Rosa ofrece alternativas que pueden mejorar lo que están pidiendo tanto los clientes externos como internos. Yo tengo que añadir que en la mayoría de ocasiones se ofrece a ayudarte.\r\n\r\n4. Rosa se queja que internamente en muchas ocasiones está desinformada de cuando hay reuniones, cuando salen o entran de la oficina, cuando hay formaciones, vacaciones, etc , tiene que ir averiguando sobre la marcha o llamando al móvil. Este es un tema que yo por mi parte estoy intentando darle solución todas las veces que me es posible, con las formaciones que suelo contratar yo, con los consejos o comités que suelo estar informada, en el caso de las vacaciones solicitando datos a RRHH, pero en el caso de reuniones de departamento no solemos tener este dato. Estamos intentando conseguir que la gente en este caso colabore un poquito, a veces nos olvidamos que la recepción es un parte muy importante de la compañía y la información es fundamental.    '),
(4492, 372, 14, 'B', 'Ella misma se define como una persona que no es buena negociando. Sobretodo le cuesta con personas según ella difíciles de dialogar o que tienen argumentos muy firmes. Mi opinión es que Rosa es una persona fácil de darle la vuelta y convencerla.\r\n\r\n10. Ella se considera persistente en los temas que expone. Estoy de acuerdo a medias, cuando es algo que le atañe personalmente con temas de la empresa sí, indaga se informa bien e intenta negociar para conseguir lo que quiere una y otra vez, pero cuando expone sus peticiones a dirección acaba aflojando y entendiendo las cosas.'),
(4493, 372, 15, 'B', '1. Rosa ha marcado que no pero yo pienso que más que transmitir emociones pesimistas es una persona que transmite mucho su estado de ánimo y eso es un punto a mejorar, porque es la primera imagen que ven nuestras visitas.\r\n\r\n3. Ella misma es consciente de que debe pararse un minuto y centrarse, incluso elaborar una lista con todo lo que tiene pendiente. Opinamos igual, a veces se atabala cuando tiene muchas tareas a la vez. \r\n\r\n12. Rosa se considera una persona predispuesta y positiva, alerta ante posibles influencias ya que por recepción pasan muchas personas, algunos opinan otros critican y ella cree que no se deja llevar. Yo discrepo, creo que Rosa sí es influenciable.'),
(4494, 372, 16, 'B', 'Tiene capacidad para organizar su trabajo, pero le resulta más complicado cuando hay picos de trabajo o muchas interrupciones, llegado a ese punto se agobia un poquito.\r\nA veces le cuesta priorizar con las cosas que son más importantes.\r\n\r\n4. Ella ha puesto que no, pero sí es impulsiva y tenemos que trabajarlo más.'),
(4495, 372, 17, 'B', '1. Rosa se considera una persona que le gusta trabajar en equipo. Le gusta ofrecer ayuda a sus compañeros pero evita trabajar con aquellos que quieren aprovecharse. \r\nEjemplo: a principios de año desde compras enviamos tarifas actualizadas con los diferentes couriers a los departamentos que suelen utilizarlas para los envíos. Hay colaboradores que tienen asumidos que trabajas para ellos y cuando tienen que pasar un precio en vez de buscarlo, en el correo que se les envía detallado, mandan un mail a recepción para que les faciliten el precio, no siendo labor de recepción, además que no piden ayude, lo exigen. La tarea de recepción en todo caso, será preparar el Courier nada más.   '),
(4496, 372, 18, 'B', '2. Rosa comenta que no conoce en profundidad lo que comercializamos y menos aún el sector en general. Coincidimos con ella que  falta un poco de información a nivel general por parte de la compañía hacia los trabajadores, pero también es cierto y así se lo he comentado que desde hace ya un año, la Dirección General nos viene dando unas charlas trimestrales que nos ayuda mejor a entender el funcionamiento de la Compañía y las mejoras que vamos teniendo.\r\n\r\n4. Rosa comenta que en algunos, menos que básicos. Mi opinión es que le falta seguridad en sí misma, todo y que ha ganado algo de confianza en este último tiempo.\r\n'),
(4497, 372, 19, 'C', '2.Punto a mejorar, en general si cumple pero hemos puesto un NO porque hay veces que hay que recordarle o hacerle ver cositas que no se da cuenta  que hay que tener presente en la recepción. Ejemplo tema visitas, no desatender la recepción si sabe que hay reunión e irse más tarde a desayunar. \r\n  \r\n7. No los revisa con regularidad pero los tienen presente y lo revisa cuando toca.'),
(4498, 450, 1, 'B', 'Grado C 2- Sí pero con matices, siento atracción por asumir funciones nuevas pero a veces no me siento motiva por esas tareas cuando ve claramente que me la traspasan porque es algo que otro departamento no quiere hacer. '),
(4499, 450, 2, 'B', 'Grado A. 1. No siempre comparto todo el conocimiento con mis compañeros de Dpto., no lo veo necesario. \r\nGrado B. 1. No todo lo que debiera, necesita reciclarse y hacer algún que otro curso. A veces lo impide la falta de tiempo. \r\n                4. Si, aunque no siempre lo consigo. \r\nGrado C. 1. Creo que no siempre se tienen los conocimientos necesario, tengo que mejorar más '),
(4500, 450, 3, 'B', 'Grado A. 3. No estoy segura de conseguirlo, creo que tengo que mejorar mucho este punto. JC. cree que lo hago bien.  \r\n\r\n                4. Creo que los conflictos, aunque no suelo tener, los gestiono de manera positiva pero debo mejorar mucho mi discurso verbal no me considero una buena\r\n                    comunicadora, me gustaría aprender a concretar más.\r\n\r\nGrado C. 1. Punto a mejorar, no siempre proporciono de manera puntual los datos. Quizás me falta organizarme mejor pero en muchas ocasiones es por falta de tiempo o por no poderme reunir con mi superior. JC añade que a veces al no estar en la oficina durante este último periodo y en otras ocasiones por motivos personales que le han impedido estar hace que los plazos no sean los que deberían.  \r\n               \r\n                  2. Precisa no tanta como me gustaría, disponible siempre. Jc está de acuerdo.                           \r\n\r\n2. Aunque he contesto afirmativamente, me falta precisión en las ideas, punto a mejorar.\r\n\r\n3. Creo que debo mejorar el orden de mis datos. '),
(4501, 450, 4, 'B', 'Grado B. 2. Lo intento y suelo analizarlo bastante aunque a veces peco de impulsiva\r\n               4. Jc comenta que soy resolutiva ante situaciones cuando él no está y tengo que tomar una decisión'),
(4502, 450, 5, 'B', 'Grado A. 3. No lo veo necesario, en mi caso con Rosa ella misma fomenta el aprendizaje y la formación. JC cree que debería hacer más seguimiento con Rosa de que esto es así.\r\nGrado C. 1. He puesto que no, porque yo confío en mi para tomar una decisión no en los demás, aunque crea que mi compañero tiene habilidades. JC opina que aunque yo opine que ya somos adultos para saber lo que tiene que hacer cada uno, Rosa tiene un puntito de inmadurez y hay que guiarla.    '),
(4503, 450, 6, 'B', 'Grado A. 3. En el puesto de recepción no lo veo necesario.\r\n\r\n                4. He puesto sí, pero quiero explicarlo, me considero un experto en mi área por la experiencia y el tiempo que llevo haciendo mi trabajo aunque siempre aprendo  cosas nuevas y adquiero experiencia, lo de ser un referente dentro de la Organización, no me lo parece. JC, cree que sí, piensa que hago bien mi trabajo y que he mejorado mucho a lo largo de los años y que mis compañeros me ven con buenos ojos.\r\n\r\nGrado C. 2 y 3. He indicado que Sí, pero siempre y cuando el horario me lo permita.\r\n\r\n '),
(4504, 450, 7, 'A', 'Para mí todas son afirmativas, el compromiso y la dedicación son una obligación y una responsabilidad para mí, me debo a esta empresa.\r\nJC está de acuerdo pero quiere añadir lo que me dice continuamente, que \"Sos la mamá de todos, Lolita\"'),
(4505, 450, 8, 'B', 'Grado B. Depende del interlocutor me genera más confianza o menos. JC está totalmente de acuerdo pero cree que soy capaz de obtener lo que me propongo en la mayoría de los casos'),
(4506, 450, 9, 'B', ''),
(4507, 450, 10, 'A', 'Grado A. 4. Creo que sí pero no es un sí contundente, también va a depender un poco de la otra persona, pero creo tener claro los límites. '),
(4508, 450, 11, 'B', 'Grado A. 1. He puesto No porque lo de involucrar a colaboradores de otras áreas no suelo hacerlo, sin autorización de su superior.\r\n\r\nGrado C. 2. Respuestas sensatas sí, eficaces lo intento pero si siento la necesidad de hacer consultas muchas veces, soy de las que piensa que tú superior siempre tiene más experiencia y más conocimientos. JC. opina que puedo hacerlo perfectamente bien pero a veces me falta un punto de seguridad.'),
(4509, 450, 12, 'A', 'Grado C: 2. Intento llevar un seguimiento adecuado pero creo que puedo mejorarlo.\r\nJC: Lola está completamente comprometida con la compañía, se comunica perfectamente dentro del grupo y promueve que haya buen ambiente dentro del departamento. Creo que se comunica bien en su área y hacia los demás.'),
(4510, 450, 13, 'A', 'JC: En repetidas ocasiones ha demostrado su colaboración y compromiso por satisfacer al cliente externo o a los proveedores.'),
