(4576, 543, 1, 'B', 'B7 y 8- sería favorable considerar salir de lo conocido, de la zona de confort y por motivación propia e iniciativa abrirnos un poco más a la situación departamental cuándo se precisa de colaboración y compañerismo. (épocas de vacaciones o cuando no tengo mucho trabajo en mi mesa)'),
(4577, 543, 2, 'B', 'C3- las nuevas tecnologías requieren de nuevas maneras y nuevas atenciones. Nos vamos adaptando\r\n'),
(4578, 543, 3, 'C', 'C2- las respuestas escuetas pueden resultar frias. \r\nB6.- 7 -8  muy bien ordenado - preciso y correcto- la información es correcta y a tiempo..sólo que podría, si la situación lo requiere, extenderse con algo más de detalle- esto genera confianza al cliente. A9- esto requiere más atención a las necesitades  de los demás.- Atención a las llamadas telefónicas! '),
(4579, 543, 4, 'B', 'C- totalmente autónomo\r\nB8- para evitar situaciones  de estress sería conveniente poner más atención a lo que realmente requiere de inmediatez y no TODO a la vez., para evitar la ansiedad.  '),
(4580, 543, 7, 'B', 'Sientes como propios los objetivos de la organización?  o me limito a hacer mi trabajo justo y necesario?\r\nHay un interés obvio por los objetivos de la organización ya que me afectan directamente.'),
(4581, 571, 1, 'A', 'Creo que en esta competencia he avanzado respecto al año anterior. El entorno de Airpharm está cambiando y es muy necesaria la adaptación a dichos cambios.'),
(4582, 571, 2, 'B', 'B+\r\nEn 2019 me he mantenido actualizado a nivel de conocimientos, si bien en 2020 y ante los cambios que se están produciendo en el mundo de las finananzas, efectuaré un curso de Fintech y Blockchain '),
(4583, 571, 3, 'A', 'Si la información es confidencial, debo regirme por la política de información de loa Dirección General y de los Accionistas.\r\nMe mantengo en la premisa que lo más importante en la comunicación es escuchar lo que no se dice. '),
(4584, 571, 4, 'A', 'Soy capaz de tomar decisiones en Área a la cual pertenezco, si bien cuando estas sean de alto nivel o requieran de confidencialidad, siempre consulto a Dirección General'),
(4585, 571, 5, 'A', 'Continúo en la línea de apoyarme en los 3 Mandos Intermedios del departamento.\r\nSin embargo considero que la responsabilidad no se puede delegar.'),
(4586, 571, 6, 'B', 'B+\r\nRespecto a la 1ª pregunta del Grado A, ya tengo hablado este tema con Dirección General para que a medio plazo empiece a pensar en este tema.\r\nRespecto a la rotación de puesto, en el Área de Finanzas es un poco complicado ya que hay un componente importante de especialización.'),
(4587, 571, 7, 'A', 'Considero que me considero comprometido con la Compañía, con el logro objetivos y su estrategia.\r\nSin participación no hay compromiso'),
(4588, 571, 8, 'A', ''),
(4589, 571, 9, 'A', 'Esta competencia es muy importante para mi puesto de trabajo y considero que la tengo muy interiorizada'),
(4590, 571, 10, 'A', 'Considero importantes las siguientes premisas:\r\n- En el mensaje tan importante es el qué se dice como el cómo se dice. las formas son muy importantes\r\n- No se puede escuchar si se está pensando\r\n- Nadie está en la posesión de la verdad absoluta ya que la realidad es infinita\r\n'),
(4591, 571, 11, 'A', 'Creo que sobre esta competencia, hay algunas variables que no aplican en demasía a mi puesto de trabajo, si bien en lo que compete a mi Área estoy viendo y estudiando aspectos que permitan innovar hacia la innovación en finanzas, conocer el impacto que las nuevas tecnologías tienen ya en la función financiera'),
(4592, 571, 12, 'A', 'Mantengo el mismo criterio que indiqué en el año anterior:\r\nUn líder es mejor cuando la gente apenas sabe que existe. Cuando su trabajo está hecho y el objetivo cumplido.\r\nTambién pienso que es importante saber estar cuando conviene en la cabeza del pelotón y cuando conviene, en la parte trasera del pelotón'),
(4593, 543, 8, 'C', 'Si confio en mi, en mi trabajo y en los demás- no pierdo el control, no me sobrepasa el trabajo ni las fluctuaciones en el trabajo. Se precisa de más auto-dominio y evitar el miedo y la incomodidad al los cambios en el trabajo. Abordar el trabajo con más confianza - el trabajo no puede sobrepasarnos. \r\nSi el trabajo nos desborda, se crea un ambiente incómodo a nivel interno y externo'),
(4594, 543, 9, 'A', 'Trabajo meticuloso y detallista. aunque este trabajo precisa de más apertura y confianza en el \"descontrol\" debido a que está en constante cambio y movimiento'),
(4595, 543, 10, 'C', 'C2- hay una tendencia a una autoproteccion -defensa que nos limita-  pero vamos mejorando. Salir de nuestra área de protección para estar más sensible y atento a lo externo.\r\nB6- normalmente lo procuro, pero en ocasiones se prejuzga de manera negativa\r\nB8? que opinas? realmente no hay problema en hacer las dos cosas. \r\n '),
(4596, 543, 11, 'B', ' qué opinas? hay que darse cuenta en dar apertura a otras posibles respuestas y perspectivas.'),
(4597, 543, 13, 'B', ' -C3- como comentado en ocasiones anteriores- las respuestas al cliente son concisas y claras . \r\nAtención!:-atender a las llamadas de los clientes es imprescindible: vamos a tomar consciencia.'),
(4598, 543, 14, 'B', 'C2- se va  la información clara y concisa para focalizar la duda que tenga el cliente, sin más vueltas. \r\nDegemos generar más capacidad de empatía y ponernos en el lugar del otro.  B7- hay una evolución en buscar siempre la conciliación con los demás. \r\n'),
(4599, 543, 15, 'C', 'C-1-La actitud ante el trabajo, en ocasiones, puede ser negativa- de rechazo ante el trabajo. Se siente un aspecto de rechazo e incomodidad con el trabajo de uno mismo. Debemos responsabilizarnos de - Cómo me siento en mi trabajo y ver si puedo conseguir sentirme cómodo, con ganas El trabajo ocupa la mayor parte de nuestra vida. Según sea esta actitud se crea  un impacto al área de trabajo, a nuestra salud, y en nuestra vida C-2 falta flexibilidad a los cambios. no deben afectarnos.\r\nC4- puede haber una tendencia al bloqueo. A11- A12- qué opinas? debo mantener una actitud positiva y mantener el equilibrio. '),
(4600, 543, 16, 'A', 'muy ordenado y organizado en su trabajo! '),
(4601, 543, 17, 'C', 'C2-B5-B8-A9- se podría ofrecer más  colaboración al equipo: esto nutre a nivel humano al equipo y a nosotros mismos, por lo que afecta positivamente al rendimiento del dpto. \r\nTenemos tendencia a cerrarnos en nuestro espacio, no debemos tener miedo a abrirnos a los demás... ese es un aprendizaje ppal: Amor es preocuparnos por la felicidad del otro.'),
(4602, 543, 18, 'B', 'Esta competencia afecta más al área comercial que no de tráfico'),
(4603, 543, 19, 'B', 'B5- eres autocrítico con tu trabajo? muy exigente con su trabajo.\r\nB- se adelanta al trabajo para que esté todo controlado con tiempo. En ocasiones este exceso de control puede perjudicar debido a que el tipo de trabajo sorprende con continuos cambios. Esto resulta incómodo y nos puede alterar. Se debe suavizar el nivel de exigencia. Trabajo bien hecho y estar abierto a los cambios.\r\n'),
(4604, 525, 1, 'A', 'Persona muy flexible en cuanto a los diferentes interlocutores y situaciones laborales.\r\nEn ocasiones, antepone al otro antes que a sí misma por lo que sus posiciones/ opiniones pueden perder fuerza favoreciendo al interés del otro, que podría estar equivocado. Ayudaría más auto-confianza.'),
(4605, 525, 2, 'A', 'C4- siempre ampliando los conocimientos para crecer en el ámbito profesional. \r\nB5- muy implicada en colaborar con otros departamentos, siempre buscando la armonía que beneficie al conjunto de la cía. B6-7 gran investigadora para los nuevos retos.\r\nA9. Siempre en constante búsqueda de mejorar el servicio- consultas con entidades varias, (Cámara comercio, Ateia, etc...) .. en continuo reciclaje!'),
(4606, 525, 3, 'A', 'C. Máxima y extensiva comunicación de todo movimiento e intención. Recordar que  el interlocutor nos escuchará bien con nuestra  forma sosegada y tranquila de expresarnos. Crea confianza al otro. \r\nB5. en ocasiones, la efusividad es tan elevada, que se puede perder la atención de las palabras exactas del otro.  B6-A9 En ocasiones se precisaría de ser más conciso, más al grano, contundente- pero  en ocasiones  se debe dar un detalle extenso para satisfacer la necesidad del cliente. A10.11.12 - extensa información a todo el dpto. '),
(4607, 525, 4, 'B', 'C1-2-4 Debido a la larga trayectoria profesional y buen trabajo, ya es posible confiar en el trabajo que realizamos . Es bueno experimentar esta confianza. C3-si la situación es delicada y arriesgada- es cauto consultar tantas veces como sea necesario. B8. Especialmente en ocasiones de más volumen, no hay posibilidad de atender Todos los frentes con el misma involucración- es importante priorizar y avanzar. A9-10-11-Aunque precisa de algo de supervisión, es muy hábil a la hora de dar soluciones a los problemas!!!'),
(4608, 525, 7, 'A', 'TOTAL DISPOSICIÓN Y COMPROMISO CON LA EMPRESA, EN TIEMPO Y FORMA. '),
(4609, 525, 8, 'B', 'C3-4. Todo lo contrario, actitud muy abierta y positiva ante los retos. Reconoce que son grandes oportunidades de aprendizaje y mejora tanto a nivel profesional como para el prestigio de la empresa.  B6-7-8- la búsqueda de recursos es constante- para los temas más delicados, se corrobora siempre- no genera demora. A9- Poder confíar un poco más en nuestra capacidades y aptitudes, nos permite ser precisos y convincentes.  A12. Muy enfocada al cumplimiento de resultados y en los objetivos que se esperan.'),
(4610, 525, 9, 'A', 'C3-C4 se analiza el conjunto de la información  para conseguir los mejores resultados.\r\nB8- Hay mucha consciencia en obtener el máximo de información y porque hay veces no se la pueden.  '),
(4611, 525, 10, 'A', 'C- hay una sensibilidad innata que le permite empatizar con compañer@s y clientes. B. Persona muy cordial y afable con todos. Ayuda a generar muy buen clima en el dpto. y a que el trabajo fructifique!'),
(4612, 525, 11, 'A', 'C.4 siempre muy atenta a las nuevas tecnologías, buscando su dominio.  \r\nB- los problemas y buscar soluciones - nos motiva. A- muy buena capacidad de anticipación.'),
(4613, 525, 13, 'A', 'C1- cuánto más complicadas las incidencias, más interés en aprender. C2- trabajo comercial de satisfacción al cliente muy exhaustivo.C3 siempre respuestas extensas, más de lo solicitado para que le quede bine claro.  B-puede anteponer el trabajo  a su tiempo familiar. B7-8: siempre disponible a la ayuda al cliente, haciendo suyas algunas de las tareas propias que le corresponden al cliente.  '),
(4614, 525, 14, 'B', 'C1- se precisa algo más de auto-confianza para persuadir al otro. Más contundencia en sus argumentos - no suplicar al otro, si no dar \"instrucción precisa de lo que se precisa\" (especialmente con los proveedores). C2-A9- en ocasiones los argumentos más concisos y directos, con la información esencial pueden dar un resultado más favorable. no da lugar a la duda. '),
(4615, 525, 15, 'B', 'C3- en momentos de volumen, no siempre es fácil darle prioridad a todo con la misma eficacia. \r\nLa resistencia a la presion le motiva, '),
(4616, 571, 13, 'B', 'Para mi puesto de trabajo, la orientación al cliente externo es importante, pero también lo es el cliente interno (otros Departamentos, Unidades de Negocio, Filiales) como los accionistas'),
(4617, 571, 14, 'A', 'Creo que en una negociación, todas las partes deben estar dispuestas a ceder ya que si uno se mantienen en una posición inflexible, será muy difícil alcanzar acuerdos.\r\nMe considero una persona de consenso, pero reconozco que en ocasiones y motivado por entornos vamos a llamar muy turbulentos, es difícil conseguirlo'),
(4618, 571, 15, 'A', 'Es una competencia muy importante, pero también considero que se pueden tomar medidas para reducir su impacto.\r\nYo intento trabajar mucho la planificación ya que con una buena planificación tienes medio partido ganado.'),
(4619, 571, 16, 'A', 'Competencia muy importante y sobre todo en el Área que me compete.\r\nCon todo el equipo de Administración, intentamos planificar y organizar cada mes todas las tareas que competen a los cierres contables, lo cuales deben ser presentados a una fecha límite, siguiendo los cronogramas establecidos con los Accionistas y Dirección General'),
(4620, 525, 16, 'B', 'B5 -6- ?? todo es simultaneo, por lo que dificilmente se puede distinguir entre lo importante y lo secundario.\r\n b8- muy buena utilizando todos los recursos disponibles'),
(4621, 606, 1, 'B', 'A3- Por el cargo, debo estar presentes en otros equipos de trabajo: mejora kaizen, Responsabilidad Social Corporativa. \r\nB1- he procurado participar en los proyectos de creación de nuevas herramientas: B-First, BPMS... B4- no tengo conflictos con grupos de personas distintas.  C3.  El depto. ha sufrido diversas situaciones a lo largo de estos años, ha sido imprescindible ser flexible para el buen funcionamiento del trabajo. '),
(4622, 606, 2, 'B', 'A1- en el dpto. procuramos compartir nuevos conocimientos adquiridos.A3- nos vamos adaptando a las nuevas herramientas, p.ej. las nuevas plataformas de las navieras para la gestión de envíos.  \r\n A4- B1- es imprescindible compartir los conocimientos que puedan afectar a las otras áreas: temas de precios para comercial etc.. C2 participo de algún curso relacionado: Ateia- \"La función del transitario\". '),
(4623, 606, 3, 'A', 'A2-todos los equipos estamos interconectados, por lo que es imprescindible el intercambio para el buen funcionamiento de la empresa. A4- procuro comunicarme de manera sosegada y mostrar empatía con el otro.  B2. Toda información relacionada con el día a día en el  trabajo o conocimientos adquirido sobre el transporte mar/tir deben ser compartidos. . B3- reporto siempre a mi superior cuando los temas puedan afectar a la empresa. B4.Procuro estar atenta de las necesidades del equipo a nivel laboral y personal para poder intervenir si es necesario. C2. procuro dar la información de forma concreta para no perdernos de lo realmente esencial. C4. queda siempre por mejorar, inevitablemente anteponemos nuestras opiniones, que aunque escuchemos al otro, la respuesta sigue nuestro patrón.'),
(4624, 606, 4, 'A', 'A1- mejor consensuar con mi superior si la decisión es impopular. A2 si tengo clara la acción a tomar, no preciso revisarlo con el equipo.  B4- Tomar decisiones ante situaciones nuevas es parte de mi rol de mando intermedio. C1-la experiencia nos permite discernir entre urgente e importante. C3-la tendencia propia y el ritmo de trabajo, obliga tomar decisiones de forma inmediata.  '),
(4625, 606, 5, 'A', 'A3-depende de la motivación del colaborador. A4 la motivación propia del colaborador determina su trabajo, por mi parte lo que procuro es crear un ambiente de calma y no saturación, colaboración mutua, para que al menos el ambiente sea cómodo y confiado. el ejemplo es el mejor maestro.'),
(4626, 606, 6, 'B', 'A1 no dispongo de las herramientas para diseñar planes específicos vinculados a las competencias. A3. Todo el dpto. debe estar capacitado para llevar cualquier tipo tipo de envío. B1 la reunión de las competencias es un momento para revisar inquietudes personales. el resto del año nos reunimos si surge algún conflicto puntual. El dpto. es pequeño y nos vamos comunicando en el día a día para hacer las mejoras necesarias. C2- si me ofrecen nuevos cursos, los acepto. '),
(4627, 606, 7, 'A', 'A3- a los colaboradores les transmito: en el trabajo nos debemos sentir como en casa y a los compañeros tomarlos como miembros de nuestra familia (pasamos la mayor parte de nuestra vida en el trabajo). B1- procuro motivarles en confianza. B3. transmito al equipo la importancia de atender el teléfono cuando no se encuentra la recepcionista. C2 Abierta a recibir opiniones de mi superior.'),
(4628, 571, 17, 'A', 'Competencia muy importante:\r\nSi sumamos esfuerzos, multiplicamos resultados.'),
(4629, 571, 18, 'B', ''),
(4630, 571, 19, 'A', 'En el Área Financiera es muy importante esta competencia'),
(4631, 606, 8, 'A', 'A2 El mismo trabajo te reta en el día a día- con cambios imprevistos continuamente, te obligan a tener dominio de uno mismo. C3- procuro no molestar a mi superior si le puedo dar una solución al conflicto. No obstante le mantengo informado si se trata de un asunto delicado. '),
(4632, 525, 17, 'A', 'C1- constante apertura en compartir conocimientos al dpto. C2- En ocasiones nos podemos sobrecargar- tener en cuenta que se dispone de una jornada reducida.  \r\nSiempre atenta a las necesidades del equipo. B8 muy disponible para los compañeros.'),
(4633, 525, 18, 'B', 'Tiene una visión muy comercial en cuanto a buscar alternativas que favorezcan tanto al cliente como al beneficio económico de la cía. '),
(4634, 525, 19, 'A', 'B5- auto-exigencia y rigidez en su trabajo. Trabajo muy enfocado al resultado beneficioso en cuanto al servicio al cliente y al beneficio económico para la empresa.'),
(4635, 606, 9, 'B', 'Grado A.3-ante una incidencia, es imprescindible hacer un estudio detallado del origen y de las repercusiones.\r\nGrado B.4- la experiencia me permite identificar los errores con más facilidad.'),
(4636, 606, 10, 'A', 'Grado A.1. la auténtica intención siempre es descubierta, por lo que es vital ser honesto primero con uno mismo para serlo con el otro. 2.Procuro abandonar ideas preconcebidas, pero no siempre es tarea fácil.\r\nGrado B. Es imprescindible un buen clima de trabajo para lo productividad del dpto. Grado C2- Inevitablemente las tensiones en el trabajo pueden crear reacciones negativas- imprescindible practicar la paciencia y comprensión del otro. 3. Cada colaborador ha sido indicado personalmente que se debe evitar la crítica al compañer@.'),
(4637, 606, 11, 'C', ''),
(4638, 606, 12, 'B', 'Grado A. Con la experiencia he podido comprobar que la manera más eficaz de inspirar y conseguir confianza es con mis propias acciones y no desde el imperativo mandato.2 - Estrategia: Al ser parte del equipo operativo, procuro mostrar todo el interés posible en las gestiones diarias e involucrarme tanto o más en las tareas más insignificantes, como ejemplo de compromiso con el equipo y con la empresa. 4. Procuro tener muy en cuenta a los otros depts e inspirar esta actitud al resto del equipo.\r\nGrado B. 3- las cargas de trabajo están repartidas de acuerdo con las necesidades comerciales y las capacidades/aptitudes de cada colaborador'),
(4639, 606, 13, 'A', 'Grado A.1. desde tráfico estamos en comunicación constante con el cliente, por lo que somos comunicados en todo momento de sus necesidades o insatisfacciones. 4.Es importante darle al cliente plena confianza por lo que la actitud positiva le da tranquilidad. El cliente es el motor principal en una empresa de servicios, por lo que es importante atenderlo con todo detalle.  Grado C. el cliente interno es tan importante como el externo para propiciar la armonía. De la misma manera los proveedores deben ser bien atendidos.');
INSERT INTO `com_dic_usr_com` (`duc_id`, `duc_du_id`, `duc_com_id`, `duc_grado`, `duc_observaciones`) VALUES
(4640, 606, 14, 'B', 'Grado A 2. Procuro ser honesta en mis argumentos y creo que es la mejor manera de persuadir. A2.la fiabilidad depende de los criterios de cada uno, no siempre se coincide. B2- me baso en una intención que pueda surgir de la bondad, aunque pueda estar confundida. C1- no siempre me resulta fácil estar al 100% en modo escucha, ya que las ideas preconcebidas nos enturbian. C3- puedo ser un poco testarud. C4- empeño le pongo'),
(4641, 606, 15, 'A', 'A1. Lo prioritario Siempre es que le trabajo salga adelante, y que los cambios no afecten al servicio. (cambios de personal, épocas de mucho volumen, nuevos miembros a los que formar etc...). A2-Procuro mantener la calma, aunque si se acumulan diferentes frentes de estress no siempre es fácil. B1-procuro estar abierta y receptiva a los cambios, confiando que son buenas oportunidades para madurar. B4-Cuando la decisión es compleja, siempre consensuo con mi superior.'),
(4642, 606, 16, 'B', 'A2. Por el tipo de demanda y de impermanencia en este trabajo, no es fácil crear un proceso estructurado.A4-B1 B3 Teniendo claros los protocolos, es necesario adaptarse según surgen los imprevistos. A3-. Estoy atenta a las capacidades del grupo para distribuir las tareas según sus destrezas. C3 el tipo de trabajo requiere de estar atento y gestionar diferentes frentes.'),
(4643, 590, 1, 'B', ' Quizás cuestiono  otros puntos de vista si no los veo muy claro, pero si finalmente  es bueno para la organización  los acepto.'),
(4644, 590, 2, 'B', ' En 2019 realicé  Diploma   en Derecho  Aduanero de la Unión Europea  para  poder  realizar el  siguiente  curso de  Representante Aduanero  para  2021. También seria interesante realizar curso en  Servicios Paraaduaneros ya que aveces  no estamos muy seguro de como realizar procedimientos.'),
(4645, 590, 3, 'B', 'puntos a mejorar: debo de seguir revisando mi discurso  verbal   que sea controlado  y que sea claro para no entorpecer  la resolución de conflictos.\r\n Quizás la inercia del día a día  no me  permite  conocer al  100 % las necesidades  de mis colaboradoras.'),
(4646, 505, 1, 'B', 'C1.Por norma general se evitan los conflictos.\r\nB7. Hay un mayor interés en atender nuevos envíos y clientes con casuísticas diferentes a las habituales. \r\nA10-11. Cada vez hay más confianza en compartir información. '),
(4647, 590, 19, '', ' seguir sin perder  los objeticos  que  me han marcado'),
(4648, 505, 2, 'B', 'C3. Debido a las nuevas tecnologías, es necesario adaptarnos y registrarnos ej. en las nuevas webs de navieras.B7- Salir de la zona de confort, en ocasiones cuesta. \r\nB8. Si, y nos vamos reciclando.\r\n'),
(4649, 593, 1, 'A', 'GRADO B - El año 2019 ha sido el principio de varios cambios que nos esperan en el futuro, creo que lo he ido superando sobre la marcha y a fuerza de trabajo.'),
(4650, 593, 2, 'B', ''),
(4651, 593, 3, 'A', 'Con mi colaborador tenemos una buena comunicación tanto laboral como personal, es la forma de mantener un buena relación y entender los comportamientos de las personas.'),
(4652, 593, 4, 'B', 'Sigo tomando decisiones en mi trabajo diario, por la propia experiencia, pero últimamente me resulta un  poco más difícil por la dinámica de la empresa.'),
(4653, 593, 5, 'A', 'Mi colaborador me ha demostrado que ha asumido el  nivel de responsabilidad, al que yo misma estoy acostumbrada.'),
(4654, 593, 6, 'B', ''),
(4655, 593, 7, 'A', ''),
(4656, 593, 8, 'B', ''),
(4657, 593, 9, 'A', ''),
(4658, 593, 10, 'A', ''),
