(4661, 593, 13, 'B', ''),
(4662, 593, 14, 'B', ''),
(4663, 593, 15, 'B', 'En este punto este año he sentido momentos de inseguridad, pero con un cambio de actitud superé las situaciones. Sabiendo que nos esperan tiempos complicados. '),
(4664, 593, 16, 'A', ''),
(4665, 592, 1, 'A', ''),
(4666, 593, 17, 'A', ''),
(4667, 592, 2, 'A', 'Soy autodidacta, me gusta buscar información a temas que no domino'),
