(4674, 592, 7, 'A', ''),
(4675, 592, 8, 'A', 'creo que es bueno cada cierto tiempo un cambio de rutinas, para salir de la rutina del día a día '),
(4676, 592, 9, 'A', ''),
(4677, 592, 10, 'B', ''),
(4678, 590, 7, 'B', ' grado B  pregunta  2: puntualizo  que  el desempeño y alcance de objetivos   es primeramente  por mi misma y no  sólo  por ser bien valorado por mi superior.\r\n grado A  pregunta 4   este año Lucia esta en la comisión  de medio  ambiente  que se ha creado  al ser bueno   para sentirse parte del grupo .\r\ngrado A  pregunta 3  quizás  las  inercia del día hace que no se tenga el suficiente tiempo  para   escuchar todas las ideas que se proponen.'),
(4679, 592, 11, 'A', ''),
(4680, 592, 12, 'B', ''),
(4681, 592, 13, 'A', ''),
(4682, 590, 13, 'A', 'Grado A  pregunta 1  quizás debería reunirme más a menudo con clientes  y realizar  seguimiento más cercano para ver puntos a mejorar en nuestros servicios.\r\nCon el problema que tuvimos con nuestro cliente VIP Capotex se priorizó el mantenerlo como cliente  a pesar de que tuvimos que asumir los costes por desperfectos del contenedor.\r\n'),
(4683, 592, 14, 'B', ''),
(4684, 592, 15, 'A', ''),
(4685, 592, 16, 'A', ''),
(4686, 592, 17, 'A', 'actualmente formamos un buen equipo. Colaborando  unas con las otras sin necesidad que se requiera. '),
(4687, 592, 18, 'B', ''),
(4688, 592, 19, 'B', ''),
(4689, 557, 1, 'C', ''),
(4690, 505, 3, 'B', 'A10. Hay una mejora en cuanto a comunicar incidencias que puedan surgir, vamos ganando confianza. La apertura en cuanto a comunicar es imprescindible para generar confianza tanto a nivel interno como externo. \r\n'),
(4691, 505, 4, 'B', 'C1- Ante incidencias, es posible necesitar la comprobación y facilitar el trabajo. 1-3 - hay más apertura a comunicar las situaciones complicadas en la mesa. Debemos recordar que podemos contar con el apoyo del compañero. \r\nSiempre que hay presencia, se consigue una  buena búsqueda de soluciones ante incidencias y su correspondiente seguimiento.  '),
(4692, 505, 7, 'B', 'Es importante comprometernos con la organización: le da un sentido a nuestro trabajo y a la vida. '),
(4693, 505, 8, 'B', 'C3. en ocasiones puede costar salir de la zona de confort, pero cada vez hay más apertura a aceptar nuevos retos. \r\nc4- poder ofrecernos más al compañero cuándo sea necesario? B6 los 10 años de experiencia son un plus, esta es la clave para el autodominio y autoafirmación. A10-con la madurez se va adquiriendo más firmeza. '),
(4694, 505, 9, 'B', '9. Seguiremos pendientes de los detalles, para la gestión de envíos.\r\nEste trabajo requiere de mucha presencia y atención al detalle, pues cualquier error en un detalle da lugar a una incidencia. La atención cada vez es mayor.'),
(4695, 505, 10, 'B', 'Como normalmente, intentamos empatizar con el cliente/ compañero - esto favorece al depto. especialmente si podemos ayudarle. \r\nA9-11- hay muy buena voluntad en ser entendido para un buen hacer del trabajo. '),
(4696, 505, 11, 'B', 'C1-4-Cada vez más, las nuevas tecnologías nos obligan a estar al día con nueva formas de trabajo, Webs, gestiones on-line.. vamos saliendo cada vez más de la zona de comfort.'),
(4701, 554, 1, 'B', ''),
(4697, 505, 13, 'B', 'C1- No, Cada vez hay más auto-confianza por lo que hay más capacidad de salir de los protocolos establecidos. C2.grado A cada vez hay más atención al cliente por lo que estamos arrancando con nuevos clientes..  '),
(4698, 505, 14, 'B', 'C1-Es necesario un poco más de imposición, en cuanto a atender mails y requerimientos de los clientes. La mejor influencia es dedicación y atención al trabajo.  C5 Se requiere algo más de esfuerzo si el trabajo lo requiere.-'),
(4699, 505, 15, 'B', 'En general es una persona que mantiene muy bien la calma en momentos de presión. Podemos sostener la presión y atender más a las prioridades y urgencias que requiere el trabajo. '),
(4700, 505, 16, 'B', 'Mantenemos la prioridad de las diferentes tareas de los envíos y de mantener al cliente siempre bien informado.\r\n10.11- Las prioridades las marcan el ritmo del trabajo con sus diversas casuísticas, por lo que preciamos de atención '),
(4702, 554, 2, 'A', 'GRADO A - Actualizo constantemente mis conocimientos de SAP, y al estudiar inglés me ayuda en la comunicación con las filiales.'),
(4703, 554, 3, 'B', ''),
(4704, 554, 4, 'B', 'GRADO C - Toma decisiones de mi trabajo diario las solvento yo, pero la toma de decisiones importantes que pueden afectar significativamente al resultado del mes (amortizaciones, etc..) las consulto antes.'),
(4705, 554, 7, 'A', ''),
