(4717, 590, 5, 'B', 'Grado  A  asignar autoridad a otras colaboradoras    para  llevar a cabo   tareas  especificas   y así tener más tiempo  para enfocarse  a otros temas más importantes .\r\nDemuestro confianza  con colaboradores  teniendo en cuenta la antigüedad de cada una.\r\n'),
(4718, 590, 11, 'A', 'grado C. dependiendo del problema  puedo necesitar  consultar a mis superiores o no.\r\n'),
