(4734, 503, 19, 'B', 'grado c punto 1: existen objetivos que dependen de terceras personas no de uno mismo.'),
(4735, 505, 17, 'B', '8.9 Seguiremos disponibles para nuestros compañeros.'),
(4736, 505, 18, 'B', 'Desde tráfico nuestra visión  de negocio se basa en mantener un buen servicio y atención al cliente.'),
(4737, 505, 19, 'B', 'Seguimos cumpliendo con lo requerido en las distintas áreas: bookings, respuestas mail, preaviso bls, envio bls, comunicaciones de incidencias etc...'),
(4738, 606, 17, 'A', 'A4 Intento ser equitativa con los miembros del equipo, valorando las virtudes personales de cada uno- para un buen funcionamiento del dpto. B3 Prefiero comportarme y trabajar como un miembro más del equipo y no marcar distancias de superioridad. En ocasiones, el colaborador puede desvalorizar el rol de jefe. Mantener el equilibrio no siempre es fácil. B4. Procuro estar atenta a las necesidades del equipo, para p.ej. equilibrar el trabajo. C4- Si, además de cumplir con mi función de cargo intermedio'),
(4739, 606, 18, 'C', 'A2. B1 Debería poner más atención a la situación del mercado. B3.4- podrían ser puntos más de competencia comercial. '),
(4740, 606, 19, '', 'A1 la demanda de trabajo en nuestra área corresponde a objetivos continuos, en cuanto a que cada cliente / envío debe ser atendido para una satisfacción de servicio exclusivo y personalizado. '),
(4741, 541, 1, 'B', 'Personalmente, valoro mucho la empatía e intento tenerla en mi vida diaria.'),
(4742, 541, 2, 'B', 'Este año me he reincorporado a las clases de inglés, considero que está siendo muy positivo tanto a nivel personal y como a nivel profesional.'),
(4743, 541, 3, 'B', 'Estoy trabajando en tener más seguridad en los datos que aporto y en tener más corrección en mi trabajo. Espero ir mejorando en ello.'),
(4744, 541, 4, 'B', 'Soy consciente de que a veces me cuesta priorizar problemas, este año he intentado trabajar en ello y haciendo listas por prioridades. Espero seguir mejorando porque esto me ayudará a ser más organizada y eficiente en mi trabajo.'),
(4745, 541, 7, 'B', ''),
(4746, 541, 8, 'B', 'Estoy trabajando la corrección en mi trabajo, estoy revisando más mis trabajos para ser más metódica y cometer menos errores.'),
(4747, 541, 9, 'B', 'Intento buscar soluciones a los problemas del día a día a medida que se van presentando. '),
(4748, 541, 10, 'B', ''),
(4749, 541, 11, 'B', ''),
(4750, 541, 13, 'B', 'Creo que estoy muy limitada en muchas cuestiones que se plantean en este apartado por no tener trato directo con Clientes.'),
(4751, 541, 14, 'B', 'Creo que a veces debo tener más precisión en mi trabajo, soy consciente y estoy trabajando en ello.\r\nIntento estar abierta a las opiniones de los demás.'),
(4752, 541, 15, 'B', 'Estoy trabajando el priorizar mis tareas y creo que voy mejorando. Seguiré trabajando en ello para mejorar aún más.'),
(4753, 541, 16, 'B', 'Estoy trabajando para poder realizar tareas de forma simultánea y no desorganizarme.'),
