(4805, 598, 1, 'A', 'Para mi esta competencia es básica en nuestra área ya que cuando se trata con clientes has de estar muy abierto a la flexibilidad y a los cambios.\r\nCreo que he mejorado en este último año. \r\nEn el punto A.2 --> creo que cada días me desenvuelvo mejor en diferentes situaciones\r\nEn el punto A.4 --> me adapto más y tengo más en cuenta los puntos de vista de los demás. \r\n'),
(4806, 598, 2, 'B', 'En esta competencia me veo bastante igual. \r\nMe gusta aprender siempre cosas nuevas pero si es cierto que a veces el día a día hace muy complicado el poder dedicarme a formación propia. \r\nSiempre abierta a el autoaprendizaje a pesar de mi falta de seguridad. '),
(4807, 598, 3, 'B', 'Considero que he mejorado esta competencia. \r\nCreo que me comunico mejor con las personas de mi área por ejemplo, pero también considero que me falta mucho camino por recorrer a la hora de expresarme.  '),
(4808, 598, 4, 'A', 'Sigo considerándome en la A en esta competencia. Si es cierto que el A.1 de momento me cuesta.'),
(4809, 598, 5, 'B', 'Creo que esta competencia es una de las que más he trabajado estos últimos meses. Entre ellos Noviembre y Diciembre 2019 debido a mi baja maternal.\r\nConsidero que delego mucho más de lo que delegaba antes. Ha sido por necesidad pero eso me ha ayudado en confiar un poco más en las personas de mi área. De todos modos no confío al 100% aún. Por eso pongo \"no\" en B.1 y C.1'),
(4810, 598, 6, 'B', 'Como en la competencia de \"Delegación\", considero que he mejorado en la \"Dirección y desarrollo de personas\". Aunque no lo necesario para obtener una A.\r\nQueda mucho camino por recorrer\r\n'),
(4811, 598, 7, 'A', 'Mi compromiso y dedicación a la Empresa sigue siendo del 100%.\r\nNo entiendo otra forma de trabajar, '),
(4812, 598, 8, 'C', 'Aunque considero que he mejorado en algunos de los puntos como:\r\nA.2. --> Los cambios siempre me han dado miedo pero creo que estoy más abierta a ellos y más segura de asumirlos\r\nB.3 --> Me cuesta muchísimo tomar una decisión pero cuando la tomo intento hacerlo con firmeza. \r\nAún no me veo suficientemente segura como para \"convencer\" con argumentos. Por lo que mi puntuación continua siendo una \"C\". '),
(4813, 598, 9, 'A', 'En esta competencia me encuentro muy cómoda. Creo que una de mis cualidades es la atención al detalle por lo que mantengo una \"A\"\r\nHe mejorado en el:\r\nGrado A.1 --> La experiencia hace que cada vez pueda analizar información más compleja y detecte \"problemas\" gracias a algún sistema de control'),
(4814, 598, 10, 'B', 'Grado A.3 --> Me sigue costando olvidar ideas u opiniones preconcebidas y eso a veces me dificulta el posible diálogo. \r\nGrado B. 3 --> A veces no entiendo comportamientos de otras personas y me cuesta entender esas actitudes,\r\nGrado C.1 --> No necesito ser escuchada primero. En ese sentido no tengo problema en escuchar a los demás. \r\nNo he mejorado en ninguno de mis puntos débiles de esta competencia. Por lo que mantengo la \"B\"'),
(4815, 598, 11, 'B', 'Quizás he podido mejorar en el punto:\r\nGrado A.3 --> cada día asumo más retos y responsabilidades... o por lo menos eso creo\r\n\r\nMantengo la puntuación. \"B\"'),
(4816, 598, 12, 'B', 'Grado B.3 --> Creo que estoy en el camino de mejora de este punto, pero considero que aún no lo he conseguido al 100%\r\nGrado C.4 --> El día a día y la carga de trabajo hace que a veces no pueda supervisar todo el trabajo de mis colaboradores'),
(4817, 598, 13, 'A', 'Esta competencia está muy clara para mí. Es uno de los objetivos en mi área. Orientar mi trabajo y el de mis colaboradores al Cliente. \r\nConsidero que lo cumplo al 100%'),
(4818, 598, 14, 'C', 'Esta competencia es muy complicada para mí. \r\nMi falta de buena expresión, argumentación y palabra hace que esta competencia me cueste mucho. \r\nEn el Grado A.1 --> quizás puedo llegar a convencer para seguir una línea de trabajo. \r\nContinúo en la puntuación \"C\" \r\nMucho camino que recorrer.'),
(4819, 598, 15, 'B', 'Me siento en la misma situación que el año anterior en esta competencia. Creo que resisto bien a la presión aunque me pongo nerviosa y no transmito tranquilidad'),
(4820, 598, 16, 'A', 'En cuanto a esta competencia, creo que la tengo clara. Sé priorizar mis tareas de mi día a día. Por lo que la sigo calificando con una \"A\"'),
(4821, 598, 17, 'B', 'Sé que en nuestro trabajo es básico el trabajo en equipo, pero a veces me cuesta. Por mi falta de confianza en ocasiones no delego lo suficiente y hace que acabe haciendo el trabajo, por lo que creo que eso va en contra del trabajo en equipo. De todos modos intento mejorar ese aspecto de mi comportamiento. \r\nPor otro lado, intento tener un buen ambiente en nuestro equipo de trabajo y creo que lo consigo. Por ese motivo me califico con una \"B\" como el año anterior. '),
(4822, 598, 18, 'C', 'En cuanto a esta competencia, hay muchos puntos que creo que no me aplican. Son a otros niveles de la empresa.'),
(4823, 598, 19, 'A', 'He puesto dos NO\'es en Grado A.2 y 3  ya que son ámbitos en los que no participo, pero siento que mi trabajo en contacto con los clientes está totalmente orientado a resultados por lo que mi puntuación es una \"A\"'),
(4824, 497, 1, 'A', 'Me identifico con esta competencia. Me adapto con facilidad a los diferentes entornos y a los diferentes interlocutores.'),
(4825, 497, 2, 'A', 'Habitualmente busco información para responder a dudas que me surgen en mi trabajo diario, ya sean de alguna tematica en concreto o de como usar nuevas tecnologias....\r\nLas conocimientos que adquiero me gusta compartirlos.\r\nEn cuanto a la capitalización de experiencias de  otros y la propia, una buena fuente son los talleres de trabajo y el compartir buenas prácticas, siempre enriquece.'),
(4826, 497, 3, 'B', 'Adapto la manera de comunicarme, dependiendo a quien o quienes me dirijo, ya sea por escrito o verbal, mi finalidad es que el mensaje sea claro y entendible.\r\nMe adapto en los grupos de trabajo, observo y actuo en consecuencia. \r\nSi se dirigen a mi, escucho de manera activa,e interactuo hasta haber comprendido el mensaje.'),
(4827, 497, 4, 'B', 'Considero que sí tengo la capacidad de autonomia y toma de decisiones. No quiere decir que ello sea fácil, pero si tener la capacidad de valorar pros y contras y tomar una decisión.'),
(4828, 497, 7, 'A', 'Mi compromiso y dedicación a la compañia ha sido desde el primer momento el máximo. Trabajo por mis objetivos especificos y por los objetivos de la empresa, porque al final todos son objetivos propios. Si la compañia va bien, será bueno para todos. Pienso que una buena imagen, es lo que mas puede favorecer a cualquier cosa, una compañia, una persona, un pais. por tanto, siempre que tengo oportunidad, busco proyectar esa buena imagen, a través de un telefono, de una red social o en directo. '),
(4829, 497, 8, 'B', 'Poco a poco he ido adquiriendo confianza y autoafirmación en las tareas que desempeño a nivel general. Bien es cierto que cuando una tarea es nueva o no has tenido contacto con la materia, puedes tener dudas, pero las dudas, tambien pueden resolverse y finalizar los trabajos con éxito.'),
(4830, 497, 9, 'A', 'Me siento satisfecha cuando el trabajo está realizado, si hay problemas o dificultades; observo, analizo e investigo hasta obtener la solución. '),
(4831, 497, 10, 'B', 'Opino que tengo capacidad de escucha y sensibilidad hacia los demás. Tambien es cierto que a veces por no parecer entrometida, no pregunto y se podria interpretar como falta de interés.'),
(4832, 497, 11, 'A', 'En mi opinión, actuo con iniciativa e innovación ante las tareas asignadas y ante la vida en general.'),
(4833, 497, 13, 'A', 'En mi forma de ser está implicita la ayuda al otro. Favorecer y facilitar la existencia, las tareas, la vida de los demas, siempre que me es posible.'),
(4834, 497, 14, 'C', 'Considero que no dispongo de capacidad de persuasión. Prefiero aceptar la opinion de otro aunque no la comparta que entrar en debate.'),
(4835, 497, 15, 'A', 'Pienso que la resistencia a la presión, se adquiere después de un largo bagaje sometido a las diferentes situaciones a las que la vida te expone; ya sea laboral, personal y/o familiar.'),
(4836, 497, 16, 'A', 'Planifico y organizo mis tareas para dar respuesta en tiempo y forma a los objetivos que tengo asignados'),
(4837, 497, 17, 'B', 'Considero que me implico, colaboro y coopero con los demás, tanto si es un tema que me afecta directamente, como si no lo és. Pero a la hora de trabajar, prefiero hacerlo de manera individual.'),
(4838, 497, 18, 'C', 'Pienso que en esta competencia tengo recorrido de mejora. No tanto en los aspectos de RSC, sino en los propios del negocio de la compañia.'),
(4839, 497, 19, 'A', 'Conozco mis objetivos y me planifico para poder alcanzarlos, aunque en algunas ocasiones alcanzar esos objetivos no dependen solo de mi . Un tema a veces de dificil solución'),
