(191, 'Abril-Junio', 'Necesitamos:  mayor insistencia en seguimiento temas (objetivo conseguir la info, ej: aptos medicos, vacaciones), mejorar proactividad (mejoras para incidencias repetitivas control presencia, investigar nuevo soft, ..), ganar fiabilidad y eficiencia sin ayuda de Dir. RRHH (ej: reports vacaciones Dirección)', 9, 345, 0),
