(193, 'Abril-Junio', 'Trabajando en parametrización desde principios de Junio.  Hasta el momento, realizada carga de trabajadores y definida estructura organizativa (areas, departamentos y centros de coste).  Trabajando actualmente en requerimientos para desarrollo modulo Formación.  Previsto en Agosto validar datos cargados de 8 años histórico formación', 6, 351, 0),
