(196, 'Abril-Junio', 'Se ha demorado publicación memoria por impacto certificacion ISO y auditorias varias.  Ultimo cuatrimestre debemos estudiar nuevo enfoque 2016 y valorar nuevamente intervención externo, para expandir RSC a toda la compañia y adecuarnos a parámetros GRI v.4', 10, 351, 0),
