(1053, 'Anuales', 'A lo largo del año, se han gestionado las acciones en materia de PRL en las diferentes delegaciones, de acuerdo a la planificación prevista. Se han aperturado 2 centros de trabajo. Y se han coordinado las diferentes actividades empresariales. Este trabajo se ha llevado a cabo en colaboración con los diferentes técnicos según comunidad, con Javier y con Mercedes.En cuanto a la plataforma para llevar a cabo el CAE, hicimos el estudio y valoramos un proveedor, actualmente está pendiente de implantación.', 5, 722, 0),
(1054, 'Anuales', 'Hemos conseguido crear una dinamica trabajo, con periodicidad trimestral, para realizar el seguimiento y documentación del Plan. En la última reunión, la asistencia no fue del 100% de los directores lideres de los diferentes proyectos, sí mantuvimos reuniones previas con los directores que no pudieron asistir.', 6, 722, 0),
