(1056, 'Anuales', 'A lo largo del año, se han replicado las diferentes acciones RSC llevadas a cabo en Barcelona, incluyento tambien los newsletter sobre salud. Tenemos pendiente de estudio replicar escuela de espalda y taller de deshabituación tabaquica.', 8, 722, 0),
(1057, 'Anuales', 'Se ha cumplido el presupuesto confeccionado para RSC. De una previsión anual de 58.605 euros, hemos efectuado un gasto real de 54.029 euros. Nos ha quedado un saldo en positivo de 4.576 euros.', 9, 722, 0),
(1058, 'Octubre-Diciembre', 'En reunión Consejo Administración de febrero 2018 se acuerda que debido a los malos resultados de la Compañía, no se pague el bonus a Cristina Casado', 0, 723, 0),
(1059, 'Octubre-Diciembre', 'Victor logro ontener cueros de buena claidda de la curtiembre - mas alla de la dificuylytad que representa', 0, 724, 0),
(1060, 'Octubre-Diciembre', 'Victor logro encara la produccion en Ubrique ', 0, 724, 0),
(1061, 'Octubre-Diciembre', '', 0, 724, 0),
(1062, 'Anuales', 'En reunión Consejo Administración de febrero 2019 se acuerda pagarle únicamente el objetivo de renovación de Certificaciones', 0, 715, 0),
(1063, 'Octubre-Diciembre', 'Replicada en todas las delegaciones las siguientes acciones RSC; apoyo a la campaña de cancer de mama, espacios cardioprotegidos, recogida de juguetes para la campaña de navidad y reyes, y campaña higiene de manos.', 8, 793, 0),
(1064, 'Octubre-Diciembre', 'Falta mejorar fluidez con miembros CE (con todos) y mejorar timmings tanto de cierre de actas como de convocatoria reuniones pre y post CE', 7, 793, 0),
(1065, 'Octubre-Diciembre', 'Soco:  correcta la gestion realizada para nuevo centro SF, dentro de toda la improvisacion que nos ha impedido cualquier tipo de planificación', 8, 793, 0),
(1066, 'Anuales', 'De una previsión anual de 58.605 euros, hemos efectuado un gasto real de 54.029 euros. Nos ha quedado un saldo en positivo de 4.576 euros.', 7, 620, 0),
(1067, 'Anuales', 'Proyecto parado por otras circunstancias vinculadas a servicio nomina.', 8, 620, 0),
(1068, 'Anuales', 'El trabajo con nuevo centro Almacén SF y todas sus particularidades considero es ok, mas teniendo en cuenta la falta de prevision absoluta.  Hemos trabajado sobre la marcha, sin posibilidad alguna de planificación / reflexion previa a cambios', 9, 620, 0),
