(1239, 'Anuales', 'El gestor documental no se ha implantado al 100% el 31/12/2019 ya que por cuestion de negocio, se han tenido que modificar las prioridades durante el año. No obstante se valora al 100% ya que todas las etapas planificadas en el nuevo calendario para 2019 se han cumplido en tiempo y forma', 9, 908, 0),
(1240, 'Anuales', 'El gestor documental no se ha implementado al 100% el 31/12/2019. Por cuestiones de negocia ha habidonecesidad de cambio de prioridades. Se valora al 100% porque todas las etapas planificadas en el segundo calendario se han realizado en tiempo y forma.', 10, 832, 0),
(1241, 'Anuales', 'Se da como 100%. Se ha realizado todo el proyecto sin el último tramo de validación y carga final a producción. Esta última fase se retrasó debido a auditorias varias con lo que no se pudo finalizar.', 7, 837, 0),
(1242, 'Anuales', 'Se inició un estudio previo, pero se paró debido a la reimplantación de IP6 y era dos frentes inasumibles a la vez. En substitución de este punto se ha desarrollado: 1) en el proceso de tráfico aereo avisos específicos según criterios de destino, compañía aerea, cliente, etc.. 2) en el proceso tráfico aéreo se ha desarrollo notificaciones aereas  ', 5, 837, 0),
(1243, 'Anuales', 'Se ha migrado motor IP6 y Oracle, queda pendiente la parte java cliente. Las razones de no implementarlo es por falta de recursos por parte del proveedor.', 6, 838, 0),
(1244, 'Anuales', 'Se ha migrado motor IP6 y Oracle, queda pendiente la parte java cliente. Las razones de no implementarlo es por falta de recursos por parte del proveedor. Se ha dado soporte técnico a la reimplantación de IP6 en SF.', 4, 900, 0),
(1245, 'Anuales', 'Se ha migrado motor IP6 y Oracle, queda pendiente la parte java cliente. Las razones de no implementarlo es por falta de recursos por parte del proveedor. Y ha colaborado dando soporte técnico a la reimplantación de ip6 en SF.', 5, 836, 0),
(1246, 'Anuales', 'Se han testeado varias plataformas de tickets, incluyendo una proporcionada por Bytemaster. En el último tramo de año dentro de sinergias con Grupoinsud frenamos la selección/implantación.', 8, 838, 0),
(1247, 'Anuales', 'Se da como 100% debido a que no se pudo implantar debido a que tanto AFS como Bytemaster tenían que acabar de desarrollar el interfase. En fechas actuales está ya realizado y pendiente de empezar a realizar pruebas en real con las áreas usuarias.', 5, 835, 0),
(1248, 'Anuales', 'Se ha desarrollado en algunas áereas la parte documental en Bfirst. No hay un despliegue completo. Doy el 100% por que se han realizado los siguientes proyectos: Upgrade bfirst, creación de dos entornos para los sistemas de calidad (ShareMe), resolución incidencia Exchange Agosto con múltiples festivos y jornadas eternas, eliminación impresoras matriciales y como proyecto de más impacto adaptación bfirst a nuevos criterios de facturación GrupoInsud', 7, 835, 0),
(1249, 'Anuales', 'Se dispone de un piloto para poder implantar en HIPRA', 6, 900, 0),
(1250, 'Anuales', 'Se dispone en entorno de integración de un piloto, pendiente que finalice el proyecto de AFS para poder publicar el tracking aereo.', 8, 900, 0),
(1251, 'Anuales', 'Se ha dado el 100%, finalmente el proyecto no se ha realizado en el 2019. En substitución se han realizado otros proyectos: creación de sites para todos los nuevos clientes 2019 solicitados, diseño nuevo software captura de fotografía, carga automatizada Farmamix/Medicalmix', 11, 900, 0),
(1252, 'Anuales', 'La valoración final de los Objetivos que controla Alexandra, la hemos hecho Santi y yo ya que Alexandra no pasó la valoración del IV trim. y la valoración final después de reclamársela en varias ocasiones', 0, 899, 0),
